(17,	'',	'美股｜市場等待經濟數據公布　道指早段跌逾百點　油價上升',	'截至本港時間晚上11時18分，道指報38,948點，跌120點或0.31%；納指報16,007點，升30點或0.19%；標普500指數報5,070點，升1點或0.02%。\r\n油價上升，紐約原油期貨現時每桶報 78.21美元，升0.63美元或0.81%；倫敦布蘭特期油報 81.97美元，升0.30美元或0.37%。\r\n美國周四將公布1月份個人消費支出（PCE）物價指數，為聯儲局擬定政策時參考的重要通脹指標。根據芝商所的FedWatch工具，目前63%的交易員預計聯儲局將在6月前開始降息，低於上月底的近98%；預計7月降息的比例為83.6%。\r\n另外，世界大型企業研究會（Conference Board）公布，美國2月份消費者信心指數為106.7，低於市場預期的115。',	'2024-02-28 02:21:42.467',	NULL,	'HKEX',	'美股｜市場等待經濟數據公布　道指早段跌逾百點　油價上升',	NULL),
(18,	'',	'雷蒙多：2030前美國生產全球20%最先進邏輯晶片',	'她在講話中也提到台積電，承諾確保其在亞利桑那州的廠房成功。\r\n雷蒙多（Gina Raimondo）稱，如美國依賴幾個亞洲國家提供最先進的晶片，那麼該國將無法領導全球。\r\n她解釋稱美國的《晶片與科學法案》（CHIPS）將有助於改變這一局面。她稱，美國認為，美國對尖端邏輯晶片的投資、生產將使這個國家有望在本世紀末的尖端邏輯晶片產量，將佔全球整體20%。她說：「我們今天是零。」',	'2024-02-28 02:21:42.470',	NULL,	'HKEX',	'雷蒙多：2030前美國生產全球20%最先進邏輯晶片',	NULL),
(19,	'',	'Honor to launch its first foldable flip phone to challenge Samsung ',	'<p>BARCELONA — Honor will launch a foldable flip phone this year, the company’s CEO told CNBC, marking the Chinese technology firm’s first foray into the vertical-folding style of smartphone that has been popularized by brands like Samsung and Motorola.</p><p>“Foldables” refer to smartphones with displays that bend. There are two styles right now on the market — smartphones that fold like a book and those that fold vertically like an old school flip phone but without a visible hinge.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The move to launch a flip foldable is in line with Honor’s push into the premium end of the market where it’s looking to challenge companies like Samsung and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/AAPL/\">Apple</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>.</p><br /><p>“This year we are preparing for the flip phone launch — now that we are internally in the final stage,” George Zhao, CEO of Honor, told CNBC in an exclusive interview at the Mobile World Congress in Barcelona.</p><p>“We are very positive about foldables for the future.”</p><p>Honor already has a number of foldable phones on the market. The latest one is the <a href=\"https://www.cnbc.com/2023/09/01/honor-magic-v2-foldable-phone-launch-specs-price-details-.html\">Honor Magic V2 that it launched last year</a>. But all of Honor’s current foldables are the book style of the folding device.</p><br /><p>The entry into flip foldables will expose Honor to a different price point. The flip style of phones, such as <a href=\"https://www.cnbc.com/2023/07/26/samsung-galaxy-z-flip-5-and-galaxy-fold-specs-price-details.html\">Samsung’s Galaxy Z Flip 5</a> are often priced cheaper than the horizontal-style folding devices.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Foldables are seen as high-end devices in the world of smartphones. Sales for premium smartphones, those over $600, likely grew in 2023 while the overall market declined, according to Counterpoint Research. This is one reason that Honor is targeting the high-end market.</p><p>Sales of foldable phones are set to rise 40% year-on-year to 22 million units in 2024, according to Counterpoint Research. But Neil Shah, partner at Counterpoint Research, said demand for the flip foldable may be slowing because “expectations of aggressive pricing of the flip form factor has been difficult.”</p><p>“I believe this will create some market gap for newer vendors to enter or expand in the flip segment and test out the market.”</p><p>Honor, <a href=\"https://www.cnbc.com/2020/11/17/huawei-sells-honor-brand-to-consortium-to-keep-budget-smartphone-unit-.html\">a spin-off from Huawei in 2020 as a result of U.S. sanctions</a>, has sought to thrive as an independent brand. <a href=\"https://www.cnbc.com/2023/07/20/honors-magic-v2-foldable-smartphone-as-popular-as-an-iphone-in-china.html\">Honor found early success in China</a> and its focus is now on growing in international markets, where it doesn’t yet feature in the top 5 players globally.</p><p>Zhao said his hope in the next three-to-five years is that sales volumes overseas exceed China.</p><br /><p>Like most device makers at MWC, Honor touted the potential of AI.</p><p>For Zhao, the value of the technology will come when a device is able to anticipate what you’d like to do next.</p><p>For example, you may get a message from a friend to meet for dinner and the device will be able to anticipate whether you want to open the name of the restaurant in a mapping app or reply to the message.</p><p>“In the future, Honor’s strategy is AI to reconstruct the user interaction. It will be intent-based, the user interaction. So maybe when you interact with your phone, it can understand what is your requirement,” Zhao said.</p><p>At MWC, Honor showed off an AI-powered feature on its <a href=\"https://www.cnbc.com/2024/02/25/honor-shows-off-tech-in-magic-6-pro-to-control-a-car-with-your-eyes.html\">Magic 6 Pro handset that can track the user’s eyes</a>.</p><p>The company also showed off a demonstration of a chatbot built on Meta’s Llama 2 AI model.</p><p>Last year, <a href=\"https://www.cnbc.com/2023/11/22/huawei-smartphone-spin-off-honor-plans-ipo.html\">Honor announced its intention to go public</a>. Zhao said preparations are being made for the initial public offering but there is no final timing or destination for the listing.</p>',	'2024-02-28 02:21:43.320',	NULL,	'US',	'Honor to launch its first foldable flip phone to challenge Samsung ',	NULL),
(20,	'',	'CNBC Daily Open: Americans sour on the economy ',	'<p><em>This report is from today’s CNBC Daily Open, our international markets newsletter. CNBC Daily Open brings investors up to speed on everything they need to know, no matter where they are. Like what you see? You can subscribe&nbsp;</em><a href=\"https://www.cnbc.com/sign-up-for-cnbc-newsletters/\"><em>here</em></a><em>.</em></p><br /><p><strong>Mixed bag on Wall Street</strong><br>U.S. stocks <a href=\"https://www.cnbc.com/2024/02/26/stock-market-today-live-updates.html\">ended mixed</a> Tuesday as investors prepared for key inflation data due out later this week. The <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-3\"><a href=\"/quotes/.SPX/\">S&amp;P 500</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and the <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-4\"><a href=\"/quotes/.IXIC/\">Nasdaq Composite</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> closed with small gains, up 0.17% and 0.37%, respectively. The <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-5\"><a href=\"/quotes/.DJI/\">30-stock Dow</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> fell for a second straight day, off by 0.25%. <a href=\"https://www.cnbc.com/2024/02/27/bitcoin-surpasses-56000-benchmark-in-latest-rally.html\">Bitcoin also extended gains</a> rising above $57,000.&nbsp;</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p><strong>Apple kills EV plans <br></strong>Apple has cancelled its plan <a href=\"https://www.cnbc.com/2024/02/27/apple-car-project-canceled-report.html\">to build electric cars</a>, according to Bloomberg. This signals an end to the company’s secretive effort to compete in the EV space against rival <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-8\"><a href=\"/quotes/TSLA/\">Tesla</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>. Reports of Apple’s ambition first&nbsp;<a href=\"https://www.wsj.com/articles/apples-titan-car-project-to-challenge-tesla-1423868072\" target=\"_blank\">surfaced in 2014</a>&nbsp;after it recruited automotive engineers and other talent from auto companies.&nbsp;</p><p><strong>Will South Korean measures work? </strong><br>South Korea’s <a href=\"https://www.cnbc.com/2024/02/28/why-south-koreas-japan-style-measures-to-boost-its-stock-market-may-not-work-.html\">Japan-style measures</a> to boost corporate governance may not work to lift its undervalued stock markets and tackle the so-called “Korea discount.” In its latest attempt, the Financial Services Commission revealed a “<a href=\"https://www.cnbc.com/2024/02/26/south-korea-unveils-measures-to-boost-stock-markets-tackle-korea-discount.html\">Corporate Value-up Program</a>,” aimed at supporting shareholder returns through incentives including tax benefits.</p><p><strong>Honor’s foray into flip phones</strong><br>Chinese technology firm Honor&nbsp;<a href=\"https://www.cnbc.com/2024/02/28/honor-to-launch-its-first-foldable-flip-phone-to-challenge-samsung-.html\">will launch a foldable flip phone</a>&nbsp;this year, the company’s CEO George Zhao told CNBC. It will be the firm’s first entry into the vertical-folding style of smartphone as the company looks to push into the premium end of the market in a challenge to tech giants like Samsung and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-13\"><a href=\"/quotes/AAPL/\">Apple</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>.</p><p><strong>[Pro] Alibaba’s compelling appeal</strong><br>Despite the recent slump in Alibaba’s shares, <a href=\"https://www.cnbc.com/2024/02/28/one-big-tech-stock-to-buy-according-to-ranmore-fund-managements-sean-peche.htmlhttps:/www.cnbc.com/2024/02/28/one-big-tech-stock-to-buy-according-to-ranmore-fund-managements-sean-peche.html\">the Chinese e-commerce giant</a> remains on the radar of fund managers. “Alibaba is our third biggest stock [position] now. Why? The valuation is absolutely compelling,” said Andrew Lapping, Ranmore’s chief investment officer.</p><br /><p>Americans’ attitudes about the economy have soured.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Consumer confidence fell to 106.7 in February, <a href=\"https://www.conference-board.org/topics/consumer-confidence\" target=\"_blank\">said the Conference Board</a>, down from a revised 110.9 in January. This comes after a three-month streak of improving mood.</p><p>The index measuring short-term expectations for income, business and the job market fell to 79.8 from 81.5 in January. A reading under 80 often signals an upcoming recession.</p><p>While Americans were less worried about food and gas prices, there were rising concerns over jobs and the upcoming presidential elections.</p><p>“The decline in consumer confidence in February interrupted a three-month rise, reflecting persistent uncertainty about the US economy,” said&nbsp;Dana Peterson, chief economist at The Conference Board.&nbsp;</p><p>“While overall inflation remained the main preoccupation of consumers, they are now a bit less concerned about food and gas prices, which have eased in recent months. But they are more concerned about the labor market situation and the US political environment.”</p><p>The drop in consumer confidence was broad based, affecting most income groups, as well as among people under 35 years old and those aged 55 and over, according to Peterson.</p><p>The survey findings reveal that despite data showing a strong labor market and a surprisingly resilient economy, public perception on the economy proves to be a challenge ahead of high-stakes elections this year.</p><p>This signals troubling signs for President Joe Biden, who has been trying to tout his administration’s economic accomplishments ahead of a likely rematch against Republican nominee <a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a> in November.</p>',	'2024-02-28 02:21:43.324',	NULL,	'US',	'CNBC Daily Open: Americans sour on the economy ',	NULL),
(21,	'',	'China’s oil demand growth could halve from pre-Covid levels as property, auto sectors struggle',	'<p>China’s oil demand growth this year could be half of pre-Covid 2019 levels, according to Eurasia Group, as key segments of the world’s second-largest economy struggle from a slowdown.</p><p>The country is unlikely to return to its model of an oil-intensive economic growth this year, with the its construction and auto sectors — key drivers for oil demand — now looking “exhausted,” the risk consultancy said in a note.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The consultancy expects demand growth to be around 250,000 bpd to 350,000 bpd, less than half of what it was in 2019 — demand growth will not return to the million barrels per day seen between 2015 and 2020.</p><br /><p>Even if China’s property sector recovers, future growth on the level seen before the pandemic “is not possible” given the country’s soaring debt levels, declining demographics and reduced GDP growth expectations, according to the consultancy.</p><p>“The incremental fuel demand growth in China that the oil industry has come to literally bank on over the past two decades is no more,” Eurasia Group said.</p><p><a href=\"https://www.cnbc.com/2023/09/20/oil-markets-decades-long-dependence-on-china-could-be-coming-to-an-end.html\">China</a> will lose its spot to India a<a href=\"https://www.iea.org/reports/indian-oil-market\" target=\"_blank\">s the primary driver for global oil demand through</a> 2030, the International Energy Agency said in a report.</p><p>Chinese oil consumption hit an all-time high of 16.03 million barrels per day last year — a 1.2 million barrels per day growth — as the country took advantage of plunging oil prices to import large volumes of cheap crude, analysts from JPMorgan wrote in a recent note.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The record figure was also boosted by <a href=\"https://www.reuters.com/business/energy/chinas-2023-crude-oil-imports-hit-record-fuel-demand-recovers-2024-01-12/\" target=\"_blank\">increased domestic passenger travel levels</a> after <a href=\"https://www.sohu.com/a/751726445_121175516\" target=\"_blank\">Covid restrictions were lifted</a>.</p><p>However, the supporting factors that led to record demand growth last year are fading in 2024, said JPMorgan, which expects an increase of 530,000 barrels per day this year as China continues on the trajectory of a “low-quality growth.”</p><p>“The country’s economic slowdown is weighing on growth in gasoline and especially diesel demand,” Rapidan Energy’s Director of Refined Products Linda Giesecke told CNBC, adding that an electrification of China’s auto fleet was also restricting growth in gasoline demand.</p>',	'2024-02-28 02:21:43.328',	NULL,	'US',	'China’s oil demand growth could halve from pre-Covid levels as property, auto sectors struggle',	NULL),
(22,	'',	'U.S. cautions Pacific Island nations about China security ties after Hawaii neighbor Kiribati gets Chinese police',	'<p>The United States on Monday cautioned Pacific Islands nations against assistance from Chinese security forces after <a href=\"https://www.reuters.com/world/china/chinese-police-work-kiribati-hawaiis-pacific-neighbour-2024-02-23/\" target=\"_blank\">Reuters reported</a> that Chinese police are working in the remote atoll nation of Kiribati, a neighbor of <a href=\"https://www.cnbc.com/id/10000563\">Hawaii</a>.</p><p>Kiribati’s acting police commissioner Eeri Aritiera told Reuters last week uniformed Chinese officers were working with police in community policing and a crime database program.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Kiribati is a nation of 115,000 people whose closest island is 2,160 km (1,340 miles) south of Honolulu, and the news comes as Beijing renews a push to expand security ties in the Pacific Islands in an intensifying rivalry with the United States.</p><p>Asked to comment on the Reuters report, a spokesperson for the U.S. State Department responded using the abbreviation of the People’s Republic of China: “We do not believe importing security forces from the PRC will help any Pacific Island country.  Instead, doing so risks fueling regional and international tensions.”</p><p>The official added that Washington did not tolerate China’s “transnational repression efforts,” including its attempts to establish police stations around the world.</p><p>“We are concerned about the potential implications security agreements and security-related cyber cooperation with the PRC may have for any Pacific Island nation’s autonomy,” the spokesperson said.</p><p>Kiribati is considered strategic not only given its relative proximity to Hawaii, but because it has one of world’s biggest exclusive economic zones, covering more than 3.5 million square km (1.35 million square miles) of the Pacific.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>It hosts a Japanese satellite tracking station and China has announced plans to rebuild a World War Two U.S. military airstrip on Kiribati’s Kanton Island, prompting U.S. concern.</p><p>The United States countered with a pledge in October to upgrade the wharf on Kanton island, a former U.S. military base, and said it wants to open an embassy in Kiribati.</p><br /><p>Hawaii Senator Brian Schatz issued a statement on Tuesday referring to last week’s Reuters article, saying reporting of China’s growing influence across Pacific Island nations, including Kiribati, underscored the need for the United States to continue strengthening its partnerships in the region.</p><p>He said it showed the need to “urgently” pass new economic assistance funding for three other strategic Pacific Island states, the Marshall Islands. Micronesia and Palau, which has been held up by budget battles in the U.S. Congress.</p><p>“To build enduring trust with the people of the Pacific Islands, we need to redouble our efforts to support economic development, help meet infrastructure needs, bolster public health capacity, and more,” Schatz said.</p><p>China has not responded to a Reuters request for comment on the role of its police in Kiribati, but in a January social media post its embassy named the head of the “Chinese police station” there.</p><p>Kiribati’s acting police commissioner, Aritiera, said Kiribati had requested China’s policing assistance in 2022 but there was no Chinese police station. Up to a dozen uniformed Chinese police arrived last year on a six-month rotation.</p><p>A Chinese embassy source confirmed the uniformed officers were working in Kiribati but also said China had not established a police station.</p><p>China’s efforts to strike a region-wide security and trade deal in the region, where it is a major infrastructure lender, were rejected by the Pacific Islands Forum in 2022.</p><p>However, Chinese police have deployed in the Solomon Islands since 2022 after a secret security pact criticized by Washington and Canberra as undermining regional stability.</p><p>Papua New Guinea, the biggest Pacific Island nation, said this month it would not accept a Chinese offer of police assistance and surveillance technology, after news it was negotiating a policing deal with China prompted criticism from the United States and Australia.</p>',	'2024-02-28 02:21:43.331',	NULL,	'US',	'U.S. cautions Pacific Island nations about China security ties after Hawaii neighbor Kiribati gets Chinese police',	NULL),
(23,	'',	'Huawei spinoff Honor developing a smart ring after Samsung debuts its own wearable',	'<p>BARCELONA — Chinese electronics maker Honor is working on a smart ring, its CEO told CNBC on Tuesday, just a day after Samsung took the wraps off of its own offering in the product category.</p><p><a href=\"https://www.cnbc.com/2024/02/26/samsung-galaxy-ring-specs-features-release-date.html\">Samsung debuted the Galaxy Ring on Monday</a> after teasing it earlier this year. The device, which is the company’s first foray into the product category, has multiple sensors that can track health markers, such as the wearer’s heart rate. It is part of a broader health push by Samsung.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Honor is developing its own smart ring, company CEO George Zhao told CNBC at the Mobile World Congress in Barcelona.</p><p>“Internally<strong>,</strong> we have this kind of solution, now we are working on that part, so in the future you can have the Honor ring,” he said.</p><br /><p>Zhao disclosed very few details about the product, but said that it is part of the firm’s broader focus on health.</p><p><a href=\"https://www.cnbc.com/2020/11/10/huawei-to-sell-smartphone-unit-to-shenzhen-government-others-sources-tell-reuters.html\">Spun off from Huawei in 2020</a> as a result of U.S. sanctions, Honor has <a href=\"https://www.cnbc.com/2021/01/22/honor-v40-launch-former-huawei-units-first-smartphone-since-being-sold.html\">pushed aggressively to launch its own smartphones</a> and expand its presence outside of China, <a href=\"https://www.cnbc.com/2023/03/03/honor-hints-at-new-flip-foldable-smartphone-after-magic-vs-launch.html\">particularly in the premium market</a>, where it seeks to rival <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-5\"><a href=\"/quotes/AAPL/\">Apple</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and Samsung.</p><p>The company has also expanded into other devices, including wearables such as smartwatches, which can also measure some health indicators.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>With a ring, Honor could add another product to its portfolio and link them together with its health app, much like Samsung is looking to do.</p><p>Zhao said he sees artificial intelligence as a key way to help provide more health insights to users.</p><p>“This hardware capability will work together with AI-enabled apps (and) can help you make the professional training course tailored for you because they studied your habits and health data to give you professional suggestions,” Zhao said. “I think AI will transform this kind of applications.”</p><p>Honor has been talking up its AI capabilities at MWC this week and showed off <a href=\"https://www.cnbc.com/2024/02/25/honor-shows-off-tech-in-magic-6-pro-to-control-a-car-with-your-eyes.html\">technology on its smartphone that can track your eyes to carry out functions</a>.</p>',	'2024-02-28 02:21:43.336',	NULL,	'US',	'Huawei spinoff Honor developing a smart ring after Samsung debuts its own wearable',	NULL),
(24,	'',	'Biden faces anger from key Arab American voters in Michigan primary over Israel support in Gaza war',	'<p>Palestinian keffiyehs and signs that read “Abandon Biden”: Arab American demonstrators in Warren, Michigan, made no secret of their anger at the president in early February as he visited the key swing state that helped carry him to victory in 2020.</p><p>As voters head to the polls in Michigan’s Democratic primary on Tuesday, there is a local campaign urging Democrats to choose “uncommitted” on the ballot as a form of protest vote again the administration’s support for Israel in its war in Gaza.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>In January, Biden’s reelection campaign manager, Julie Chavez Rodriguez, <a href=\"https://apnews.com/article/biden-campaign-arab-american-support-israel-michigan-cf331a82f907fe70e22d5f0aa6d7346e\" target=\"_blank\">canceled a meeting with Arab American activists in Dearborn because of backlash over the administration’s policies</a>. The U.S. has sent billions of dollars in advanced weapons to supply Israel before and since the terror attack led by Palestinian militant group Hamas on Oct. 7. The assault killed some 1,200 people there and took a further 240 hostage, according to Israeli authorities.</p><p>The Israeli military’s response, which has been sharply criticized by numerous world leaders and aid organizations, has displaced some 1.9 million people in Gaza, according to the United Nations, and killed nearly 30,000, according to Gaza’s Health Ministry, which is run by Hamas. The U.N. says that half a million people in the besieged enclave face starvation.</p><br /><p>Dearborn, Michigan, is home to the <a href=\"https://eu.freep.com/story/news/local/michigan/wayne/2023/09/26/arab-americans-now-a-majority-in-dearborn-new-census-data-shows/70929525007/\" target=\"_blank\">largest Arab American population</a> in the U.S. At the time Rodriguez’s Dearborn meeting was canceled, the city’s mayor, Abdullah H. <a href=\"https://twitter.com/AHammoudMI/status/1750742046216724855\" target=\"_blank\">Hammoud, tweeted</a>: “Little bit of advice – if you’re planning on sending campaign officials to convince the Arab American community on why they should vote for your candidate, don’t do it on the same day you announce selling fighter jets to the tyrants murdering our family members.”</p><span></span><p>A spokesperson for the White House wasn’t immediately available when contacted by CNBC.</p><p>The primary vote on Tuesday will essentially be a referendum on what many of the state’s Democratic voters feel about Biden, and will be a harbinger of just how worried the Biden campaign should be about its level of support in Michigan when it comes time for the general election.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Michigan’s Arab American community voted overwhelmingly for Biden in 2020, helping him carry the state and defeat then-incumbent President <a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a>. But its population could be the determining factor in whether Biden takes the state this year, and its crucial 15 Electoral College votes with it.</p><br /><p>“The U.S. election for President Biden could swing on two or three states,” Fred Kempe, CEO of the Atlantic Council, told CNBC. “Take one of those states, Michigan, [which] Biden won by fewer votes in the last election than there are Arab American votes that could go against him, because of what’s going on in the Middle East. So it’s an international situation for Biden, it’s also a deeply domestic political situation.”</p><p>Biden has voiced support for the creation of an independent Palestinian state, and has asked Israel to do more to protect civilian life in Gaza — but critics say the words are meaningless if the administration refuses to use its leverage to force the government of Israeli Prime Minister Benjamin Netanyahu to change course. <a href=\"https://www.theguardian.com/world/2024/feb/20/us-vetoes-un-resolution-ceasefire-israel-gaza\" target=\"_blank\">The U.S. has consistently voted against every</a> cease-fire measure put forward at the U.N. since the war began.</p><p><a href=\"https://www.cbsnews.com/detroit/news/biden-aides-meet-in-michigan-with-arab-american-and-muslim-leaders-aiming-to-mend-political-ties/\" target=\"_blank\">Senior White House officials met with community leaders in Michigan</a> on Feb. 8, during which U.S. deputy national security advisor Jon Finer vocally acknowledged the administration’s actions and “missteps” with regard to the Israeli-Palestinian conflict and the war in Gaza.</p><br /><p>“We are very well aware that we have missteps in the course of responding to this crisis since October 7,” Finer said in recordings of the closed-door meeting&nbsp;<a href=\"https://www.nytimes.com/2024/02/09/us/politics/biden-aide-israel-regret.html\" target=\"_blank\">published by The New York Times.</a> “We have left a very damaging impression based on what has been a wholly inadequate public accounting for how much the president, the administration and the country values the lives of Palestinians,” he continued.</p><p>“And that began, frankly, pretty early in the conflict.”</p><p>Finer added that he did not “have any confidence in this current government of Israel.”</p><p>Michigan Gov. Gretchen Whitmer has warned voters against the “uncommitted” campaign, stressing that “any vote that’s not cast for Joe Biden supports a second Trump term,” which she said would be “devastating” for the Muslim community.</p><br /><p>Within the primary election, Biden doesn’t have any realistic Democratic competitors. But for Arab Americans organizing across the country, the message is clear: No cease-fire, no vote.</p><p>Khalid Turaani, co-organizer of the Abandon Biden campaign, handed out pamphlets outside the Islamic Center of Detroit telling people to vote “uncommitted” on their ballots, and <a href=\"https://www.bbc.co.uk/news/world-us-canada-68409546\" target=\"_blank\">told the BBC</a> in an interview published Tuesday that his group had made more than 30,000 calls with the same message.</p><p>“We’re doing all that we can to ensure that Biden is a one-term president,” Turaani said, according to the U.K. broadcaster. “In November, we will remember. When you stand against the will of the people, you’re going to lose.”</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div>',	'2024-02-28 02:21:43.339',	NULL,	'US',	'Biden faces anger from key Arab American voters in Michigan primary over Israel support in Gaza war',	NULL),
(25,	'',	'NATO countries scramble to deny ground troops will go into Ukraine after Moscow warns of ‘inevitable’ conflict',	'<p>France’s suggestion that Ukraine’s allies could potentially send ground troops into Ukraine has caused indignation and outrage in Russia, with officials warning it could provoke a direct conflict between Russia and NATO member states.</p><p>Eyebrows were raised Monday when French President Emmanuel Macron suggested that European heads of state and Western officials, who met in Paris on Monday, had talked about the possibility of sending ground troops into Ukraine.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“There is no consensus today to officially, openly, and with endorsement, send troops on the ground. But in terms of dynamics, nothing should be ruled out. We will do everything necessary to ensure that Russia cannot win this war,” Macron said at a news conference Monday evening.</p><p>Moscow was quick to seize on the comments, with the Kremlin’s press secretary, Dmitry Peskov, telling reporters Tuesday that if European NATO members sent troops to fight in Ukraine it would make a conflict between Russia and NATO inevitable.</p><p>“In this case, we need to talk not about probability, but about inevitability, and that’s how we evaluate it,” he said, <a href=\"https://tass.ru/politika/20093637\" target=\"_blank\">news agency Tass reported</a>, when asked about the likelihood of a direct conflict between Russia and the Western military alliance if its troops crossed the border.</p><p>Peskov added that NATO countries “must also evaluate” the consequences of such actions and “ask the question whether this corresponds to their interests, and most importantly, to the interests of the citizens of their countries.”</p><p>Russian Foreign Minister Sergey Lavrov also weighed in, advising any countries considering sending troops to Ukraine to “use their heads,” news agency Tass added.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“It seems to me that those who not only express such thoughts, but even admit them in their heads, should still use that head for more rational thoughts, [as it’s] safer for Europe,” Lavrov said at a news conference Tuesday.</p><br /><p>European allies have been quick to play down the comments, with Germany issuing a hasty denial Tuesday that it had any plans to put “German troops on Ukrainian soil.” The U.K. and Spain also publicly rejected the idea, which would see troops from NATO member states in direct conflict with longtime nemesis and nuclear power Russia.</p><p>German Chancellor Olaf Scholz insisted there was no consensus on deploying ground troops among European leaders and officials from the U.K., Canada and U.S. who met in Paris on Monday.</p><p>“Once again, in a very good debate, it was discussed that what was agreed from the outset among ourselves and with each other also applies to the future, namely that there will be no ground troops, no soldiers on Ukrainian soil sent there by European countries or NATO states,” Scholz said on the sidelines of an event.</p><p>Germany’s vice chancellor, Robert Habeck, also commented with “advice” for France, saying it would be more helpful for the country to send weaponry and tanks to Ukraine, Reuters reported. He likewise said that there would be “no German soldiers on Ukrainian soil.”</p><br /><p>A spokesman for the U.K. Prime Minister Rishi Sunak said the country had no plans for a “large-scale” deployment of troops to Ukraine, separate from the small number of personnel that were already in the country to support Ukraine’s armed forces.</p><p>Madrid has also publicly refuted the notion, with government spokesperson Pilar Alegria saying Spain does not agree with a French proposal to send European ground troops to Ukraine. She added that Spain wanted to limit aid to sending more weapons and other materials to Kyiv.</p><p>“Unity has been and is the most effective weapon Europe has to face up against [Russian President Vladimir] <a href=\"https://www.cnbc.com/vladimir-putin/\">Putin</a>’s attack,” Alegria said, according to comments translated by Reuters.</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div><br /><p>Later Tuesday, NATO Secretary-General Jens Stoltenberg told The Associated Press news agency that NATO has no plans to send combat troops into Ukraine.</p><p>Stoltenberg said that “NATO allies are providing unprecedented support to Ukraine. We have done that since 2014 and stepped up after the full-scale invasion. But there are no plans for NATO combat troops on the ground in Ukraine.”</p><p>NATO membership obliges member states to commit to protect each other if any one of them is attacked. “Article 5 provides that if a NATO Ally is the victim of an armed attack, each and every other member of the Alliance will consider this act of violence as an armed attack against all members and will take the actions it deems necessary to assist the Ally attacked,” the group states.</p><p><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 02:21:43.343',	NULL,	'US',	'NATO countries scramble to deny ground troops will go into Ukraine after Moscow warns of ‘inevitable’ conflict',	NULL),
(26,	'',	'Sony to lay off 900 workers from PlayStation division, or 8% of unit’s global workforce',	'<p><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/SONY/\">Sony</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> Interactive Entertainment on Tuesday said it will lay off about 900 employees in its PlayStation unit, or 8% of its global workforce, becoming the latest technology company to announce headcount trims.</p><p>“After careful consideration and many leadership discussions over several months, it has become clear changes need to be made to continue to grow the business and develop the company,” the unit’s President and CEO Jim Ryan said in an email to employees, released publicly by the company.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>He added that employees across all of the company’s regions will be affected by the layoffs. PlayStation’s London studio will close in its entirety, with several other studios due to be affected.</p><p>The Japanese gaming giant <a href=\"https://www.cnbc.com/2024/02/14/sony-posts-record-quarterly-revenue-on-playstation-sales-boost.html\">cut its sales forecast</a> for its flagship PlayStation 5 console on Feb. 14 after it warned of lower demand. Sony at the time said it expects to sell 21 million units of the PlayStation 5 in the fiscal year ending in March, trimmed from a previous forecast of near 25 million consoles.</p><p>The company’s shares <a href=\"https://www.cnbc.com/2024/02/19/sony-gaming-margin-questioned-after-ps5-sales-cut-sparks-stock-plunge.html\">plunged sharply</a> after the forecast cut announcement.</p><p>Analysts <a href=\"https://www.cnbc.com/2024/02/20/ps5-pro-sony-to-release-refreshed-playstation-5-in-2024-analysts-say.html\">had anticipated</a> that Sony could move to release a refreshed version of the PlayStation 5 this year, seeking to boost interest in the console.</p><p>Tuesday’s announcement from Sony is the latest in a string of layoffs affecting the tech industry. In January, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-5\"><a href=\"/quotes/MSFT/\">Microsoft</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> laid off about 9% of its gaming unit after its acquisition of Activision Blizzard. Earlier this month, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-6\"><a href=\"/quotes/CSCO/\">Cisco</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-7\"><a href=\"/quotes/DOCU/\">DocuSign</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> both <a href=\"https://www.cnbc.com/2024/02/14/cisco-cutting-5percent-of-global-workforce-in-restructuring-move.html\">announced plans</a> to <a href=\"https://www.cnbc.com/2024/02/06/docusign-to-lay-off-6percent-of-workforce-or-about-440-jobs.html\">cut their workforces</a> as part of restructuring plans.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Shares of Sony were down about 0.3% Tuesday.</p><p><em>— CNBC’s</em> <em>Arjun Kharpal contributed to this report.</em><br><br><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 02:21:43.346',	NULL,	'US',	'Sony to lay off 900 workers from PlayStation division, or 8% of unit’s global workforce',	NULL),
(27,	'',	'Motorola shows off a concept smartphone that can wrap around your wrist',	'<p>BARCELONA, Spain — Motorola thinks we may be wearing our phones on our wrist in future.</p><p>The company, which is owned by Chinese tech giant <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/992-HK/\">Lenovo</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, showed off a bendable smartphone during the Mobile World Congress in Barcelona, Spain, after teasing it in a video last year.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>It is just a concept product so it may never be released. But Motorola is keen to show the progress of display technology to stand out in the crowded smartphone market.</p><br /><p>During a demonstration, a Motorola representative showed how the phone could bend in various ways to wrap around a wrist or stand up on a table.</p><p>When the phone is wrapped around the wrist, the way information is displayed changes. For example, the apps appear at the top of the screen.</p><p>The representative said the phone is “contextually aware” so adapts depending on how it has been bent.</p><p>The mechanism that allows the phone to bend was desecribed by the Motorola representative as similar to the way the human spine works.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>In one demonstration, the representative used the phone to take a picture of a dress. The phone then generated a background that complemented the outfit. That background could be applied to the device so that when a user wears it, the phone is a fashion accessory.</p><p>Lenovo and Motorola often show off protoypes of devices. During MWC, <a href=\"https://www.cnbc.com/2024/02/25/chinas-lenovo-shows-off-a-laptop-with-a-see-through-screen.html\">Lenovo revealed a laptop with a see-through screen</a>. Last year, <a href=\"https://www.cnbc.com/2023/02/28/motorola-shows-off-a-rollable-smartphone-with-a-screen-that-extends.html\">Motorola touted a smartphone with a screen that rolled up</a>.</p><p>The bendable display from Motorola appears to <a href=\"https://www.cnbc.com/2023/03/01/motorola-razr-foldable-lenovo-confirms-new-model-for-2023.html\">build on some of the advances</a> made with foldable screens in recent years. Motorla <a href=\"https://www.cnbc.com/2020/02/06/verizon-motorola-razr-returns-with-a-folding-display.html\">revived its iconic Razr brand in 2020 as a foldable smartphone</a>.</p>',	'2024-02-28 02:21:43.349',	NULL,	'US',	'Motorola shows off a concept smartphone that can wrap around your wrist',	NULL),
(28,	'',	'FTC Chair Lina Khan takes victory lap on blocking Nvidia-Arm merger',	'<p>Federal Trade Commission Chair Lina Khan cited the surging stock prices of <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/NVDA/\">Nvidia</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-2\"><a href=\"/quotes/ARM/\">Arm</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> as an example of how blocking mergers can lead to increased innovation.</p><p>Speaking at <a href=\"https://www.youtube.com/watch?v=DuykIQ15Lag\" target=\"_blank\">a Bloomberg and Y Combinator conference</a> on Tuesday, Khan said that when the $40 billion merger was called off due to “<a href=\"https://www.cnbc.com/2022/02/08/softbank-plans-to-take-arm-public-after-nvidia-takeover-deal-collapses.html\">significant regulatory challenges</a>” in 2022, it forced both companies to innovate and create new products.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The remarks suggest Khan and the FTC see the blocked Nvidia deal, which Khan said would have been “the largest semiconductor chip merger in history,” as an example of a successful antitrust action that doesn’t hamper companies from pursuing financial success or embracing new technologies such as artificial intelligence.</p><p>“The trajectories of both companies in the wake of this action has illustrated how organic growth and competition can spur firms to further innovate in ways that benefit the business and public alike,” Khan said at the conference.</p><p>The evidence, Khan said, is in the company stock prices.</p><p>“Not only has Nvidia remained the leading AI chipmaker in the AI chip arms race, with a surging stock valuation, but Arm ended up going public and has a forward earnings multiple that is more than double Nvidia’s,” Khan said.</p><p>In September 2020, Nvidia announced plans to acquire Arm for $40 billion in cash and stock. Both firms hailed the deal as a way to create the premier computing company for the “<a href=\"https://nvidianews.nvidia.com/news/nvidia-to-acquire-arm-for-40-billion-creating-worlds-premier-computing-company-for-the-age-of-ai\" target=\"_blank\">age of AI.</a>”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>But the acquisition quickly met resistance from regulators in the U.S., Europe and Asia. Arm’s core technology, its instruction set architecture, is used by companies such as Apple, Google and Qualcomm to build processors. Arm is often described as a “neutral supplier” that doesn’t compete with its customers.</p><p>Those companies and regulators worried that Nvidia could control access to Arm’s architecture, giving it the power to foreclose access to a key input needed to make their chips. Nvidia said it would invest in Arm and allow other companies continued use of Arm’s chip designs, preserving the company’s licensing model.</p><p>The <a href=\"https://www.cnbc.com/2021/12/02/ftc-sues-to-block-nvidias-40-billion-acquisition-of-arm.html\">FTC sued in late 2021</a> to block the merger, and in combination with pressure with other regulatory challenges, the deal collapsed less than three months later.</p><p>“Our team determined that giving one of the largest chip companies control over the computing technology and designs that rival firms rely on to develop their own competing chips would be bad for competition and hamstring innovation of next-generation technology,” Khan said Tuesday.</p><p>Nvidia shares have rocketed since the deal was called off as the company has established a leading position in AI chips. Nvidia’s value has nearly tripled mostly on the strength of sales of <a href=\"https://www.cnbc.com/2023/02/23/nvidias-a100-is-the-10000-chip-powering-the-race-for-ai-.html\">its AI chips for servers</a> such as the A100 and H100. It’s now worth just under $2 trillion, the third-most valuable U.S. company.</p><p>Arm stock has more than doubled since the company went public in August 2023, although SoftBank still owns 90% of the company’s shares. Investors have bid up its share price in the hope that its technology will be essential for developing and deploying AI software.</p><p>Arm is now worth more than $143 billion, and, as Khan noted, investors have given the company <a href=\"https://www.cnbc.com/2024/02/08/arms-post-earnings-pop-leaves-stock-trading-at-premium-to-nvidia-amd.html\">a high earnings multiple</a>, suggesting that they see strong growth in the company’s future.</p><p>Representatives for Nvidia and Arm declined to comment. <br><br><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 02:21:43.351',	NULL,	'US',	'FTC Chair Lina Khan takes victory lap on blocking Nvidia-Arm merger',	NULL),
(29,	'',	'The 11 GRANOLAS stocks power Europe to record highs, drawing Magnificent Seven comparisons',	'<p>Over the last 12 months, just 11 stocks made up half of the gains that powered the pan-European <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/.STOXX/\">Stoxx 600</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> stock index to a record-high close on Friday.</p><p>Earlier this month, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-2\"><a href=\"/quotes/GS/\">Goldman Sachs</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> highlighted that Europe’s stock markets were dominated by this group of “internationally exposed quality growth compounders” with the continent’s largest market caps, which the bank termed the GRANOLAS back in 2020.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The momentum of this group — which comprises <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/GSK-GB/\">GSK</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-4\"><a href=\"/quotes/ROG-CH/\">Roche</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-5\"><a href=\"/quotes/ASML-NL/\">ASML</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, <a id=\"107162386\" href=\"https://www.cnbc.com/quotes/\" type=\"security\" brand=\"cnbc\" section=\"[object Object]\" contentclassification=\"\">Nestle</a>, <a id=\"107272746\" href=\"https://www.cnbc.com/quotes/\" type=\"security\" brand=\"cnbc\" section=\"[object Object]\" contentclassification=\"\">Novartis</a>, <a id=\"107292037\" href=\"https://www.cnbc.com/quotes/\" type=\"security\" brand=\"cnbc\" section=\"[object Object]\" contentclassification=\"\">Novo Nordisk</a>, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-9\"><a href=\"/quotes/OR-FR/\">L’Oreal</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-10\"><a href=\"/quotes/MC-FR/\">LVMH</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, <a id=\"107191688\" href=\"https://www.cnbc.com/quotes/\" type=\"security\" brand=\"cnbc\" section=\"[object Object]\" contentclassification=\"\">AstraZeneca</a>, SAP and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-12\"><a href=\"/quotes/SAN-FR/\">Sanofi</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> — has drawn <a href=\"https://www.cnbc.com/2024/02/19/magnificent-7-profits-now-exceed-almost-every-country-in-the-world-should-we-be-worried.html\">comparisons to the “Magnificent Seven” U.S. tech giants</a> and evoked similar concerns about concentration risks in European equity markets.</p><p>Together, the GRANOLAS account for around a quarter of the total Stoxx 600 market cap, and Goldman analysts in a note last week highlighted that they exhibit qualities that are expected to thrive in the current cycle, such as solid earnings growth, high and stable margins and strong balance sheets.</p><p>“We think they also stand to benefit from the structural shift towards passive investment and the lack of liquidity in the European equity market,” the Wall Street bank’s analysts suggested.</p><p>“From a Global point of view, the GRANOLAS have even outperformed the so-called Magnificent 7 over the past two years. Their (out)performance is even more impressive on a risk-adjusted basis: with a volatility 2x lower than for the Magnificent 7, the GRANOLAS help to boost the Sharpe ratio.”</p><br /><p>They noted that, while the group trades with a high price-to-earnings ratio, a measure that gauges whether a stock is overvalued, this is “not unusual for growth companies” and the GRANOLAS actually trade at a significant discount compared to the Magnificent Seven.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>What’s more, Goldman Sachs expects the strong growth momentum to continue, with a 7% revenue compound annual growth rate expected for the GRANOLAS through 2025, compared to 2% for the wider market excluding the group. The 11 stocks also provide dividend yields for shareholders in the 2-2.5% range.</p><p>“This suggests that, in Europe, nearly all revenue growth of the STOXX 600 will come from the GRANOLAS. We think this will be sustained by high barriers to entry businesses, solid balance sheets and high investment — they reinvest the same share of cash flows in R&amp;D and growth CAPEX as the Magnificent 7,” Goldman Sachs added.</p><p>Such a high and potentially deepening concentration of stock market gains gives rise to concerns about concentration risk, but some analysts believe that the diverse sectors represented in the group may insulate the GRANOLAS to some extent.</p><p>Tim Hayes, chief investment strategist at Ned Davis Research, told CNBC on Monday that, for recent comparisons to the current state of play, market participants should look to the end of 2020, when the market was highly concentrated around a small number of large-cap stocks.</p><br /><p>“What happened then was the market broadened out and this brought us into 2021 which turned out to be a very good year, very low volatility — we also had the market broaden out in anticipation of what turned out to be a globally synchronized economic expansion, earnings growth was coming through globally across sectors,” Hayes said.</p><p>He suggested this created “a lot of complacency” in the market, which prompted investor confidence to linger despite emerging “divergences” beneath the surface.</p><p>“This is what created that very narrow market at the end of 2021, because more and more sectors started to diverge as we started to see signs of these supply chain pressures and the inflationary pressures, commodity prices moving higher, all the things that got us into the 2022 bear market,” Hayes added.</p><p>While this does not necessarily have to be a negative indicator right now, he suggested that the longer the current complacency lingers, the more vulnerable the market is to bad news, or the good news that had been priced in failing to come through.</p><br /><p>“We’ve seen this recently with the expectation that we’re going to have all these rate cuts, when it turned out, well, maybe we’re not going to have as many rate cuts as the market thought, that set up a little bit of a pullback,” Hayes said.</p><p>“That can happen on a bigger scale if the market gets too complacent, and then you’re more vulnerable to some kind of negative surprise entering the picture.”</p>',	'2024-02-28 02:21:43.355',	NULL,	'US',	'The 11 GRANOLAS stocks power Europe to record highs, drawing Magnificent Seven comparisons',	NULL),
(30,	'',	'Four reasons Walmart wants to buy smart TV maker Vizio',	'<p><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/WMT/\">Walmart</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> is doing some shopping of its own.</p><p>The retail giant announced last week that it plans <a href=\"https://www.cnbc.com/2024/02/20/walmart-agrees-to-buy-vizio-to-grow-ad-business.html\">to buy smart TV maker Vizio</a> in a $2.3 billion deal. If the acquisition goes through, the discounter will own a consumer electronics company that already sells many flat-screen TVs and soundbars through Walmart’s website and stores.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Yet the heart of the acquisition is the value of getting in front of millions of people while they stream their favorite TV shows and movies, and being able to link that leisure time to the Walmart purchases they make later.</p><p>“It’s not really about the televisions,” Jefferies retail analyst Corey Tarlowe said. “It’s about advertising.”</p><p>Here’s a closer look at the major reasons Walmart wants to buy <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/undefined/\">Vizio</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>.</p><br /><p>When shoppers think of Vizio, they likely envision store aisles filled with giant TVs. But the growing, and increasingly lucrative, part of the company’s business is a little harder to see.</p><p>In the past few years, the company, based in Irvine, California, has reinvented itself to become more of a software company. Its TVs come with the SmartCast operating system, which allows viewers to pull up and watch streaming apps, such as Netflix and Hulu, without a “plug-in” device such as an Amazon Fire TV stick or Apple TV. It also allows Vizio to sell ads.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Vizio can make money from advertising in three ways using the SmartCast system, said Dan Day, an equity research analyst who covers digital advertising for B. Riley Securities. It can sell ads on SmartCast’s home screen. It can sell them in WatchFree+, Vizio’s own free, ad-supported streaming app. And it gets a small inventory of ads that it can sell as part of agreements with third-party streaming companies.</p><p>Vizio’s SmartCast system has 18 million active accounts, according to Walmart.</p><p>As Vizio’s owner, not only could Walmart set the price of Vizio TVs on its website and in stores, but it could also expand how many people use SmartCast by adding it to the big-box retailer’s own brand of TVs, Jefferies’ Tarlowe said. Some of Walmart’s rivals, such as Amazon, Best Buy and Target, that carry Vizio TVs could continue to sell Vizio products after the deal, but some retail analysts have raised questions about whether they may downplay their competitor’s items.</p><p>Walmart’s in-house TV brand, Onn, currently has a licensing deal with smart TV competitor <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-4\"><a href=\"/quotes/ROKU/\">Roku</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>. The TVs are loaded with Roku’s operating system, which supports the rival company’s advertising revenue.</p><p>Tarlowe and other analysts are betting that once that contract ends, SmartCast will become the operating system on Walmart’s private label TVs — putting ads in front of millions more eyeballs.</p><br /><p>Vizio knows what customers watch. Walmart knows what they buy.</p><p>With the acquisition, the two companies can combine that data to make advertisements more personalized and effective.</p><p>Vizio TVs include automatic content recognition technology, which allows the company to understand a customer’s streaming preferences, said Kirby Grines, founder of 43Twenty, a digital marketing company that works with tech companies in the video space.</p><p>If Vizio knows that a viewer plays Xbox for two hours a day or streams a lot of children’s shows, the company can then<strong> </strong>decide whether to show an ad for a certain snack or a brand of diapers.</p><p>“You’ll know where to insert advertisements for more reach,” Grines said.</p><p>Walmart, on the other hand, knows what its shoppers buy in store and online — and has more granular data about customer preferences as it expands Walmart+, its subscription service and answer to Amazon’s Prime.</p><p>With the Vizio deal, Walmart can use its shopping insights to give customers more relevant ads, and it will know if they lead to a purchase, said Michael Morton, an analyst who covers Amazon and other internet companies at MoffettNathanson.</p><p>He described that as the “holy grail” for brands.</p><p>“I’m sure you’ve heard that joke: ’50% of my advertising spend is wasted. I just don’t know what 50% it is,’” he said. “That’s not the case for these retail media networks. The vendors can measure all of it.”</p><br /><p>When running a store, Walmart has to keep the lights on, pay employee wages and buy items to stock shelves. With its online business, it has to pick, pack and ship orders.</p><p>Advertising, on the other hand, costs a lot less, Morton said.</p><p>“It’s incredibly profitable,” he said, especially when comparing the costs of packing and shipping an online order with the costs of tacking a product placement ad onto a webpage.</p><p>Operating margin, which measures how much a company makes from each dollar of sales after subtracting costs, is 65% or higher for advertising, according to an estimate by Jefferies’ Tarlowe. That compares with the roughly 4% operating margin Walmart reported in the most recent fiscal year.</p><p>Walmart is <a href=\"https://www.cnbc.com/2023/04/11/walmart-warehouse-automation-powers-higher-profits.html\">trying to grow profits faster than sales</a> by using automation and leaning into higher-margin businesses. Tarlowe compared it to building out two separate income statements — one for its legacy retail operations and a second for its newer businesses such as Walmart+, <a href=\"https://www.cnbc.com/2023/08/30/walmart-tries-to-grow-third-party-marketplace-with-las-vegas-event.html\">fulfillment services for its third-party marketplace</a> and more.</p><p>By combining the two, Walmart becomes a higher-margin company overall.</p><p>Plus, Walmart sees how much money its competitor, <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-7\"><a href=\"/quotes/AMZN/\">Amazon</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, makes from advertising — and wants to run the same play.</p><p>Sales in Amazon’s advertising unit <a href=\"https://www.cnbc.com/2024/02/01/amazon-amzn-q4-earnings-report-2023.html\">grew 27% year over year</a> to nearly $15 billion in its most recently reported fiscal quarter. It sells ads for its website, such as by putting sponsored products at the top when a customer searches for items.</p><p>In January, the company began showing ads on Prime Video content, too — an indicator that it sees streaming as a bigger moneymaking opportunity.</p><br /><p>With Vizio, Walmart could fuel an already fast-growing part of its business.</p><p>The retailer has <a href=\"https://www.cnbc.com/2023/08/01/walmart-pushes-into-in-stores-advertising-as-new-revenue-driver.html\">offered more advertising opportunities</a> at its big-box stores. Those include&nbsp;third-party ads on self-checkout lane screens and TVs in store aisles, advertising spots on the store radio and demo stations where brands can pay to have customers sample their products.</p><p>As Walmart expands its third-party marketplace, sellers can buy sponsored ads that put them toward the top of search rankings or promote their product on other parts of Walmart’s homepage.</p><p>In the most recent fiscal year, Walmart’s global advertising business grew about 28% to reach $3.4 billion. In the most recent quarter, Walmart Connect, the company’s U.S. ad segment, grew 22% and its global business grew 33%.</p><p>With ownership of Vizio, Walmart has another type of advertisement that it can sell: TV spots on streaming services, which it can potentially bundle with other types of ads.</p><p>It also will collect a “gatekeeper fee,” since many streaming services share a portion of their advertising revenue with the smart TVs or smart devices that they ride on, 43Twenty’s Grines said.</p><p>Walmart leaders shared few details on the company’s recent earnings call about its plans for Vizio, saying they will wait for the deal to close.</p><p>Yet in a CNBC interview, Walmart CFO John David Rainey described advertising as “a very exciting part of our business” and the acquisition as “a way for us to complement what we’re already doing organically.”</p><p>“We think of this as simply an accelerant to what we’re already doing,” he said.</p><p><em><strong>Don’t miss these stories from CNBC PRO:</strong></em><br></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 02:21:43.358',	NULL,	'US',	'Four reasons Walmart wants to buy smart TV maker Vizio',	NULL),
(31,	'',	'碧桂園反對清盤呈請　稱僅單一債權人激進行動　清盤各方皆輸',	'公司指出，參考業內其他違約上市房企案例，個別債權人向香港法院申請公司清盤的情況較為常見。公司堅決反對呈請書，並將尋求法律意見，採取一切必要行動，與顧問團隊積極妥善抗辯應對。\r\n自公告無法如期償付所有境外債務以來，碧桂園已聘請財務和法律顧問，目前已與境外主要債權人團體代表小組建立了有效溝通機制，境外債整體重組正積極有序推進。各方堅信，公司清盤是各方皆輸的結果。公司將持續與主要境外債權人團隊積極協商溝通協作，以尋求最優解決方案。\r\n碧桂園還表示，目前公司各項經營一切正常，將繼續以保交付、保經營為主要工作目標，最大程度保障購房業主、債權人、投資人和員工在內的所有利益攸關方權益。',	'2024-02-28 02:23:27.892',	NULL,	'HKEX',	'碧桂園反對清盤呈請　稱僅單一債權人激進行動　清盤各方皆輸',	NULL),
(32,	'',	'Joe Biden wins Michigan Democratic primary, NBC projects',	'<p>President <a href=\"https://www.cnbc.com/joe-biden/\">Joe Biden</a> has won the <a href=\"https://www.michigan.gov/sos\" target=\"_blank\">Michigan</a> Democratic presidential primary, NBC News projects.</p><p>The incumbent president’s victory was widely anticipated in the <a href=\"https://www.cnbc.com/2024/02/27/trump-biden-seek-to-dominate-michigan-presidential-primary-what-to-know-.html\">key swing state</a> due to an uncompetitive Democratic field and Biden’s successful Michigan track record.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>In January, Biden landed the endorsement of the Detroit-based <a href=\"https://www.cnbc.com/2024/01/24/uaw-endorses-biden-over-trump-in-2024-election.html\">United Auto Workers</a> union, a crucial win for any candidate vying for the battleground state. The union has 400,000 active members and over 580,000 retired members, many of whom live in Michigan.</p><p>In 2020, Biden also won the primary and general election in Michigan.</p><p>For this year, under Biden’s guidance, the Democratic National Committee rearranged the primary calendar to make Michigan one of the first states to vote, giving it bellwether status for the primary race.</p><p>But the Great Lake State’s primary also acted as a litmus test for Biden’s standing with essential Democratic voter bases, especially amid heightened tensions about his administration’s handling of the war in Gaza.</p><p>Over the past few months, Michigan, which has a significant Arab American voter population, became the breeding ground of several anti-Biden campaigns, urging voters to cast “uncommitted” ballots in protest of the Gaza war.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The “uncommitted” vote turned into Biden’s main Michigan challenger, even with House Rep. Dean Phillips, D-Minn., still on the ballot.</p><p>Phillips’ campaign, which has consistently polled in single digits, was a longshot from the start. Over the past month, he has canceled events and laid off staff as funding has dwindled.</p><p>Despite Biden’s attempted rivals, his win in Michigan solidifies the going message that the Democratic primary is all but over. His campaign has hinted as much, kicking into <a href=\"https://www.nbcnews.com/politics/2024-election/bidens-campaign-says-2024-gop-primary-voters-clear-choice-rcna135451\" target=\"_blank\">general election mode</a> by targeting all political attacks at GOP frontrunner and former President Donald Trump.</p><p>Before Michigan, Biden locked up a landslide victory in South Carolina’s Democratic primary and before that, an unofficial win in New Hampshire via write-in votes.</p><p><em><strong>This is breaking news. Check back for updates.</strong></em></p>',	'2024-02-28 02:23:28.116',	NULL,	'US',	'Joe Biden wins Michigan Democratic primary, NBC projects',	NULL),
(33,	'',	'Trump wins Michigan Republican primary, NBC projects, teeing up Super Tuesday',	'<p><a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a> has won the Michigan Republican presidential <a href=\"https://www.cnbc.com/2024/02/27/trump-biden-seek-to-dominate-michigan-presidential-primary-what-to-know-.html\">primary</a>, NBC News projects.</p><p>Tuesday’s result shows the former president and clear GOP frontrunner once again defeating former United Nations ambassador Nikki Haley, Trump’s last remaining primary rival.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Haley has vowed to keep campaigning at least through Super Tuesday next week, when 15 states and one U.S. territory hold their nominating contests.</p><p>Traditionally the biggest day of the primary cycle, Super Tuesday this year is shaping up to be little more than a stepping stone on Trump’s path to a general-election rematch with President <a href=\"https://www.cnbc.com/joe-biden/\">Joe Biden</a>.</p><p>Haley has not won any Republican primaries or caucuses so far, and there are no upcoming state primaries that she is expected to win. Her campaign has nevertheless organized leadership teams in at least nine Super Tuesday states, the most recent of which was announced earlier Tuesday.</p><p>Trump went into the Michigan primary with momentum, having trounced Haley by double-digit margins in her home state of South Carolina just three days earlier.</p><p>But there were also warning signs for the former president, who claims that the Republican Party is as unified behind him as it has ever been.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>In South Carolina, Haley walked away with nearly 40% of the vote. And while Democrats were allowed to cast ballots in the state’s GOP primary, more than one in five Republican voters there told AP VoteCast that they would not vote for Trump in a general election, Politico <a href=\"https://www.politico.com/news/2024/02/24/south-carolina-takeaways-trump-haley-00143177\" target=\"_blank\">reported</a>.</p><p>Trump’s path to the nomination, and another shot at the White House, also runs through a thicket of legal troubles.</p><p>He is scheduled to stand trial in New York court next month on criminal charges related to alleged hush money payments made to a porn star and others. Another criminal case, based on Trump’s retention of classified documents after leaving the White House in 2020, is set to begin in federal court in Florida in late May.</p><p>Trump is also battling two other criminal cases that center on his efforts to overturn his 2020 election loss to Biden. Trump has pleaded not guilty to all of his criminal charges.</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div><br /><p><strong>This is breaking news. Please check back for updates.</strong></p>',	'2024-02-28 02:23:28.120',	NULL,	'US',	'Trump wins Michigan Republican primary, NBC projects, teeing up Super Tuesday',	NULL),
(34,	'',	'碧桂園遭入稟清盤　股價瀉逾11%　港股再轉跌｜持續更新',	'【10:26】\r\n內房股今早走勢疲弱，碧桂園（2007）遭入稟清盤，股價瀉11.1%，中海外（0688）跌0.5%，潤地（1109）跌1.4%，雅居樂（3383）跌2.5%，富力（2777）跌3.6%。\r\n恒指最新報16751點，跌38點，國指跌27點，報5779點，科指升17點，報3520點。\r\n【09:49】\r\n港股今早走勢反覆，高開後更掉頭向下，並於16800點附近爭持，最新報16826點，升35點。\r\n即將公布業績的網易（9999）揚4.3%，百度（9888）升2.2%。\r\n汽車股續上揚，理想汽車（2015）升3%，吉利（0175）升1.5%。\r\n晶片相關股方面，中芯（0981）升2.6%，ASMPT（0522）宣布派特別息，最新報95.6元，飆6.2%。\r\n【09:25】\r\n恒指最新報16833點，高開42點，國指最新報5824點，高開17點，科指最新報3527點，高開24點。\r\n新創建（0659）昨日（27日）宣布派特別息，今早開14.9%，最新報8.47元，同系的新世界（0017）高開0.4%。\r\n地產股為今日焦點之一，將於今日收市後公布業績的新地（0016）平開，長實（1113）平開，恒地（0012）高開0.9%，美聯（1200）平開。\r\n科技股方面，阿里（9988）高開0.1%，騰訊（0700）高開0.1%，美團（3690）平開。\r\n金融股方面，滙豐（0005）高開0.4%，港交所（0388）平開。\r\n汽車股方面，理想汽車（2015）高開2.6%，蔚來（9866）高開0.1%，小鵬（9868）低開0.3%。\r\n內房股方面，碧桂園（2007）遭入稟清盤，今早低開4.2%，中海外（0688）跌0.7%。',	'2024-02-28 02:31:31.765',	NULL,	'HKEX',	'碧桂園遭入稟清盤　股價瀉逾11%　港股再轉跌｜持續更新',	NULL),
(35,	'',	'盛事經濟新加坡又贏　TaylorSwift帶旺旅遊業　酒店29萬套票售罄',	'法新社報道，超過30萬名來自城邦新加坡和鄰近國家的粉絲，將參加Taylor Swift於3月2日至9日在新加坡國家體育場舉行的「時代巡迴演唱會」（The Eras Tour）演出，6場表演門票皆已售罄。\r\n來自菲律賓首都馬尼拉的應屆畢業生Ingrid Delgado將前往新加坡觀賞3月4日的演出，她表示，很難找到一家經濟實惠的飯店。新加坡富麗敦飯店（The Fullerton Hotel）和惠蒙特飯店（Fairmont Hotel）表示，演唱會期間的住宿需求有所上升。\r\n濱海灣金沙酒店（Marina Bay Sands）以Shake it Off、Stay Stay Stay、Wildest Dreams等Taylor Swift熱門歌曲的曲名，推出奢華組合方案，讓大手筆的消費者趨之若鶩。其中的Wildest Dreams組合要價新加坡幣5萬元(約29.1萬港元)，包含VIP套票、精緻餐飲、飯店套房、豪華轎車接送服務和旅遊景點門票。這家飯店告訴法新社，所有組合都已售罄。\r\n新加坡航空和馬來西亞航空表示，前往新加坡的航班需求有所增加，但無法確定是否完全因為「Taylor Swift效應」。\r\n然而，當Taylor Swift宣布新加坡成為巡演中唯一的東南亞場次時，不是所有人都感到高興，其中包括一些新加坡鄰國的歌迷和政府。對該地區的許多人來說，前往新加坡旅行十分昂貴，更不用提豪華的飯店組合方案。一些人也不滿新加坡提供補助，以確保Taylor Swift在星國舉辦巡演。\r\n新加坡文化部和旅遊局官員上週以保密義務為由，拒絕透露確切的補助金額，或是否簽署獨占合約，使新加坡成為巡演在東南亞的唯一一站。此前有報導稱，泰國總理賽塔（Srettha Thavisin）在曼谷的商業論壇指出，新加坡確實達成這樣的協議。新加坡官員並未直接回應賽塔的言論，但表示泰勒絲的演出「很有可能為新加坡經濟帶來極大效益」。',	'2024-02-28 02:31:31.772',	NULL,	'HKEX',	'盛事經濟新加坡又贏　TaylorSwift帶旺旅遊業　酒店29萬套票售罄',	NULL),
(36,	'',	'財政預算案｜樓市全面撤辣！　消息：即日起無須再繳三大辣稅',	'翻查資料，樓市辣招最早可追溯至2010年11月，當時政府推出額外印花稅（SSD），限制市民在兩年內轉售單位，需要繳付樓高5至15%的SSD，當時本港樓市正處於一個穩步上揚的階段，當時CCL報89.41點。\r\n事隔兩年政府於2012年10月更推出SSD加強版，轉售時間限制調整為三年內，SSD稅款涉及樓價10至20%，當時政府更推出買家印花稅BSD，以限制非本地人士及以公司名義的買家，在港買樓時需繳付樓價15%的稅款。若以當時CCL 116.07點計算，短短兩年間樓價已上升近30%。\r\n政府為進一步壓抑樓價，於2013年2月份為樓市辣招「加辣」，更推出雙倍印花稅（DSD），調整200萬元或以下物業，稅款由100元增至樓價1.5%，其餘物業稅率也加倍，由最高稅率4.25%增至8.5%。\r\n雖然政府在2010年至2013年連環推出樓市辣招，不過及後樓價升勢未止，於2010年至2013年的三年間累升56%，CCL由2010年初報的76.17點，累升42.79點至118.96點。因此政府於2016年11月份及2017年4月再出手「加辣」，分別向買入第二套或以上物業的買家，劃一收稅樓價15%，以及採「一約多伙」15%從價印花稅，即買家以首次置業人士的名義，以一份合約購入多個單位，需繳付樓價15%的從價印花稅。\r\n總結政府推出三大辣招主因都是希望壓抑樓市升溫。不過據CCL顯示辣招首度推出的首11年，由當時最初的89.41點，持續上升至2021年8月份的歷史高位191.34點，即期間升幅高達約2.14倍。反映辣招未能達成壓抑樓市升溫的效果。\r\n於2021年8月份CCL歷史高位191.34點過後，樓市開始呈下行狀態，加上於2022年3月撞正美國加息週期，同時亦為本港樓市帶來壓力。當時有意見認為樓市辣招已經過時，要求政府重新檢視樓市相關政策。\r\n政府亦為招商引才，在2022年10月特首李家超發表首份《施政報告》 當中指出，待合資格外來人才在成為香港永久性居民後，可申請退還在港置業已繳付額外的印花稅，即「先徵後退」。\r\n即如該類人士可於居港七年並成為香港永久性居民後，就其已購入並仍然持有的首個住宅物業申請退還已繳付的買家印花稅及新住宅印花稅，但他們仍須繳交按「第二標準稅率」計算的從價印花稅。不過當時樓市未有因此而反彈，2022年12月底CCL亦已從高位回落近17.8%。',	'2024-02-28 03:03:58.029',	NULL,	'HKEX',	'財政預算案｜樓市全面撤辣！　消息：即日起無須再繳三大辣稅',	'https://cdn.hk01.com/di/media/images/dw/20240228/839463947428958208630597.jpeg/K_Y6E3MgD-6-sZi9oY7RhTJdkmnH7OxnmW4OdpluDnY?v=w1920r16_9'),
(37,	'',	'財政預算案｜消息指樓市全面撤辣　本地地產股下挫　美聯升近一成',	'本港樓市自2021年9月見頂以來，累計跌幅逾 20%。據差估署於周二（27日）公布的1月私人住宅樓價指數為306.4，按月跌1.57%，<strong>連跌9個月，累計跌幅達13.5%</strong>。若與2021年年中高位相比，累計跌幅更達23%。\r\n樓價下跌與外圍地緣政治局勢﹑宏觀經濟前景以及聯儲局在短短1年多時間加息5.25厘有關。受到樓價下挫拖累，市民入市意欲大減，去年本港整體樓宇買賣宗數為5.8萬宗，涉及金額為4,779.03億元，分別按年跌2.7%及13.8%。\r\n樓價下挫導致市民財富蒸發，早前新地（0016）執行董事郭基煇指出，樓價下跌引致本港市民財富縮減2.5萬億元。因此包括郭基煇等地產界及商界人士，紛紛向政府表達撤銷辣招意願。\r\n加息周期，樓市不濟亦反映在地產股股價上，從由年頭至本周二多隻地產股股價向下。其中新世界發展(0017)累跌16.4%；長實（1113）跌4.8%；而新地則跌7.3%。\r\n反觀美聯股價似「偷步」炒撤辣，<strong>美聯於周二收市價為0.66元，</strong>由年初0.495元至今升幅逾3成，跑贏大市。截止今日（28號）中午11時，現價0.71元，升9.2%，創三個月新高。',	'2024-02-28 03:19:39.930',	NULL,	'HKEX',	'財政預算案｜消息指樓市全面撤辣　本地地產股下挫　美聯升近一成',	'https://cdn.hk01.com/di/media/images/dw/20240109/821453169966977024817264.jpeg/ANcmxtuf_ZvmPg37IjdGauVckhI7wRYFbM1JQmzNSUI?v=w1920r16_9'),
(38,	'',	'財政預算案｜陳茂波料今年本港經濟增長2.5%至3.5%｜持續更新',	'陳茂波預料今年內地的出口表現仍會受到外圍環境影響。不過，內地經濟韌性強、基本面堅實，國家的各項提振經濟政策陸續發揮效用，亦有足夠政策空間進一步調控經濟，內部需求料將進一步改善。預料今年內地經濟將會錄得平穩增長。\r\n先進經濟體方面，隨着過去2年息率上升對需求的滯後影響進一步顯現，美國今年的經濟增長預期將較去年低。不過，若聯儲局一如市場預期在年內開始減息，將對經濟有一定支持。過去兩年，美國的消費增長較為集中在服務方面，今年對貨物需求或可錄得較快增長，並為環球貿易提供支持。歐洲方面，地緣政治局勢緊張，加上環球需求仍未顯著改善，今年的經濟增長預期將持續疲弱。\r\n他認為雖然外圍環境會繼續對香港的貨物出口構成壓力，但環球金融狀況有機會在年內逐步放鬆，或會有利出口表現。\r\n另一方面，隨着旅客接待能力特別是航空客運力繼續恢復，以及政府大力推動盛事經濟，訪港旅客數目料將進一步增加，帶動旅遊和相關服務輸出的增長。此外，市民入息持續增加，將繼續支持私人消費。政府相繼推出的措施，都有助提振消費氣氛。至於固定資產投資，亦應隨着經濟繼續增長而進一步上升。\r\n陳茂波指出2023年是香港經濟疫後復常的一年。自年初取消防疫措施和恢復全面通關後，經濟活動隨即改善，儘管困難的外圍環境繼續制約增長速度。去年全年經濟回復3.2%的正增長，市民入息錄得實質升幅。\r\n他指出在政府推出消費券計劃及其他活動和措施（如「開心香港」、「香港夜繽紛」等）的支持下，加上住戶入息持續增加，去年私人消費開支實質明顯回升7.3%。整體投資開支亦隨着經濟恢復而反彈10.8%。\r\n訪港旅客去年大幅回升至約3,400萬人次，第4季的數字恢復至2018年同期的58%。全年旅遊服務輸出大升，運輸服務輸出亦隨之增加，帶動整體服務輸出全年顯著增長21.2%。\r\n陳茂波表示，外圍環境充滿挑戰，繼續影響香港的出口表現。地緣政治局勢緊張嚴重打擊全球各地的經濟信心。先進經濟體的央行大幅加息以應對通脹，令環球金融狀況收緊，遏抑貨物進口需求。國際貨幣基金組織（國基會）估計，去年全球經濟增長進一步放緩至3.1%。在這背景下，去年香港整體貨物出口顯著下跌10.3%。\r\n他指出勞工市場持續改善。經季節性調整的失業率由2022年第4季的3.5%下跌至最新的百2.9%。去年第四季全職僱員每月就業收入中位數按年顯著上升8.6%。',	'2024-02-28 03:30:20.204',	NULL,	'HKEX',	'財政預算案｜陳茂波料今年本港經濟增長2.5%至3.5%｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240225/838373967239581696540638.jpeg/naNzS-9wAnhXG9dpQv_AIucC_uX8I2K-Fgq4AzwKuAM?v=w1920r16_9'),
(39,	'',	'財政預算案｜樓市據報全面撤辣　地產股反下挫　美聯則飆近一成',	'本港樓市自2021年9月見頂以來，累計跌幅逾 20%。據差估署於周二（27日）公布的1月私人住宅樓價指數為306.4，按月跌1.57%，連跌9個月，累計跌幅達13.5%。若與2021年年中高位相比，累計跌幅更達23%。\r\n樓價下跌與外圍地緣政治局勢﹑宏觀經濟前景以及聯儲局在短短1年多時間加息5.25厘有關。受到樓價下挫拖累，市民入市意欲大減，去年本港整體樓宇買賣宗數為5.8萬宗，涉及金額為4,779.03億元，分別按年跌2.7%及13.8%。\r\n樓價下挫導致市民財富蒸發，早前新地（0016）執行董事郭基煇指出，樓價下跌引致本港市民財富縮減2.5萬億元。因此包括郭基煇等地產界及商界人士，紛紛向政府表達撤銷辣招意願。\r\n加息周期，樓市不濟亦反映在地產股股價上，從由年頭至本周二多隻地產股股價向下。其中新世界發展(0017)累跌16.4%；長實（1113）跌4.8%；而新地則跌7.3%。\r\n反觀美聯股價似「偷步」炒撤辣，美聯於周二收市價為0.66元，由年初0.495元至今升幅逾3成，跑贏大市。截止今日（28號）中午11時，現價0.71元，升9.2%，創三個月新高。',	'2024-02-28 03:30:20.244',	NULL,	'HKEX',	'財政預算案｜樓市據報全面撤辣　地產股反下挫　美聯則飆近一成',	'https://cdn.hk01.com/di/media/images/dw/20240109/821453169966977024817264.jpeg/ANcmxtuf_ZvmPg37IjdGauVckhI7wRYFbM1JQmzNSUI?v=w1920r16_9'),
(40,	'',	'財爺宣布即日起取消樓市辣招　美聯飆13%　新世界升2%｜持續更新',	'【11:22】\r\n財政司司長陳茂波宣布從今日（28日）起撤除所有樓市辣招，美聯（1200）應聲抽升13%，新地（0016）跌0.5%，新世界（0017）升1.9%，長實（1113）升0.3%。\r\n港股最新報16716點，跌74點。\r\n【10:26】\r\n內房股今早走勢疲弱，碧桂園（2007）遭入稟清盤，股價瀉11.1%，中海外（0688）跌0.5%，潤地（1109）跌1.4%，雅居樂（3383）跌2.5%，富力（2777）跌3.6%。\r\n恒指最新報16751點，跌38點，國指跌27點，報5779點，科指升17點，報3520點。\r\n【09:49】\r\n港股今早走勢反覆，高開後更掉頭向下，並於16800點附近爭持，最新報16826點，升35點。\r\n即將公布業績的網易（9999）揚4.3%，百度（9888）升2.2%。\r\n汽車股續上揚，理想汽車（2015）升3%，吉利（0175）升1.5%。\r\n晶片相關股方面，中芯（0981）升2.6%，ASMPT（0522）宣布派特別息，最新報95.6元，飆6.2%。\r\n【09:25】\r\n恒指最新報16833點，高開42點，國指最新報5824點，高開17點，科指最新報3527點，高開24點。\r\n新創建（0659）昨日（27日）宣布派特別息，今早開14.9%，最新報8.47元，同系的新世界（0017）高開0.4%。\r\n地產股為今日焦點之一，將於今日收市後公布業績的新地（0016）平開，長實（1113）平開，恒地（0012）高開0.9%，美聯（1200）平開。\r\n科技股方面，阿里（9988）高開0.1%，騰訊（0700）高開0.1%，美團（3690）平開。\r\n金融股方面，滙豐（0005）高開0.4%，港交所（0388）平開。\r\n汽車股方面，理想汽車（2015）高開2.6%，蔚來（9866）高開0.1%，小鵬（9868）低開0.3%。\r\n內房股方面，碧桂園（2007）遭入稟清盤，今早低開4.2%，中海外（0688）跌0.7%。',	'2024-02-28 03:30:20.246',	NULL,	'HKEX',	'財爺宣布即日起取消樓市辣招　美聯飆13%　新世界升2%｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240228/839439702208548864862130.jpeg/PEEwhiQUYr1ibPPWe56tUTL2RS-pAr7lAZzi3AGc4tw?v=w1920r16_9'),
(41,	'',	'財政預算案｜料香港今年經濟增長2.5%至3.5%　未來3年年均增3.2%',	'陳茂波指出，今年的外圍環境仍然較為複雜。地緣政治局勢緊張，將繼續影響國際貿易及資金流向，也可能對環球供應鏈造成干擾。金融狀況在過去2年大幅收緊，會繼續制約先進經濟體的增長速度。另一方面，市場普遍相信美國聯邦儲備局（聯儲局）今年內會開始減息，儘管減息的時間和幅度仍然存在變數。上月國基會預測今年全球經濟增長將維持在3.1%，低於2000至2019年期間3.8%的年均增長率。\r\n他預計，今年內地的出口表現仍會受到外圍環境影響。不過，內地經濟韌性強、基本面堅實，國家的各項提振經濟政策陸續發揮效用，亦有足夠政策空間進一步調控經濟，內部需求料將進一步改善。預料今年內地經濟將會錄得平穩增長。\r\n先進經濟體方面，陳茂波表示，隨着過去兩年息率上升對需求的滯後影響進一步顯現，美國今年的經濟增長預期將較去年低。不過，若聯儲局一如市場預期在年內開始減息，將對經濟有一定支持。過去2年，美國的消費增長較為集中在服務方面，今年對貨物需求或可錄得較快增長，並為環球貿易提供支持。歐洲方面，地緣政治局勢緊張，加上環球需求仍未顯著改善，今年的經濟增長預期將持續疲弱。\r\n他表示，雖然外圍環境會繼續對香港的貨物出口構成壓力，但環球金融狀況有機會在年內逐步放鬆，或會有利出口表現。另一方面，隨着旅客接待能力特別是航空客運力繼續恢復，以及政府大力推動盛事經濟，訪港旅客數目料將進一步增加，帶動旅遊和相關服務輸出的增長。此外，市民入息持續增加，將繼續支持私人消費。政府相繼推出的措施，都有助提振消費氣氛。至於固定資產投資，亦應隨着經濟繼續增長而進一步上升。\r\n考慮到上述各項因素，港府預計，香港經濟在今年會進一步擴張，全年實質增長介乎百分2.5%至3.5%。物價方面，預期本地成本壓力會隨着經濟復蘇而增加，外圍價格壓力則應進一步緩和，儘管地緣政治局勢持續緊張或會帶來上行風險。我們預測今年基本通脹率和整體通脹率將分別為1.7%及2.4%。\r\n中期而言，陳茂波表示，香港經濟將可持續穩健發展。雖然緊張的地緣政治局勢會繼續影響國際資金流動和貿易格局，大多數經濟體在疫情期間大力推行擴張性的財政和貨幣政策，也令環球經濟和金融系統的脆弱性增加，但預期美國和歐元區利率在未來幾年逐步回落，環球需求應可隨之逐步恢復。更重要的是，國家着力推動高質量發展，將為香港帶來廣闊的發展空間。\r\n他指出， 國家「十四五」規劃已為香港訂下「八大中心」的明確定位。只要香港用好「一國兩制」下的獨特優勢穩步前行，積極融入國家發展大局，對接國家發展戰略，繼續發揮國內與國際雙循環的重要節點功能，前景定必十分亮麗。政府近年在擴大經濟容量、提升競爭力和培育新增長點方面的努力，也讓香港在環球經濟狀況好轉時能抓緊機遇，提高中長期的增長動力。\r\n基於上述考慮，港府預測，香港經濟在2025至2028年間，平均每年實質增長3.2%。基本通脹率預計為平均每年2.5%。',	'2024-02-28 03:38:45.415',	NULL,	'HKEX',	'財政預算案｜料香港今年經濟增長2.5%至3.5%　未來3年年均增3.2%',	'https://cdn.hk01.com/di/media/images/dw/20240228/839459216124022784564718.jpeg/PWP_FaxlSa5gj62ciDpiyHFhxLCRWFJk8B_EHfAfxB0?v=w1920r16_9'),
