(43,	'',	'財政預算案｜樓市宣布全面撤辣　地產股反下挫　美聯則飆逾一成',	'本港樓市自2021年9月見頂以來，累計跌幅逾 20%。據差估署於周二（27日）公布的1月私人住宅樓價指數為306.4，按月跌1.57%，連跌9個月，累計跌幅達13.5%。若與2021年年中高位相比，累計跌幅更達23%。\r\n樓價下跌與外圍地緣政治局勢﹑宏觀經濟前景以及聯儲局在短短1年多時間加息5.25厘有關。受到樓價下挫拖累，市民入市意欲大減，去年本港整體樓宇買賣宗數為5.8萬宗，涉及金額為4,779.03億元，分別按年跌2.7%及13.8%。\r\n樓價下挫導致市民財富蒸發，早前新地（0016）執行董事郭基煇指出，樓價下跌引致本港市民財富縮減2.5萬億元。因此包括郭基煇等地產界及商界人士，紛紛向政府表達撤銷辣招意願。\r\n加息周期，樓市不濟亦反映在地產股股價上，從由年頭至本周二多隻地產股股價向下。其中新世界發展(0017)累跌16.4%；長實（1113）跌4.8%；而新地則跌7.3%。\r\n反觀美聯股價似「偷步」炒撤辣，美聯於周二收市價為0.66元，由年初0.495元至今升幅逾3成，跑贏大市。截止今日（28號）中午11時20分，現價0.74元，升13.8%，創三個月新高。',	'2024-02-28 03:38:45.423',	NULL,	'HKEX',	'財政預算案｜樓市宣布全面撤辣　地產股反下挫　美聯則飆逾一成',	'https://cdn.hk01.com/di/media/images/dw/20240109/821453169966977024817264.jpeg/ANcmxtuf_ZvmPg37IjdGauVckhI7wRYFbM1JQmzNSUI?v=w1920r16_9'),
(44,	'',	'財政預算案｜樓市三大辣招稅即日起全面撤銷',	'翻查資料，樓市辣招最早可追溯至2010年11月，當時政府推出額外印花稅（SSD），限制市民在兩年內轉售單位，需要繳付樓高5至15%的SSD，當時本港樓市正處於一個穩步上揚的階段，當時CCL報89.41點。\r\n事隔兩年政府於2012年10月更推出SSD加強版，轉售時間限制調整為三年內，SSD稅款涉及樓價10至20%，當時政府更推出買家印花稅BSD，以限制非本地人士及以公司名義的買家，在港買樓時需繳付樓價15%的稅款。若以當時CCL 116.07點計算，短短兩年間樓價已上升近30%。\r\n政府為進一步壓抑樓價，於2013年2月份為樓市辣招「加辣」，更推出雙倍印花稅（DSD），調整200萬元或以下物業，稅款由100元增至樓價1.5%，其餘物業稅率也加倍，由最高稅率4.25%增至8.5%。\r\n雖然政府在2010年至2013年連環推出樓市辣招，不過及後樓價升勢未止，於2010年至2013年的三年間累升56%，CCL由2010年初報的76.17點，累升42.79點至118.96點。因此政府於2016年11月份及2017年4月再出手「加辣」，分別向買入第二套或以上物業的買家，劃一收稅樓價15%，以及採「一約多伙」15%從價印花稅，即買家以首次置業人士的名義，以一份合約購入多個單位，需繳付樓價15%的從價印花稅。\r\n總結政府推出三大辣招主因都是希望壓抑樓市升溫。不過據CCL顯示辣招首度推出的首11年，由當時最初的89.41點，持續上升至2021年8月份的歷史高位191.34點，即期間升幅高達約2.14倍。反映辣招未能達成壓抑樓市升溫的效果。\r\n於2021年8月份CCL歷史高位191.34點過後，樓市開始呈下行狀態，加上於2022年3月撞正美國加息週期，同時亦為本港樓市帶來壓力。當時有意見認為樓市辣招已經過時，要求政府重新檢視樓市相關政策。\r\n政府亦為招商引才，在2022年10月特首李家超發表首份《施政報告》 當中指出，待合資格外來人才在成為香港永久性居民後，可申請退還在港置業已繳付額外的印花稅，即「先徵後退」。\r\n即如該類人士可於居港七年並成為香港永久性居民後，就其已購入並仍然持有的首個住宅物業申請退還已繳付的買家印花稅及新住宅印花稅，但他們仍須繳交按「第二標準稅率」計算的從價印花稅。不過當時樓市未有因此而反彈，2022年12月底CCL亦已從高位回落近17.8%。',	'2024-02-28 03:38:45.426',	NULL,	'HKEX',	'財政預算案｜樓市三大辣招稅即日起全面撤銷',	'https://cdn.hk01.com/di/media/images/dw/20240228/839469345166856192891754.jpeg/GdJ4tegcobjUjqh-TH9QOLjvE6pydyV-sm0RCrJtEQo?v=w1920r16_9'),
(45,	'',	'財政預算案｜港投公司將辦國際主權基金圓桌會議｜持續更新',	'陳茂波於新一份財政預算案中指出，已率先為開放式基金型公司和有限合夥基金設立簡便的基金遷冊機制，以吸引現有的外地基金來港註冊和營運。今年上半年會就引入公司遷冊機制提交立法建議，便利在外地註冊的公司，尤其以亞太區為業務核心的企業，將註冊地遷至香港。\r\n他又指出除了繼續鞏固香港對傳統歐美資金的吸引力，亦致力開拓新資金來源，包括中東市場。亞太區首隻追蹤沙地阿拉伯股票的指數基金（ETF）去年底在本港掛牌，是兩地市場加強聯通的重要里程。正推動在中東上市一隻追蹤香港股票指數的ETF，香港金融管理局正與多家金融機構就此進行商討。\r\n他亦指出「香港人才服務辦公室」致力吸引海內外人才來港，並提供一條龍配套服務，協助他們落地生根。人才辦將於今年五月舉辦「全球人才高峰會暨粵港澳大灣區人才高質量發展大會」，宣傳香港作為國際人才樞紐的獨特優勢，推動大灣區內人才流動和合作。\r\n陳茂波指出，政府會有一系列措施，向海內外人士展現香港的吸引力，支援個人和企業抓緊機遇。同時，我們全方位推出政策措施，吸引資金、企業和人才，擴大經濟容量，增強發展動力。\r\n他表示匯聚更多企業、資金和人才，有助經濟更好發展。吸引企業方面，引進重點企業辦公室（引進辦）、創新科技及工業局（創科局）、投資推廣署及香港投資管理有限公司（港投公司）主動接觸海內外企業，積極吸引和幫助高增值科技及其他企業落戶香港。\r\n陳茂波指出下月會有10多家重點企業與引進辦簽署意向書，他們已落實或準備落戶香港或擴展在港業務，連同首批的30家，預計未來數年合共會為香港帶來超過400億元的投資和創造約1.3萬個職位。這些企業落戶香港，將帶動相關產業鏈的上、中、下游企業到港，推動香港創新科技生態圈的蓬勃發展。港投公司將發揮資本引導作用及槓桿市場資源，吸引更多創新科技公司在港落戶，加速發展重點產業。今年上半年將落實首批直接投資和共同投資項目，涵蓋生命科技、綠色科技和金融、半導體、芯片、製造業升級轉型等領域。\r\n他指出為加強本港匯聚企業及資金的吸引力，港投公司將籌辦「國際主權基金圓桌會議」，邀請主權基金及金融界領袖出席，探索投資機遇並建立伙伴合作關係。另外，亦會舉辦「香港初創投資和發展高峰論壇」，邀請初創生態圈的重要成員參與，進一步激活「投」、「產」、「學」、「研」的協同合作，支持不同階段創科企業的發展。\r\n陳茂波預料今年內地的出口表現仍會受到外圍環境影響。不過，內地經濟韌性強、基本面堅實，國家的各項提振經濟政策陸續發揮效用，亦有足夠政策空間進一步調控經濟，內部需求料將進一步改善。預料今年內地經濟將會錄得平穩增長。\r\n先進經濟體方面，隨着過去2年息率上升對需求的滯後影響進一步顯現，美國今年的經濟增長預期將較去年低。不過，若聯儲局一如市場預期在年內開始減息，將對經濟有一定支持。過去兩年，美國的消費增長較為集中在服務方面，今年對貨物需求或可錄得較快增長，並為環球貿易提供支持。歐洲方面，地緣政治局勢緊張，加上環球需求仍未顯著改善，今年的經濟增長預期將持續疲弱。\r\n他認為雖然外圍環境會繼續對香港的貨物出口構成壓力，但環球金融狀況有機會在年內逐步放鬆，或會有利出口表現。\r\n另一方面，隨着旅客接待能力特別是航空客運力繼續恢復，以及政府大力推動盛事經濟，訪港旅客數目料將進一步增加，帶動旅遊和相關服務輸出的增長。此外，市民入息持續增加，將繼續支持私人消費。政府相繼推出的措施，都有助提振消費氣氛。至於固定資產投資，亦應隨着經濟繼續增長而進一步上升。\r\n陳茂波指出2023年是香港經濟疫後復常的一年。自年初取消防疫措施和恢復全面通關後，經濟活動隨即改善，儘管困難的外圍環境繼續制約增長速度。去年全年經濟回復3.2%的正增長，市民入息錄得實質升幅。\r\n他指出在政府推出消費券計劃及其他活動和措施（如「開心香港」、「香港夜繽紛」等）的支持下，加上住戶入息持續增加，去年私人消費開支實質明顯回升7.3%。整體投資開支亦隨着經濟恢復而反彈10.8%。\r\n訪港旅客去年大幅回升至約3,400萬人次，第4季的數字恢復至2018年同期的58%。全年旅遊服務輸出大升，運輸服務輸出亦隨之增加，帶動整體服務輸出全年顯著增長21.2%。\r\n陳茂波表示，外圍環境充滿挑戰，繼續影響香港的出口表現。地緣政治局勢緊張嚴重打擊全球各地的經濟信心。先進經濟體的央行大幅加息以應對通脹，令環球金融狀況收緊，遏抑貨物進口需求。國際貨幣基金組織（國基會）估計，去年全球經濟增長進一步放緩至3.1%。在這背景下，去年香港整體貨物出口顯著下跌10.3%。\r\n他指出勞工市場持續改善。經季節性調整的失業率由2022年第4季的3.5%下跌至最新的百2.9%。去年第四季全職僱員每月就業收入中位數按年顯著上升8.6%。',	'2024-02-28 03:45:37.212',	NULL,	'HKEX',	'財政預算案｜港投公司將辦國際主權基金圓桌會議｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240225/838373967239581696540638.jpeg/naNzS-9wAnhXG9dpQv_AIucC_uX8I2K-Fgq4AzwKuAM?v=w1920r16_9'),
(46,	'',	'財政預算案｜樓市三大辣招印花稅即日起全面撤銷',	'翻查資料，樓市辣招最早可追溯至2010年11月，當時政府推出額外印花稅（SSD），限制市民在兩年內轉售單位，需要繳付樓高5至15%的SSD，當時本港樓市正處於一個穩步上揚的階段，當時CCL報89.41點。\r\n事隔兩年政府於2012年10月更推出SSD加強版，轉售時間限制調整為三年內，SSD稅款涉及樓價10至20%，當時政府更推出買家印花稅BSD，以限制非本地人士及以公司名義的買家，在港買樓時需繳付樓價15%的稅款。若以當時CCL 116.07點計算，短短兩年間樓價已上升近30%。\r\n政府為進一步壓抑樓價，於2013年2月份為樓市辣招「加辣」，更推出雙倍印花稅（DSD），調整200萬元或以下物業，稅款由100元增至樓價1.5%，其餘物業稅率也加倍，由最高稅率4.25%增至8.5%。\r\n雖然政府在2010年至2013年連環推出樓市辣招，不過及後樓價升勢未止，於2010年至2013年的三年間累升56%，CCL由2010年初報的76.17點，累升42.79點至118.96點。因此政府於2016年11月份及2017年4月再出手「加辣」，分別向買入第二套或以上物業的買家，劃一收稅樓價15%，以及採「一約多伙」15%從價印花稅，即買家以首次置業人士的名義，以一份合約購入多個單位，需繳付樓價15%的從價印花稅。\r\n總結政府推出三大辣招主因都是希望壓抑樓市升溫。不過據CCL顯示辣招首度推出的首11年，由當時最初的89.41點，持續上升至2021年8月份的歷史高位191.34點，即期間升幅高達約2.14倍。反映辣招未能達成壓抑樓市升溫的效果。\r\n於2021年8月份CCL歷史高位191.34點過後，樓市開始呈下行狀態，加上於2022年3月撞正美國加息週期，同時亦為本港樓市帶來壓力。當時有意見認為樓市辣招已經過時，要求政府重新檢視樓市相關政策。\r\n政府亦為招商引才，在2022年10月特首李家超發表首份《施政報告》 當中指出，待合資格外來人才在成為香港永久性居民後，可申請退還在港置業已繳付額外的印花稅，即「先徵後退」。\r\n即如該類人士可於居港七年並成為香港永久性居民後，就其已購入並仍然持有的首個住宅物業申請退還已繳付的買家印花稅及新住宅印花稅，但他們仍須繳交按「第二標準稅率」計算的從價印花稅。不過當時樓市未有因此而反彈，2022年12月底CCL亦已從高位回落近17.8%。',	'2024-02-28 03:45:37.219',	NULL,	'HKEX',	'財政預算案｜樓市三大辣招印花稅即日起全面撤銷',	'https://cdn.hk01.com/di/media/images/dw/20240228/839469345166856192891754.jpeg/GdJ4tegcobjUjqh-TH9QOLjvE6pydyV-sm0RCrJtEQo?v=w1920r16_9'),
(47,	'',	'財政預算案｜研究優化股票現貨買賣單位｜持續更新',	'【11:41】\r\n陳茂波指出，過去1年在發展股票市場方面進展良好。政府聯同各監管機構和香港交易所（0388）推出了多項措施，包括設立特專科技公司上市制度、港幣–人民幣雙櫃台股票交易機制。在吸引海外企業來港上市方面，港交所已於去年將沙特阿拉伯和印尼證券交易所納入認可交易所之列，便利在其主板上市的企業在港第二上市。\r\n他指出政府全速落實促進股票市場流動性專責小組去年10月提出的多項建議，包括改革創業板。港交所已就建立庫存回購股份機制、在惡劣天氣下維持市場運作等徵求市場意見，目標是今年中落實。\r\n陳茂波亦指出，為進一步提升市場效率和流動性，證監會及港交所正探討一系列措施，包括：\r\n（一）   完善上市機制：研究優化首次公開招股的價格發現流程，以及審視上市公司的公眾持股量要求，提升市場效率。結構性產品的上市要求和安排亦會優化，並減低其上市成本；\r\n（二）   優化交易機制：探索收窄最低上落價位，以縮窄買賣差價，今年第二季提出建議；下一步研究優化股票現貨買賣單位；以及探索進一步優化衍生產品的持倉限額及保證金安排，更好地滿足風險管理需要；\r\n（三）   改善對投資者服務：研究優化實時市場資訊服務，以合理價格向不同投資者提供切合需要的服務；及\r\n（四）   加強市場推廣：港交所將透過海外辦事處加強推廣香港證券市場，並積極深化與中東及東盟地區的聯繫，冀吸納更多發行人和資金。\r\n為進一步提高市場競爭力，房地產投資信託基金（REIT）單位轉讓和期權莊家進行證券經銷業務，將獲豁免繳付印花稅，預計政府每年收入減少約10億元。\r\n陳茂波於新一份財政預算案中指出，已率先為開放式基金型公司和有限合夥基金設立簡便的基金遷冊機制，以吸引現有的外地基金來港註冊和營運。今年上半年會就引入公司遷冊機制提交立法建議，便利在外地註冊的公司，尤其以亞太區為業務核心的企業，將註冊地遷至香港。\r\n他又指出除了繼續鞏固香港對傳統歐美資金的吸引力，亦致力開拓新資金來源，包括中東市場。亞太區首隻追蹤沙地阿拉伯股票的指數基金（ETF）去年底在本港掛牌，是兩地市場加強聯通的重要里程。正推動在中東上市一隻追蹤香港股票指數的ETF，香港金融管理局正與多家金融機構就此進行商討。\r\n他亦指出「香港人才服務辦公室」致力吸引海內外人才來港，並提供一條龍配套服務，協助他們落地生根。人才辦將於今年五月舉辦「全球人才高峰會暨粵港澳大灣區人才高質量發展大會」，宣傳香港作為國際人才樞紐的獨特優勢，推動大灣區內人才流動和合作。\r\n陳茂波指出，政府會有一系列措施，向海內外人士展現香港的吸引力，支援個人和企業抓緊機遇。同時，我們全方位推出政策措施，吸引資金、企業和人才，擴大經濟容量，增強發展動力。\r\n他表示匯聚更多企業、資金和人才，有助經濟更好發展。吸引企業方面，引進重點企業辦公室（引進辦）、創新科技及工業局（創科局）、投資推廣署及香港投資管理有限公司（港投公司）主動接觸海內外企業，積極吸引和幫助高增值科技及其他企業落戶香港。\r\n陳茂波指出下月會有10多家重點企業與引進辦簽署意向書，他們已落實或準備落戶香港或擴展在港業務，連同首批的30家，預計未來數年合共會為香港帶來超過400億元的投資和創造約1.3萬個職位。這些企業落戶香港，將帶動相關產業鏈的上、中、下游企業到港，推動香港創新科技生態圈的蓬勃發展。港投公司將發揮資本引導作用及槓桿市場資源，吸引更多創新科技公司在港落戶，加速發展重點產業。今年上半年將落實首批直接投資和共同投資項目，涵蓋生命科技、綠色科技和金融、半導體、芯片、製造業升級轉型等領域。\r\n他指出為加強本港匯聚企業及資金的吸引力，港投公司將籌辦「國際主權基金圓桌會議」，邀請主權基金及金融界領袖出席，探索投資機遇並建立伙伴合作關係。另外，亦會舉辦「香港初創投資和發展高峰論壇」，邀請初創生態圈的重要成員參與，進一步激活「投」、「產」、「學」、「研」的協同合作，支持不同階段創科企業的發展。\r\n陳茂波預料今年內地的出口表現仍會受到外圍環境影響。不過，內地經濟韌性強、基本面堅實，國家的各項提振經濟政策陸續發揮效用，亦有足夠政策空間進一步調控經濟，內部需求料將進一步改善。預料今年內地經濟將會錄得平穩增長。\r\n先進經濟體方面，隨着過去2年息率上升對需求的滯後影響進一步顯現，美國今年的經濟增長預期將較去年低。不過，若聯儲局一如市場預期在年內開始減息，將對經濟有一定支持。過去兩年，美國的消費增長較為集中在服務方面，今年對貨物需求或可錄得較快增長，並為環球貿易提供支持。歐洲方面，地緣政治局勢緊張，加上環球需求仍未顯著改善，今年的經濟增長預期將持續疲弱。\r\n他認為雖然外圍環境會繼續對香港的貨物出口構成壓力，但環球金融狀況有機會在年內逐步放鬆，或會有利出口表現。\r\n另一方面，隨着旅客接待能力特別是航空客運力繼續恢復，以及政府大力推動盛事經濟，訪港旅客數目料將進一步增加，帶動旅遊和相關服務輸出的增長。此外，市民入息持續增加，將繼續支持私人消費。政府相繼推出的措施，都有助提振消費氣氛。至於固定資產投資，亦應隨着經濟繼續增長而進一步上升。\r\n陳茂波指出2023年是香港經濟疫後復常的一年。自年初取消防疫措施和恢復全面通關後，經濟活動隨即改善，儘管困難的外圍環境繼續制約增長速度。去年全年經濟回復3.2%的正增長，市民入息錄得實質升幅。\r\n他指出在政府推出消費券計劃及其他活動和措施（如「開心香港」、「香港夜繽紛」等）的支持下，加上住戶入息持續增加，去年私人消費開支實質明顯回升7.3%。整體投資開支亦隨着經濟恢復而反彈10.8%。\r\n訪港旅客去年大幅回升至約3,400萬人次，第4季的數字恢復至2018年同期的58%。全年旅遊服務輸出大升，運輸服務輸出亦隨之增加，帶動整體服務輸出全年顯著增長21.2%。\r\n陳茂波表示，外圍環境充滿挑戰，繼續影響香港的出口表現。地緣政治局勢緊張嚴重打擊全球各地的經濟信心。先進經濟體的央行大幅加息以應對通脹，令環球金融狀況收緊，遏抑貨物進口需求。國際貨幣基金組織（國基會）估計，去年全球經濟增長進一步放緩至3.1%。在這背景下，去年香港整體貨物出口顯著下跌10.3%。\r\n他指出勞工市場持續改善。經季節性調整的失業率由2022年第4季的3.5%下跌至最新的百2.9%。去年第四季全職僱員每月就業收入中位數按年顯著上升8.6%。',	'2024-02-28 03:50:37.349',	NULL,	'HKEX',	'財政預算案｜研究優化股票現貨買賣單位｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240225/838373967239581696540638.jpeg/naNzS-9wAnhXG9dpQv_AIucC_uX8I2K-Fgq4AzwKuAM?v=w1920r16_9'),
(48,	'',	'財政預算案｜樓市宣布全面撤辣　地產股齊上揚　美聯則飆逾兩成',	'截止今日（28號）中午11時45分，現價0.80元，升21.2%，創三個月新高。\r\n本港樓市自2021年9月見頂以來，累計跌幅逾 20%。據差估署於周二（27日）公布的1月私人住宅樓價指數為306.4，按月跌1.57%，連跌9個月，累計跌幅達13.5%。若與2021年年中高位相比，累計跌幅更達23%。\r\n樓價下跌與外圍地緣政治局勢﹑宏觀經濟前景以及聯儲局在短短1年多時間加息5.25厘有關。受到樓價下挫拖累，市民入市意欲大減，去年本港整體樓宇買賣宗數為5.8萬宗，涉及金額為4,779.03億元，分別按年跌2.7%及13.8%。\r\n樓價下挫導致市民財富蒸發，早前新地（0016）執行董事郭基煇指出，樓價下跌引致本港市民財富縮減2.5萬億元。因此包括郭基煇等地產界及商界人士，紛紛向政府表達撤銷辣招意願。\r\n加息周期，樓市不濟亦反映在地產股股價上，從由年頭至本周二多隻地產股股價向下。其中新世界發展(0017)累跌16.4%；長實（1113）跌4.8%；而新地則跌7.3%。\r\n反觀美聯股價似「偷步」炒撤辣，美聯於周二收市價為0.66元，由年初0.495元至今升幅逾3成，跑贏大市。',	'2024-02-28 03:50:37.356',	NULL,	'HKEX',	'財政預算案｜樓市宣布全面撤辣　地產股齊上揚　美聯則飆逾兩成',	'https://cdn.hk01.com/di/media/images/dw/20240109/821453169966977024817264.jpeg/ANcmxtuf_ZvmPg37IjdGauVckhI7wRYFbM1JQmzNSUI?v=w1920r16_9'),
(49,	'',	'Hong Kong GDP to grow 2.5%-3.5% in 2024, scraps property tightening measures',	'<p>Hong Kong’s economy is expected to grow 2.5%-3.5% this year, Financial Secretary Paul Chan said on Wednesday as he announced measures to bolster a flagging property market and support the economy.</p><p>The special administrative region, which expanded 3.2% in 2023, will cancel all buy-side property tightening measures for residential properties and waive stamp duties payable on the transfer of REIT units, Chan said.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“We decided to cancel all demand-side management measures for residential properties with immediate effect. We consider that the relevant measures are no longer necessary amidst the current economic and market conditions,” Chan said, adding that there was room to further adjust measures for the property market.</p><p>Hong Kong’s housing prices, once among the most expensive in the world, have plunged 20% since their 2021 peak, dragged down by fragile market sentiment and a rise in interest rates. Some analysts expect a further 10% drop this year.</p><p>The government will roll out more than HK$1 billion ($127 million) in support measures for its beleaguered tourism industry, to help offset the impact from the struggling Chinese economy, which has resulted in fewer visitors from the mainland.</p><br /><p>The city will stage more than 80 “mega events” in the first half of the year to boost tourism, including a monthly fireworks and drone show at its famed Victoria Harbour.</p><p>Economic growth has also been hampered by geopolitical tensions between China and the United States, while capital flight turned the Hong Kong stock market into the worst performing major index last year.</p>',	'2024-02-28 04:40:28.505',	NULL,	'US',	'Hong Kong GDP to grow 2.5%-3.5% in 2024, scraps property tightening measures',	'https://image.cnbcfm.com/api/v1/image/107379410-1709092979770-gettyimages-2034324595-AFP_34KC4Q4.jpeg?v=1709093010&w=929&h=523&vtcrop=y'),
(50,	'',	'Trump’s Michigan victory helps build momentum ahead of Super Tuesday',	'<p><a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a> won the Michigan Republican presidential <a href=\"https://www.cnbc.com/2024/02/27/trump-biden-seek-to-dominate-michigan-presidential-primary-what-to-know-.html\">primary</a>, NBC News projects.</p><p>Tuesday’s result shows the former president and clear GOP frontrunner once again defeating former United Nations ambassador Nikki Haley, Trump’s last remaining primary rival.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“The numbers are far greater than we even anticipated,” Trump said by speakerphone to a Republican watch party in Grand Rapids, shortly after news organizations called the race for him. “Thank you very much, and we’ll be doing a lot of campaigning over the next couple of months.”</p><p>Haley has vowed to keep campaigning at least through Super Tuesday next week, when 15 states and one U.S. territory hold their nominating contests.</p><p>Her campaign called Tuesday’s results in Michigan evidence that Trump cannot even win over his own party in a general election. </p><p>“Let this serve as another warning sign that what has happened in Michigan will continue to play out across the country,” said Olivia Perez-Cubas, Haley’s national spokesperson.</p><p>“So long as Donald Trump is at the top of the ticket, Republicans will keep losing to the socialist left. Our children deserve better,” Perez-Cubas said.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>Haley has not won any Republican primaries or caucuses so far, and there are no upcoming state primaries that she is expected to win. Her campaign has nevertheless organized leadership teams in at least nine Super Tuesday states, the most recent of which was announced earlier Tuesday.</p><p>Trump went into the Michigan primary with momentum already, having trounced Haley by double-digit margins in her home state of South Carolina just three days earlier.</p><p>But there were also warning signs Tuesday  for the former president, who claims that the Republican Party is as unified behind him as it has ever been.</p><p>In South Carolina, Haley walked away with nearly 40% of the vote. And while Democrats were allowed to cast ballots in the state’s GOP primary, more than one in five Republican voters there told AP VoteCast that they would not vote for Trump in a general election, Politico <a href=\"https://www.politico.com/news/2024/02/24/south-carolina-takeaways-trump-haley-00143177\" target=\"_blank\">reported</a>.</p><p>Trump’s path to the nomination, and another shot at the White House, also runs through a thicket of legal troubles.</p><p>He is scheduled to stand trial in New York court next month on criminal charges related to alleged hush money payments made to a porn star and others. Another criminal case, based on Trump’s retention of classified documents after leaving the White House in 2020, is set to begin in federal court in Florida in late May.</p><p>Trump is also battling two other criminal cases that center on his efforts to overturn his 2020 election loss to Biden. Trump has pleaded not guilty to all of his criminal charges.</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div>',	'2024-02-28 04:40:28.515',	NULL,	'US',	'Trump’s Michigan victory helps build momentum ahead of Super Tuesday',	'https://image.cnbcfm.com/api/v1/image/107379000-1709052112419-gettyimages-2013768317-Trump.jpeg?v=1709052174&w=929&h=523&vtcrop=y'),
(51,	'',	'買家印花稅等辣招撤銷　美聯半日飆3成　恒指跌45點｜持續更新',	'【12:15】\r\n財政司司長陳茂波正在宣讀新一份財政預算案，並宣布取消所有針對樓市辣招，受到有關消息刺激，地產股全面上揚，新世界（0017）升5.9%，新地（0016）升3.3%，長實（1113）升2.9%，恒地（0012）升4.1%，信置（0083）升2.6%。至於從事物業代理的美聯（1200）更勁升29%，中午收市報0.84元。\r\n整體大市方面，恒指中午收市報16745點，跌45點，國指跌44點，報5762點，科指跌1點，報3501點，成交額為570億元。\r\n遊戲股方面，網易（9999）飆5.5%，騰訊（0700）跌1.5%，心動公司（2400）升0.9%，創夢天地（1119）跌2%。\r\n科技股方面，阿里（9988）跌不足0.1%，美團（3690）跌2%，小米（1810）跌0.9%。\r\n金融股方面，滙豐（0005）升1.1%，恒生（0011）升0.8%，港交所（0388）跌0.9%。\r\n【11:22】\r\n財政司司長陳茂波宣布從今日（28日）起撤除所有樓市辣招，美聯（1200）應聲抽升13%，新地（0016）跌0.5%，新世界（0017）升1.9%，長實（1113）升0.3%。\r\n港股最新報16716點，跌74點。\r\n【10:26】\r\n內房股今早走勢疲弱，碧桂園（2007）遭入稟清盤，股價瀉11.1%，中海外（0688）跌0.5%，潤地（1109）跌1.4%，雅居樂（3383）跌2.5%，富力（2777）跌3.6%。\r\n恒指最新報16751點，跌38點，國指跌27點，報5779點，科指升17點，報3520點。\r\n【09:49】\r\n港股今早走勢反覆，高開後更掉頭向下，並於16800點附近爭持，最新報16826點，升35點。\r\n即將公布業績的網易（9999）揚4.3%，百度（9888）升2.2%。\r\n汽車股續上揚，理想汽車（2015）升3%，吉利（0175）升1.5%。\r\n晶片相關股方面，中芯（0981）升2.6%，ASMPT（0522）宣布派特別息，最新報95.6元，飆6.2%。\r\n【09:25】\r\n恒指最新報16833點，高開42點，國指最新報5824點，高開17點，科指最新報3527點，高開24點。\r\n新創建（0659）昨日（27日）宣布派特別息，今早開14.9%，最新報8.47元，同系的新世界（0017）高開0.4%。\r\n地產股為今日焦點之一，將於今日收市後公布業績的新地（0016）平開，長實（1113）平開，恒地（0012）高開0.9%，美聯（1200）平開。\r\n科技股方面，阿里（9988）高開0.1%，騰訊（0700）高開0.1%，美團（3690）平開。\r\n金融股方面，滙豐（0005）高開0.4%，港交所（0388）平開。\r\n汽車股方面，理想汽車（2015）高開2.6%，蔚來（9866）高開0.1%，小鵬（9868）低開0.3%。\r\n內房股方面，碧桂園（2007）遭入稟清盤，今早低開4.2%，中海外（0688）跌0.7%。',	'2024-02-28 04:40:31.885',	NULL,	'HKEX',	'買家印花稅等辣招撤銷　美聯半日飆3成　恒指跌45點｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240228/839439702208548864862130.jpeg/PEEwhiQUYr1ibPPWe56tUTL2RS-pAr7lAZzi3AGc4tw?v=w1920r16_9'),
(52,	'',	'財政預算案2024｜財爺公佈再發行700億零售債券　銀債規模達500億',	'陳茂波於預算案內指出，2024/25年度政府將發債1200億元，今次發債700億元為零售部分，銀色債券規模達500億元，佔總零售債券七成。\r\n政府近年積極發行零售債券，包括與通脹掛鈎的iBond﹑針對銀髮族發行的銀色債券，以及為配合綠色金融發展而發行綠色債券。其中銀色債券由2016至2017年財政年度開始每年均發行，已發行8批，且發行規模亦不斷提高，首批發行額為30億元，在2023至2024年增至550億元。\r\n銀色債券每手入場費為1萬元，年期為3年，每半年派息一次，惟不設二手市場。息率方面，第8批銀色債券保底息率為5厘。\r\n至於綠色債券方面，政府為舒緩氣候變化問題的項目集資的債務證券，以及推動香港可持續發展的綠色項目融資或再融資，自2022至23年度開始發行予合資格市民認購。\r\n在2023至2024年度政府發行綠色債券金額為200億元，其保底息率為4.75厘。綠色債券每手入場費為1萬元，年期為3年，每半年派息一次，設有二手市場。',	'2024-02-28 04:40:31.889',	NULL,	'HKEX',	'財政預算案2024｜財爺公佈再發行700億零售債券　銀債規模達500億',	'https://cdn.hk01.com/di/media/images/614259/org/f013fb2c92cc5e350189a0a554624348.jpg/sshQCbbUZdm99uXxYhf-swGX9axHekkFxe0XdMXtF3Q?v=w1920r16_9'),
(53,	'',	'財政預算案｜將啟動數碼港元第二階段試驗｜持續更新',	'陳茂波表示金管局去年十月完成「數碼港元」先導計劃的第一階段試驗，研究多個範疇的本地零售用例，例如可編程支付、離線支付、代幣化存款等。第二階段試驗即將啓動，進一步研究新用例。另一重點計劃「多種央行數碼貨幣跨境網絡」（mBridge）亦取得進展，第一階段服務預計可在今年推出，將成為全球其中一個率先以多種央行數碼貨幣為企業跨境交易進行結算的項目。\r\n陳茂波表示，香港是國際金融中心，也正朝著國際綠色金融中心的方向邁進。政府本周正舉辦「香港綠色周」，涵蓋科技、金融等不同範疇的活動，匯聚亞太地區的行業領袖，深入探討綠色發展和氣候融資等議題。金管局亦會於今年秋季，與迪拜金融服務管理局共同在香港舉辦氣候金融會議，探討中東和亞洲地區在促進轉型金融方面的機遇和挑戰。\r\n他又指出政府至今已成功透過「綠色和可持續金融資助計劃」資助合資格的債券發行人和借款人，在香港發行合共超過340筆綠色和可持續債務工具，總額達1,000億美元，豐富了香港綠色和可持續金融的生態。資助計劃將於今年年中屆滿，建議延長該計劃3年至2027年，並擴大資助範圍至轉型債券及貸款，以進一步鼓勵區內相關行業利用香港的轉型融資平台逐步減碳。\r\n陳茂波表示主題式會議有助加強塑造香港品牌，「國際金融領袖投資峰會」及「亞洲金融論壇」都是非常成功的例子。下月本港迎來「金融盛事周」，將有一系列重要金融盛事，包括匯聚家族辦公室擁有者及管理人的「裕澤香江」高峰論壇、Milken Institute全球投資者研討會等。豐富香港品牌的系列活動，還包括上述提及港投公司將籌辦的圓桌會議。\r\n陳茂波表示，為協助中小企應付資金流問題，會將「中小企融資擔保計劃」下8成及9成擔保產品的申請期延長2年至2026年3月底。計劃下的總信貸保證承擔額將額外增加100億元。他已指示金管局與銀行及工商界保持溝通，以包容態度協助企業應對資金周轉，避免因抵押品價值下跌而被追收貸款的情況出現。\r\n陳茂波指出，過去1年在發展股票市場方面進展良好。政府聯同各監管機構和香港交易所（0388）推出了多項措施，包括設立特專科技公司上市制度、港幣–人民幣雙櫃台股票交易機制。在吸引海外企業來港上市方面，港交所已於去年將沙特阿拉伯和印尼證券交易所納入認可交易所之列，便利在其主板上市的企業在港第二上市。\r\n他指出政府全速落實促進股票市場流動性專責小組去年10月提出的多項建議，包括改革創業板。港交所已就建立庫存回購股份機制、在惡劣天氣下維持市場運作等徵求市場意見，目標是今年中落實。\r\n陳茂波亦指出，為進一步提升市場效率和流動性，證監會及港交所正探討一系列措施，包括：\r\n（一）   完善上市機制：研究優化首次公開招股的價格發現流程，以及審視上市公司的公眾持股量要求，提升市場效率。結構性產品的上市要求和安排亦會優化，並減低其上市成本；\r\n（二）   優化交易機制：探索收窄最低上落價位，以縮窄買賣差價，今年第二季提出建議；下一步研究優化股票現貨買賣單位；以及探索進一步優化衍生產品的持倉限額及保證金安排，更好地滿足風險管理需要；\r\n（三）   改善對投資者服務：研究優化實時市場資訊服務，以合理價格向不同投資者提供切合需要的服務；及\r\n（四）   加強市場推廣：港交所將透過海外辦事處加強推廣香港證券市場，並積極深化與中東及東盟地區的聯繫，冀吸納更多發行人和資金。\r\n為進一步提高市場競爭力，房地產投資信託基金（REIT）單位轉讓和期權莊家進行證券經銷業務，將獲豁免繳付印花稅，預計政府每年收入減少約10億元。\r\n陳茂波於新一份財政預算案中指出，已率先為開放式基金型公司和有限合夥基金設立簡便的基金遷冊機制，以吸引現有的外地基金來港註冊和營運。今年上半年會就引入公司遷冊機制提交立法建議，便利在外地註冊的公司，尤其以亞太區為業務核心的企業，將註冊地遷至香港。\r\n他又指出除了繼續鞏固香港對傳統歐美資金的吸引力，亦致力開拓新資金來源，包括中東市場。亞太區首隻追蹤沙地阿拉伯股票的指數基金（ETF）去年底在本港掛牌，是兩地市場加強聯通的重要里程。正推動在中東上市一隻追蹤香港股票指數的ETF，香港金融管理局正與多家金融機構就此進行商討。\r\n他亦指出「香港人才服務辦公室」致力吸引海內外人才來港，並提供一條龍配套服務，協助他們落地生根。人才辦將於今年五月舉辦「全球人才高峰會暨粵港澳大灣區人才高質量發展大會」，宣傳香港作為國際人才樞紐的獨特優勢，推動大灣區內人才流動和合作。\r\n陳茂波指出，政府會有一系列措施，向海內外人士展現香港的吸引力，支援個人和企業抓緊機遇。同時，我們全方位推出政策措施，吸引資金、企業和人才，擴大經濟容量，增強發展動力。\r\n他表示匯聚更多企業、資金和人才，有助經濟更好發展。吸引企業方面，引進重點企業辦公室（引進辦）、創新科技及工業局（創科局）、投資推廣署及香港投資管理有限公司（港投公司）主動接觸海內外企業，積極吸引和幫助高增值科技及其他企業落戶香港。\r\n陳茂波指出下月會有10多家重點企業與引進辦簽署意向書，他們已落實或準備落戶香港或擴展在港業務，連同首批的30家，預計未來數年合共會為香港帶來超過400億元的投資和創造約1.3萬個職位。這些企業落戶香港，將帶動相關產業鏈的上、中、下游企業到港，推動香港創新科技生態圈的蓬勃發展。港投公司將發揮資本引導作用及槓桿市場資源，吸引更多創新科技公司在港落戶，加速發展重點產業。今年上半年將落實首批直接投資和共同投資項目，涵蓋生命科技、綠色科技和金融、半導體、芯片、製造業升級轉型等領域。\r\n他指出為加強本港匯聚企業及資金的吸引力，港投公司將籌辦「國際主權基金圓桌會議」，邀請主權基金及金融界領袖出席，探索投資機遇並建立伙伴合作關係。另外，亦會舉辦「香港初創投資和發展高峰論壇」，邀請初創生態圈的重要成員參與，進一步激活「投」、「產」、「學」、「研」的協同合作，支持不同階段創科企業的發展。\r\n陳茂波預料今年內地的出口表現仍會受到外圍環境影響。不過，內地經濟韌性強、基本面堅實，國家的各項提振經濟政策陸續發揮效用，亦有足夠政策空間進一步調控經濟，內部需求料將進一步改善。預料今年內地經濟將會錄得平穩增長。\r\n先進經濟體方面，隨着過去2年息率上升對需求的滯後影響進一步顯現，美國今年的經濟增長預期將較去年低。不過，若聯儲局一如市場預期在年內開始減息，將對經濟有一定支持。過去兩年，美國的消費增長較為集中在服務方面，今年對貨物需求或可錄得較快增長，並為環球貿易提供支持。歐洲方面，地緣政治局勢緊張，加上環球需求仍未顯著改善，今年的經濟增長預期將持續疲弱。\r\n他認為雖然外圍環境會繼續對香港的貨物出口構成壓力，但環球金融狀況有機會在年內逐步放鬆，或會有利出口表現。\r\n另一方面，隨着旅客接待能力特別是航空客運力繼續恢復，以及政府大力推動盛事經濟，訪港旅客數目料將進一步增加，帶動旅遊和相關服務輸出的增長。此外，市民入息持續增加，將繼續支持私人消費。政府相繼推出的措施，都有助提振消費氣氛。至於固定資產投資，亦應隨着經濟繼續增長而進一步上升。\r\n陳茂波指出2023年是香港經濟疫後復常的一年。自年初取消防疫措施和恢復全面通關後，經濟活動隨即改善，儘管困難的外圍環境繼續制約增長速度。去年全年經濟回復3.2%的正增長，市民入息錄得實質升幅。\r\n他指出在政府推出消費券計劃及其他活動和措施（如「開心香港」、「香港夜繽紛」等）的支持下，加上住戶入息持續增加，去年私人消費開支實質明顯回升7.3%。整體投資開支亦隨着經濟恢復而反彈10.8%。\r\n訪港旅客去年大幅回升至約3,400萬人次，第4季的數字恢復至2018年同期的58%。全年旅遊服務輸出大升，運輸服務輸出亦隨之增加，帶動整體服務輸出全年顯著增長21.2%。\r\n陳茂波表示，外圍環境充滿挑戰，繼續影響香港的出口表現。地緣政治局勢緊張嚴重打擊全球各地的經濟信心。先進經濟體的央行大幅加息以應對通脹，令環球金融狀況收緊，遏抑貨物進口需求。國際貨幣基金組織（國基會）估計，去年全球經濟增長進一步放緩至3.1%。在這背景下，去年香港整體貨物出口顯著下跌10.3%。\r\n他指出勞工市場持續改善。經季節性調整的失業率由2022年第4季的3.5%下跌至最新的百2.9%。去年第四季全職僱員每月就業收入中位數按年顯著上升8.6%。',	'2024-02-28 04:40:31.892',	NULL,	'HKEX',	'財政預算案｜將啟動數碼港元第二階段試驗｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240225/838373967239581696540638.jpeg/naNzS-9wAnhXG9dpQv_AIucC_uX8I2K-Fgq4AzwKuAM?v=w1920r16_9'),
(54,	'',	'Macy\'s｜美國梅西百貨擬關閉150間分店　集中發展奢侈品銷售業務',	'《衛報》報道，梅西百貨預測今年的交易表現暗淡，因此決定在今年內關閉大約50間分店，而該公司在1月宣布削減3.5%人手，2350人受影響。除了關閉表現欠佳的分店，公司亦承諾優先投資約350間分店，同時擴充較細小的店舖。\r\n梅西百貨新行政總裁斯普林（Tony Spring）表示，今次是公司「無畏的新一頁」，回應採取行動的訴求，它將挑戰現狀，以創造一個更現代的品牌。而作為重點的一部分，公司計劃新開15間走高檔路線的Bloomingdale分店，以及30間Blue Mercury化妝品專門店。\r\n斯普林稱，公司正採取必要措施，透過改善購物體驗、相關貨品及引人注目的價格，與顧客重新建立關係。他強調，公司員工受未來的工作激勵，為公司增加市場佔有率、為股東創造一個可持續和有利潤的增長及價值。\r\n美國的百貨業在疫情前已經面對網上零售市場的劇烈競爭，Neiman Marcus與JCPenney分別申請破產保護，而梅西百貨在2023年最後一個季度錄得7100萬美元虧損，總銷售量跌1.7%，高過華爾街分析師的預期，該公司早前拒絕專注於房地產的投資公司Arkhouse Management，與資產管理公司Brigade Capital Management合組財團的58億美元收購方案。',	'2024-02-28 04:40:31.897',	NULL,	'HKEX',	'Macy\'s｜美國梅西百貨擬關閉150間分店　集中發展奢侈品銷售業務',	'https://cdn.hk01.com/di/media/images/dw/20240119/825053316802154496312509.jpeg/sJMh6zhKrvm_AabT95GtS8Q_KHQuzghVxlvkpcZb5KU?v=w1920r16_9'),
(55,	'',	'財政預算案｜辣招印花稅全面撤銷　樓市三大辣稅即日起無須再繳',	'翻查資料，樓市辣招最早可追溯至2010年11月，當時政府推出額外印花稅（SSD），限制市民在兩年內轉售單位，需要繳付樓高5至15%的SSD，當時本港樓市正處於一個穩步上揚的階段，當時CCL報89.41點。\r\n事隔兩年政府於2012年10月更推出SSD加強版，轉售時間限制調整為三年內，SSD稅款涉及樓價10至20%，當時政府更推出買家印花稅BSD，以限制非本地人士及以公司名義的買家，在港買樓時需繳付樓價15%的稅款。若以當時CCL 116.07點計算，短短兩年間樓價已上升近30%。\r\n政府為進一步壓抑樓價，於2013年2月份為樓市辣招「加辣」，更推出雙倍印花稅（DSD），調整200萬元或以下物業，稅款由100元增至樓價1.5%，其餘物業稅率也加倍，由最高稅率4.25%增至8.5%。\r\n雖然政府在2010年至2013年連環推出樓市辣招，不過及後樓價升勢未止，於2010年至2013年的三年間累升56%，CCL由2010年初報的76.17點，累升42.79點至118.96點。因此政府於2016年11月份及2017年4月再出手「加辣」，分別向買入第二套或以上物業的買家，劃一收稅樓價15%，以及採「一約多伙」15%從價印花稅，即買家以首次置業人士的名義，以一份合約購入多個單位，需繳付樓價15%的從價印花稅。\r\n總結政府推出三大辣招主因都是希望壓抑樓市升溫。不過據CCL顯示辣招首度推出的首11年，由當時最初的89.41點，持續上升至2021年8月份的歷史高位191.34點，即期間升幅高達約2.14倍。反映辣招未能達成壓抑樓市升溫的效果。\r\n於2021年8月份CCL歷史高位191.34點過後，樓市開始呈下行狀態，加上於2022年3月撞正美國加息週期，同時亦為本港樓市帶來壓力。當時有意見認為樓市辣招已經過時，要求政府重新檢視樓市相關政策。\r\n政府亦為招商引才，在2022年10月特首李家超發表首份《施政報告》 當中指出，待合資格外來人才在成為香港永久性居民後，可申請退還在港置業已繳付額外的印花稅，即「先徵後退」。\r\n即如該類人士可於居港七年並成為香港永久性居民後，就其已購入並仍然持有的首個住宅物業申請退還已繳付的買家印花稅及新住宅印花稅，但他們仍須繳交按「第二標準稅率」計算的從價印花稅。不過當時樓市未有因此而反彈，2022年12月底CCL亦已從高位回落近17.8%。',	'2024-02-28 04:40:31.899',	NULL,	'HKEX',	'財政預算案｜辣招印花稅全面撤銷　樓市三大辣稅即日起無須再繳',	'https://cdn.hk01.com/di/media/images/dw/20240228/839469345166856192891754.jpeg/GdJ4tegcobjUjqh-TH9QOLjvE6pydyV-sm0RCrJtEQo?v=w1920r16_9'),
(56,	'',	'財政預算案｜樓市全撤辣谷起地產股　新世界飆逾6%　美聯爆升29%',	'截止今日﹙28日﹚上午約11時55分，美聯報0.84元，爆升29.2%，創三個月新高。事實上，該股上月中已「偷步」炒上，由0.5元左右升至今日，累計升幅達到六成。\r\n另外，地產股亦造好，其中新世界﹙0017﹚升6.3%、恒地（0012）升4.1%、新地﹙0016﹚升3.3%、長實﹙1113﹚升3.1%、信置﹙0083﹚升2.9%。\r\n本港樓市自2021年9月見頂以來，累計跌幅逾 20%，市場撤辣之聲不絕。據差估署於周二（27日）公布的1月私人住宅樓價指數為306.4，按月跌1.57%，連跌9個月，累計跌幅達13.5%。若與2021年年中高位相比，累計跌幅更達23%。\r\n樓價下跌與外圍地緣政治局勢﹑宏觀經濟前景以及聯儲局在短短1年多時間加息5.25厘有關。受到樓價下挫拖累，市民入市意欲大減，去年本港整體樓宇買賣宗數為5.8萬宗，涉及金額為4,779.03億元，分別按年跌2.7%及13.8%。\r\n樓價下挫導致市民財富蒸發，早前新地（0016）執行董事郭基煇指出，樓價下跌引致本港市民財富縮減2.5萬億元。因此包括郭基煇等地產界及商界人士，紛紛向政府表達撤銷辣招意願。\r\n加息周期，樓市不濟亦反映在地產股股價上，從由年頭至本周二多隻地產股股價向下。其中新世界發展(0017)累跌16.4%；而新地則跌7.3%；長實（1113）跌4.8%，跑輸大市。',	'2024-02-28 04:40:31.902',	NULL,	'HKEX',	'財政預算案｜樓市全撤辣谷起地產股　新世界飆逾6%　美聯爆升29%',	'https://cdn.hk01.com/di/media/images/dw/20240109/821453169966977024817264.jpeg/ANcmxtuf_ZvmPg37IjdGauVckhI7wRYFbM1JQmzNSUI?v=w1920r16_9'),
(57,	'',	'Joe Biden won big in Michigan primary, but ‘uncommitted’ votes signaled potential trouble',	'<p>President <a href=\"https://www.cnbc.com/joe-biden/\">Joe Biden</a> won the <a href=\"https://www.michigan.gov/sos\" target=\"_blank\">Michigan</a> Democratic presidential primary in a landslide, capturing around 80 percent of the votes, as of 11:00 p.m; Tuesday.</p><p>The incumbent president’s victory was widely anticipated in the <a href=\"https://www.cnbc.com/2024/02/27/trump-biden-seek-to-dominate-michigan-presidential-primary-what-to-know-.html\">key swing state</a>. But the Michigan primary also acted as a litmus test for Biden’s standing with essential Democratic voter bases, especially amid heightened tensions about his administration’s handling of the war in Gaza.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Over the past few months, Michigan, which has a significant Arab American voter population, became the breeding ground of several anti-Biden campaigns, urging voters to cast “uncommitted” ballots in protest of the Gaza war.</p><p>The “uncommitted” vote turned into Biden’s main Michigan challenger. As of 11 p.m. Tuesday night, around 13% of voters had chosen “uncommitted,” a higher rate than some Democrats had predicted.</p><p>“Four years ago, it was Michigan’s diverse coalition that came together to reject Donald Trump’s MAGA extremism and sent me and Kamala to the White House,” Biden said in a statement Tuesday night. </p><p>“This fight for our freedoms, for working families, and for Democracy is going to take all of us coming together. I know that we will,” he said.</p><p>In January, Biden landed the endorsement of the Detroit-based <a href=\"https://www.cnbc.com/2024/01/24/uaw-endorses-biden-over-trump-in-2024-election.html\">United Auto Workers</a> union, a crucial win for any candidate vying for the battleground state. The union has 400,000 active members and over 580,000 retired members, many of whom live in Michigan.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>In 2020, Biden also won the primary and general election in Michigan. This year, under Biden’s guidance, the Democratic National Committee rearranged the primary calendar to make Michigan one of the first states to vote, giving it bellwether status for the primary race.</p><p>Minnesota Rep. Dean Phillips Biden’s longshot opponent, has consistently polled in single digits, and appeared to win about 3% of the Michigan votes. Over the past month, he has canceled events and laid off staff as funding has dwindled.</p><p>Despite Biden’s lone rival, his win in Michigan solidifies the going message that the Democratic primary is all but over. His campaign has hinted as much, kicking into <a href=\"https://www.nbcnews.com/politics/2024-election/bidens-campaign-says-2024-gop-primary-voters-clear-choice-rcna135451\" target=\"_blank\">general election mode</a> by targeting all political attacks at GOP frontrunner and former President Donald Trump.</p>',	'2024-02-28 05:00:20.697',	NULL,	'US',	'Joe Biden won big in Michigan primary, but ‘uncommitted’ votes signaled potential trouble',	'https://image.cnbcfm.com/api/v1/image/107378512-1708977244539-gettyimages-2033875830-schwartz-notitle240226_npLQE.jpeg?v=1708977309&w=929&h=523&vtcrop=y'),
(58,	'',	'Michigan primary win helps Trump build momentum ahead of Super Tuesday',	'<br /><p><a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a> won the Michigan Republican presidential <a href=\"https://www.cnbc.com/2024/02/27/trump-biden-seek-to-dominate-michigan-presidential-primary-what-to-know-.html\">primary</a>, easily defeating former United Nations ambassador Nikki Haley, Trump’s last remaining primary rival.</p><p>“The numbers are far greater than we even anticipated,” Trump said by speakerphone to a Republican watch party in Grand Rapids, shortly after news organizations called the race for him. “Thank you very much, and we’ll be doing a lot of campaigning over the next couple of months.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Haley has also vowed to keep campaigning at least through Super Tuesday next week, when 15 states and one U.S. territory hold their nominating contests.</p><p>Her campaign called Tuesday’s results in Michigan evidence that Trump cannot even win over his own party in a general election.</p><p>“Let this serve as another warning sign that what has happened in Michigan will continue to play out across the country,” said Olivia Perez-Cubas, Haley’s national spokesperson.</p><p>“So long as Donald Trump is at the top of the ticket, Republicans will keep losing to the socialist left. Our children deserve better,” Perez-Cubas said.</p><br /><p>Haley has not won any Republican primaries or caucuses so far, and there are no upcoming state primaries that she is expected to win. Her campaign has nevertheless organized leadership teams in at least nine Super Tuesday states, the most recent of which was announced earlier Tuesday.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Trump went into the Michigan primary with momentum already, having trounced Haley by double-digit margins in her home state of South Carolina just three days earlier.</p><p>But there were also warning signs Tuesday for the former president, who claims that the Republican Party is as unified behind him as it has ever been.</p><p>In South Carolina, Haley walked away with nearly 40% of the vote. And while Democrats were allowed to cast ballots in the state’s GOP primary, more than one in five Republican voters there told AP VoteCast that they would not vote for Trump in a general election, Politico <a href=\"https://www.politico.com/news/2024/02/24/south-carolina-takeaways-trump-haley-00143177\" target=\"_blank\">reported</a>.</p><p>Trump’s path to the nomination, and another shot at the White House, also runs through a thicket of legal troubles.</p><p>He is scheduled to stand trial in New York court next month on criminal charges related to alleged hush money payments made to a porn star and others. Another criminal case, based on Trump’s retention of classified documents after leaving the White House in 2020, is set to begin in federal court in Florida in late May.</p><p>Trump is also battling two other criminal cases that center on his efforts to overturn his 2020 election loss to Biden. Trump has pleaded not guilty to all of his criminal charges.</p><br /><div class=\"RelatedContent-relatedContent\" id=\"RegularArticle-RelatedContent-1\"><div class=\"RelatedContent-container\"><div class=\"RelatedContent-nonCollapsibleContent\"><h2 class=\"RelatedContent-header\">Read more CNBC politics coverage</h2><div class=\"group\"><ul><li><a href=\"https://www.cnbc.com/politics/#:~:text=White%20House%20to%20expand%20Russia%20sanctions%20over%20Alexei%20Navalny%E2%80%99s%20death\"><strong>White House to expand Russia sanctions over Alexei Navalny’s death</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/20/appeals-court-to-rehear-nasdaq-diversity-rule-challenge.html\"><strong>Appeals court will rehear challenge to Nasdaq board diversity rule, putting mandate at risk</strong></a></li><li><a href=\"https://www.cnbc.com/2024/02/06/new-senate-bill-aims-to-kill-proposed-sec-rule-on-ai-conflicts-of-interest-.html\"><strong>Senate bill aims to kill proposed SEC rule on AI conflicts of interest</strong></a></li></ul></div></div></div></div>',	'2024-02-28 05:00:20.706',	NULL,	'US',	'Michigan primary win helps Trump build momentum ahead of Super Tuesday',	'https://image.cnbcfm.com/api/v1/image/107379215-1709064979376-gettyimages-2018941631-0j4a3475_jlpomvgc.jpeg?v=1709065064&w=929&h=523&vtcrop=y'),
(59,	'',	'財政預算案｜樓市全面撤辣減稅收？　政府消息人士：動態睇住個市',	'惟全面撤辣，外界紛紛關注，政府會少收多少稅？有政府消息人士表示，三大「辣招」在2020年至2023年期間，平均每年為政府帶來94億元稅收，當中額外印花稅稅收為1.87億元，買家印花稅稅收為2.6億元，新住宅印花稅稅收為66.4億元。不過，政府消息人士表示，「辣招」初衷並非是為了增加政府收入，而是為樓市降溫。現時撤辣後，或刺激樓市交投量，故從價印花稅稅收會相應增加。\r\n被問及當交投量增加時，「辣招」是否會重現？消息人士則指，相信短期內不會出現炒風熾熱的狀況，並強調政府會不斷留意住宅物業市場，倘若出現供求失衡的情況，會推出適當措施，形容為「動態睇住個市」。',	'2024-02-28 05:00:26.958',	NULL,	'HKEX',	'財政預算案｜樓市全面撤辣減稅收？　政府消息人士：動態睇住個市',	'https://cdn.hk01.com/di/media/images/dw/20240228/839427784836124672351928.jpeg/i1CFZTrNb6_C78gz1t1b6MNqaMBcm0tuDU3bhRdN24U?v=w1920r16_9'),
(60,	'',	'印花稅三大辣招全撤　地產股急彈　專家料轉勢看兩大信號｜預算案',	'受消息刺激，本地地產股全線反彈，以中午收市計，升幅最大的為新世界（0017），升0.68元或近7%，報10.48元；恒地升1元或4.5%，報23.2元；新地（0016）、九倉（1997）升3%；恒隆（0101）升2.8%；長實（1113）升2.6%。\r\n至於美聯物業（1200）則升近三成一，中午收報0.84元，升0.19元。\r\n銀河聯昌證券分析師鄭懷武接受《香港01》訪問時表示，目前樓市「相當差」，全面撤辣的刺激作用轉弱，<strong>預料僅將樓價持續下滑的風險降至最底。</strong>他又指出，本身不預期政府會取消SSD的兩年禁售期，「或者政府想簡單啲」，現時新措施較市場預期好。\r\n據代理數據，去年第四季一手私人住宅新盤貨尾量升到22,936個，數字連升三季，創逾20年新高。其中貨尾量升得最多的發展商為新地，旗下一手貨尾量按季增加696個至3,887個貨尾。\r\n有分析認為，<strong>取消SSD的兩年禁售期或會令市場供應不增。</strong>鄭懷武表示，業主預期美國聯儲局即將減息，加上公司、購入第二層物業等不再徵收額外印花稅，有望令市場需求上升，若果業主對樓價前景看法由「撤辣」前的悲觀轉為樂觀，未必會急於將業物出售。\r\n政府消息亦預料，短期內不會出現炒風熾熱的情況，強調會不斷留意住宅物業市場，倘若出現供求失衡的情況，會推出適當措施，形容為「動態睇住個市」。\r\n因此鄭懷武預料，樓市前景不如同業估計一樣，出現雙位數下跌般悲觀，在預期美國減息、取消辣招及租金上升下，估計下半年樓價將反彈，全年僅跌3%。\r\n至於地產類股份方面，他認為由於政府管理預期「做得好好」，刺激地產股即時上升，惟市場信心仍然疲弱，可能需要見到銷售及價格改善才是入市時機，投資者可留意新地或長實，較進取的則可留意近期跌幅較大的新世界及恒地。\r\nXXX',	'2024-02-28 05:30:12.356',	NULL,	'HKEX',	'印花稅三大辣招全撤　地產股急彈　專家料轉勢看兩大信號｜預算案',	'https://cdn.hk01.com/di/media/images/dw/20240228/839487565475090432392140.jpeg/cUWKcBDR-K94PA6iwseflP7nXzNnUTiWJlvY3iZb2N4?v=w1920r16_9'),
(61,	'',	'財政預算案｜金管局宣布暫停兩厘壓測',	'金管局隨後宣布，今日向銀行發出指引，修訂適用於物業按揭貸款的逆周期宏觀審慎監管措施及其他相關監管要求。\r\n其中包括第一：價值3,000萬港元或以下的自用住宅物業的按揭成數上限調整至七成；價值3,500萬港元或以上的自用住宅物業的按揭成數上限調整至六成。為了避免適用按揭成數出現驟降情況，價值3,000萬至3,500萬港元之間的物業的按揭比率會以漸進形式遞減。此外，非自用住宅物業的按揭成數上限由五成調升至六成。\r\n第二：非住宅物業（包括寫字樓、商鋪及工廈等）的按揭成數上限由六成提升至七成。\r\n第三：以「資產水平」為審批基礎的物業按揭貸款的按揭成數上限由五成提升至六成。此項修訂適用於住宅和非住宅物業。\r\n第四：美國聯邦儲備局近期表示，美國加息周期可能步入尾聲，未來一段時間本港按揭息率進一步上升的機會較低。有見及此，金管局認為適宜暫停實施物業按揭貸款假設利率上升200基點的壓力測試要求。\r\n第五：2017年6月，金管局收緊物業發展項目融資比率。鑑於目前房地產市場的情況，金管局認為適宜將相關比率上限回復至2017年以前的水平。換言之，整體物業發展項目的最高融資比率由物業完成後預期價值的五成調升至六成，當中地價成本融資比率上限由四成調升至五成，建築成本融資比率上限由八成調升至100%。此外，就銀行向提供高成數按揭地產發展商的風險敞口，相關的額外資本要求同時取消。\r\n以上所有修訂即日生效，適用於今日或以後簽訂臨時買賣合約的物業交易。\r\n金管局會繼續密切留意市場發展，並會因應物業市場的最新情況，推出合適措施保障銀行體系穩定。',	'2024-02-28 05:30:12.361',	NULL,	'HKEX',	'財政預算案｜金管局宣布暫停兩厘壓測',	'https://cdn.hk01.com/di/media/images/dw/20240215/834851919145996288931056.jpeg/_M53LOMPVTwyfpBMr-E6ZXuA9A8Ht9kCha4iMoWuIjI?v=w1920r16_9'),
(62,	'',	'預算案印花稅辣招全撤｜大減政府稅收　消息人士：動態睇住個市',	'惟全面撤辣，外界紛紛關注，政府會少收多少稅？有政府消息人士表示，三大「辣招」在2020年至2023年期間，平均每年為政府帶來94億元稅收，當中額外印花稅稅收為1.87億元，買家印花稅稅收為2.6億元，新住宅印花稅稅收為66.4億元。不過，政府消息人士表示，「辣招」初衷並非是為了增加政府收入，而是為樓市降溫。現時撤辣後，或刺激樓市交投量，故從價印花稅稅收會相應增加。\r\n被問及當交投量增加時，「辣招」是否會重現？消息人士則指，相信短期內不會出現炒風熾熱的狀況，並強調政府會不斷留意住宅物業市場，倘若出現供求失衡的情況，會推出適當措施，形容為「動態睇住個市」。',	'2024-02-28 05:30:12.364',	NULL,	'HKEX',	'預算案印花稅辣招全撤｜大減政府稅收　消息人士：動態睇住個市',	'https://cdn.hk01.com/di/media/images/dw/20240228/839427784836124672351928.jpeg/i1CFZTrNb6_C78gz1t1b6MNqaMBcm0tuDU3bhRdN24U?v=w1920r16_9'),
(63,	'',	'印花稅辣招全面撤銷　預算案樓市三大辣稅即日起無須再繳',	'翻查資料，樓市辣招最早可追溯至2010年11月，當時政府推出額外印花稅（SSD），限制市民在兩年內轉售單位，需要繳付樓高5至15%的SSD，當時本港樓市正處於一個穩步上揚的階段，當時CCL報89.41點。\r\n事隔兩年政府於2012年10月更推出SSD加強版，轉售時間限制調整為三年內，SSD稅款涉及樓價10至20%，當時政府更推出買家印花稅BSD，以限制非本地人士及以公司名義的買家，在港買樓時需繳付樓價15%的稅款。若以當時CCL 116.07點計算，短短兩年間樓價已上升近30%。\r\n政府為進一步壓抑樓價，於2013年2月份為樓市辣招「加辣」，更推出雙倍印花稅（DSD），調整200萬元或以下物業，稅款由100元增至樓價1.5%，其餘物業稅率也加倍，由最高稅率4.25%增至8.5%。\r\n雖然政府在2010年至2013年連環推出樓市辣招，不過及後樓價升勢未止，於2010年至2013年的三年間累升56%，CCL由2010年初報的76.17點，累升42.79點至118.96點。因此政府於2016年11月份及2017年4月再出手「加辣」，分別向買入第二套或以上物業的買家，劃一收稅樓價15%，以及採「一約多伙」15%從價印花稅，即買家以首次置業人士的名義，以一份合約購入多個單位，需繳付樓價15%的從價印花稅。\r\n總結政府推出三大辣招主因都是希望壓抑樓市升溫。不過據CCL顯示辣招首度推出的首11年，由當時最初的89.41點，持續上升至2021年8月份的歷史高位191.34點，即期間升幅高達約2.14倍。反映辣招未能達成壓抑樓市升溫的效果。\r\n於2021年8月份CCL歷史高位191.34點過後，樓市開始呈下行狀態，加上於2022年3月撞正美國加息週期，同時亦為本港樓市帶來壓力。當時有意見認為樓市辣招已經過時，要求政府重新檢視樓市相關政策。\r\n政府亦為招商引才，在2022年10月特首李家超發表首份《施政報告》 當中指出，待合資格外來人才在成為香港永久性居民後，可申請退還在港置業已繳付額外的印花稅，即「先徵後退」。\r\n即如該類人士可於居港七年並成為香港永久性居民後，就其已購入並仍然持有的首個住宅物業申請退還已繳付的買家印花稅及新住宅印花稅，但他們仍須繳交按「第二標準稅率」計算的從價印花稅。不過當時樓市未有因此而反彈，2022年12月底CCL亦已從高位回落近17.8%。',	'2024-02-28 05:33:51.260',	NULL,	'HKEX',	'印花稅辣招全面撤銷　預算案樓市三大辣稅即日起無須再繳',	'https://cdn.hk01.com/di/media/images/dw/20240228/839469345166856192891754.jpeg/GdJ4tegcobjUjqh-TH9QOLjvE6pydyV-sm0RCrJtEQo?v=w1920r16_9'),
(64,	'',	'Why South Korea’s Japan-style measures to boost its stock market may not work  ',	'<p>South Korea’s Japan-style measures for improving corporate governance may not be enough to boost its undervalued stock markets and tackle the so-called “Korea discount.”</p><p>The country’s Financial Services Commission&nbsp;on Monday revealed its “Corporate Value-up Program,” <a href=\"https://www.cnbc.com/2024/02/26/south-korea-unveils-measures-to-boost-stock-markets-tackle-korea-discount.html\">aimed at supporting shareholder returns</a> through incentives including tax benefits.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Asia’s fourth-largest economy is striving to boost stock market valuations that are considered much lower compared to peers, with analysts referring to the phenomenon as the “<a href=\"https://www.cnbc.com/2023/11/28/the-korea-discount-value-stock-or-value-trap.html\">Korea discount</a>.”</p><p>The FSC program is similar to that of Japan’s, whose corporate governance push <a href=\"https://www.cnbc.com/2024/01/12/japan-wants-higher-returns-for-investors-heres-what-its-doing.html\">to boost shareholder returns</a> as well as robust earnings have driven Tokyo markets <a href=\"https://www.cnbc.com/2024/02/22/japans-nikkei-hits-all-time-high-on-reforms-robust-corporate-earnings.html\">to record highs after 34 years</a>.</p><p>South Korea’s steps, while similar to those taken by Japan, may not prove to be as successful.</p><br /><p>South Korean markets are made up of corporations called “chaebols,” which are large family-owned global conglomerates, typically controlled by the founder’s family. Notable chaebols include Samsung Electronics, LG, SK and Hyundai.</p><p>The chaebols are also part of the reason behind the Korea discount as under these majority family-owned structures, minority stakeholders have little influence on strategic decisions.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>“Key issue is that ‘Korea discount’ exists because controlling shareholders take disproportional benefits,” said James Lim, senior research analyst at Dalton Investments, while noting that Korea has more companies with strong controlling shareholders versus Japan. “That’s where the challenge lies.”</p><p>Resistance from controlling shareholders makes changes difficult and slow, but if authorities take measures that would align with the interests of both the controlling as well as minority shareholders they could be implemented faster.</p><p>FSC has asked listed companies on the Korean Stock Exchange to “voluntarily set up and disclose valuation enhancement plans,” as part of its efforts to introduce more transparency and boost market returns.</p><p>The FSC will frame detailed guidelines and set up a dedicated web portal in June so companies can disclose their plans in the second half of 2024.</p><p>Jonathan Pines, lead portfolio manager of Asia ex-Japan&nbsp;at Federated Hermes said there are far more family-controlled companies in South Korea that are now deriving “substantial financial benefit from the regulatory&nbsp;status quo.”</p><p>“The behavior that leads to South Korea’s low stock prices is&nbsp;motivated<em>,&nbsp;</em>and therefore seeking to coax South Korean controlling families into ‘being nice’ to minority stockholders is unlikely to be successful,” Pines said.</p><br /><p>South Korean authorities have sought to ease registration requirements for foreign investors, <a href=\"https://www.fsc.go.kr/no010101/81013\" target=\"_blank\">curb short selling</a>, extend trading hours and revise dividend record dates, among other actions, aimed at improving market valuations.</p><p>But experts say FSC needs to make more concerted efforts for a significant boost to the markets.</p><p>“While the [latest] initiatives show Korea taking a step in the right direction, bigger steps need to be taken to address corporate practices that favor controlling stakeholders – usually the founding families – over smaller shareholders,” Daniel Tan, Singapore-based portfolio manager, Grasshopper Asset Management told CNBC.</p><br /><p>Tan said the recent measures such as to push listed companies to set up and disclose valuation boosting plans still largely rely on voluntary efforts, rather than being imposed as mandatory changes<em>.</em></p><p>Experts argue that targeted and strong reforms need to be in place for South Korea markets to come even close to the rally in Japanese markets.</p><p>Korean authorities&nbsp;should implement laws that require company directors to be responsible for enhancing shareholder returns rather than them being just “loyal” to the company, Federated Hermes’ Pines said.</p><p>South Korean companies should propose plans to raise stock prices to at least their book value, he added.</p><p>A price-to-book ratio measures whether a company’s shares are undervalued, with a number below 1 indicating the stock’s price may be below fair value.</p><p>For instance, the price-to-book of value of Samsung Electronics stands at 1.40, while that of Taiwan-listed <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-6\"><a href=\"/quotes/2330-TW/\">Taiwan Semiconductor Manufacturing Company</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> is 5.23 and that of U.S.-listed <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-7\"><a href=\"/quotes/AAPL/\">Apple Inc</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> was 37.80.</p><p>— <em>CNBC’s</em> <em>Lim Hui Jie and Clement Tan contributed to this story.</em></p>',	'2024-02-28 06:00:20.633',	NULL,	'US',	'Why South Korea’s Japan-style measures to boost its stock market may not work  ',	'https://image.cnbcfm.com/api/v1/image/107378662-1708994711181-gettyimages-1893314009-SKOREA_KRX.jpeg?v=1708994790&w=929&h=523&vtcrop=y'),
(65,	'',	'政府撤銷樓市印花稅辣招　新世界抽升逾8%　收租股上揚｜持續更新',	'【13:39】\r\n恒指跌幅擴大，最新報16697點，跌93點，國指跌64點，報5742點，科指跌29點，報3473點。\r\n政府撤銷所有樓市辣招，地產股全面攀升，新世界（0017）飆8.2%，恒地（0012）升7.4%，新地（0016）升3.9%，長實（1113）升3.4%，恒隆（0101）升2.7%。\r\n收租股亦上揚，九置（1997）升3.1%，領展（0823）升4.7%。\r\n金融股方面，滙豐（0005）升1.3%，中銀（2388）升2.7%。\r\n【12:15】\r\n財政司司長陳茂波正在宣讀新一份財政預算案，並宣布取消所有針對樓市辣招，受到有關消息刺激，地產股全面上揚，新世界（0017）升5.9%，新地（0016）升3.3%，長實（1113）升2.9%，恒地（0012）升4.1%，信置（0083）升2.6%。至於從事物業代理的美聯（1200）更勁升29%，中午收市報0.84元。\r\n整體大市方面，恒指中午收市報16745點，跌45點，國指跌44點，報5762點，科指跌1點，報3501點，成交額為570億元。\r\n遊戲股方面，網易（9999）飆5.5%，騰訊（0700）跌1.5%，心動公司（2400）升0.9%，創夢天地（1119）跌2%。\r\n科技股方面，阿里（9988）跌不足0.1%，美團（3690）跌2%，小米（1810）跌0.9%。\r\n金融股方面，滙豐（0005）升1.1%，恒生（0011）升0.8%，港交所（0388）跌0.9%。\r\n【11:22】\r\n財政司司長陳茂波宣布從今日（28日）起撤除所有樓市辣招，美聯（1200）應聲抽升13%，新地（0016）跌0.5%，新世界（0017）升1.9%，長實（1113）升0.3%。\r\n港股最新報16716點，跌74點。\r\n【10:26】\r\n內房股今早走勢疲弱，碧桂園（2007）遭入稟清盤，股價瀉11.1%，中海外（0688）跌0.5%，潤地（1109）跌1.4%，雅居樂（3383）跌2.5%，富力（2777）跌3.6%。\r\n恒指最新報16751點，跌38點，國指跌27點，報5779點，科指升17點，報3520點。\r\n【09:49】\r\n港股今早走勢反覆，高開後更掉頭向下，並於16800點附近爭持，最新報16826點，升35點。\r\n即將公布業績的網易（9999）揚4.3%，百度（9888）升2.2%。\r\n汽車股續上揚，理想汽車（2015）升3%，吉利（0175）升1.5%。\r\n晶片相關股方面，中芯（0981）升2.6%，ASMPT（0522）宣布派特別息，最新報95.6元，飆6.2%。\r\n【09:25】\r\n恒指最新報16833點，高開42點，國指最新報5824點，高開17點，科指最新報3527點，高開24點。\r\n新創建（0659）昨日（27日）宣布派特別息，今早開14.9%，最新報8.47元，同系的新世界（0017）高開0.4%。\r\n地產股為今日焦點之一，將於今日收市後公布業績的新地（0016）平開，長實（1113）平開，恒地（0012）高開0.9%，美聯（1200）平開。\r\n科技股方面，阿里（9988）高開0.1%，騰訊（0700）高開0.1%，美團（3690）平開。\r\n金融股方面，滙豐（0005）高開0.4%，港交所（0388）平開。\r\n汽車股方面，理想汽車（2015）高開2.6%，蔚來（9866）高開0.1%，小鵬（9868）低開0.3%。\r\n內房股方面，碧桂園（2007）遭入稟清盤，今早低開4.2%，中海外（0688）跌0.7%。',	'2024-02-28 06:00:20.975',	NULL,	'HKEX',	'政府撤銷樓市印花稅辣招　新世界抽升逾8%　收租股上揚｜持續更新',	'https://cdn.hk01.com/di/media/images/dw/20240228/839439702208548864862130.jpeg/PEEwhiQUYr1ibPPWe56tUTL2RS-pAr7lAZzi3AGc4tw?v=w1920r16_9'),
(66,	'',	'China’s Country Garden gets liquidation petition from creditor ',	'<p>China’s <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/2007-HK/\">Country Garden Holdings</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> said Wednesday it received a liquidation petition filed by one of its creditors, deepening worries about the country’s beleaguered property sector.</p><p>The troubled property developer said <a href=\"https://www1.hkexnews.hk/listedco/listconews/sehk/2024/0228/2024022800047.pdf\" target=\"_blank\">in a regulatory filing</a> it received a “winding-up” petition dated Feb. 27 filed by creditor Ever Credit Limited.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The petition was issued for the non-payment of a loan worth 1.6 billion Hong Kong dollars ($204.4 million).</p><p>Country Garden said it will oppose the petition “vigorously” and seek legal measures to do so. A court hearing will be held May 17.</p><p>Hong Kong-listed shares of the company tumbled more than 12%, far more than the 0.27% decline in the broader <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/.HSI/\">Hang Seng index</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>.</p><p>Country Garden said it intends to “proactively communicate” and work with its offshore creditors on its restructuring plan. It noted it does not expect the petition to have a substantive impact on its offshore restructuring process.</p><p>The debt-laden property developer’s update comes as authorities struggle to boost the confidence in the real estate market.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The International Monetary Fund said earlier this month that demand for new housing in China i<a href=\"https://www.cnbc.com/2024/02/02/imf-chinas-new-housing-demand-to-drop-by-50percent-in-the-next-decade.html\">s set to drop by around 50%</a> over the next decade.</p><p>In late January, property giant&nbsp;<span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-5\"><a href=\"/quotes/3333-HK/\">China Evergrande</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> was ordered by a Hong Kong court to<a href=\"https://www.cnbc.com/2024/01/29/evergrande-shares-halted-after-hong-kong-court-orders-liquidation-.html\"> liquidate</a>, which renewed concerns about China’s struggling real estate sector. Still, it seems worries about a spillover have abated as Evergrande’s issues appear <a href=\"https://www.cnbc.com/2024/01/31/evergrandes-liquidation-crisis-wont-be-chinas-lehman-moment.html\">contained.</a> </p><p>China’s property sector has historically been the bedrock of the country’s economy, accounting for a large share of gross domestic product. The industry grew rapidly over the last few decades, fueled by debt. But those debt piles have weighed on balance sheets, leading to defaults for major developers.</p><p>Companies like Country Garden and Evergrande have struggled to repay their debt obligations and are now embroiled in drawn-out debt restructuring processes.</p>',	'2024-02-28 08:23:08.508',	NULL,	'US',	'China’s Country Garden gets liquidation petition from creditor ',	'https://image.cnbcfm.com/api/v1/image/107379399-1709089951364-gettyimages-1978937797-A_Country_Garden_Residential_Area_in_Nanjing.jpeg?v=1709089988&w=929&h=523&vtcrop=y'),
(67,	'',	'Apple cancels plans to build an electric car',	'<p><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-1\"><a href=\"/quotes/AAPL/\">Apple</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> will wind down its team working on electric cars, called Special Projects Group, according <a href=\"https://www.bloomberg.com/news/articles/2024-02-27/apple-cancels-work-on-electric-car-shifts-team-to-generative-ai?srnd=undefined\" target=\"_blank\">to Bloomberg</a>.</p><p>The news signals an end to Apple’s secretive effort to build a car to rival <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/TSLA/\">Tesla</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>. The program employed thousands of employees but never fit with Apple’s core business of electronics and online services, and raised questions about <a href=\"https://www.cnbc.com/2021/02/03/apple-and-hyundai-kia-driving-towards-deal-on-apple-car.html\">where Apple would turn</a> for the manufacturing of a vehicle.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Reports of Apple’s ambition to build a car first <a href=\"https://www.wsj.com/articles/apples-titan-car-project-to-challenge-tesla-1423868072\" target=\"_blank\">surfaced in 2014</a> after the company recruited automotive engineers and other talent from auto companies. While there was little public information about Apple’s plans, the company <a href=\"https://www.cnbc.com/2017/04/14/apple-just-received-a-permit-to-test-self-driving-cars-in-california.html\">operated a program</a> with autonomous Apple-owned cars equipped with sensors and safety drivers cruising around the San Francisco Bay Area.</p><p>Apple’s Special Projects Group had several reorganizations over the years, including <a href=\"https://www.cnbc.com/2019/01/24/apple-lays-off-over-200-from-project-titan-autonomous-vehicle-group.html#:~:text=Apple%20has%20cut%20over%20200,Project%20Titan%2C%20alongside%20Bob%20Mansfield.\">layoffs in 2019</a>, when employees were moved to different parts of the company. Some Apple employees in the car division may move to a generative artificial intelligence team, according to Bloomberg.</p><p>The company has other automotive-related projects, including its infotainment <a href=\"https://www.cnbc.com/2021/05/29/apple-carplay-massive-success-paves-way-for-automotive-entry.html\">CarPlay software</a>, which Apple says is installed on 80% of new vehicles.</p><p>Apple’s car project was part of an internal effort to look for technologies the company could develop with huge potential markets. Apple continues to develop health technologies, especially for the Apple Watch. And last month, the company released its first virtual reality headset, the Vision Pro.</p><p>Some of Apple’s Asian rivals in smartphones have invested heavily in designing and potentially manufacturing cars. Xiaomi, a maker of Android smartphones, announced a new electric vehicle this week. Foxconn, Apple’s main manufacturing partner, said last year it will build electric vehicles.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Apple and CEO Tim Cook never acknowledged the car project publicly, instead referring to it as work on “autonomous systems.” In 2016, Cook was asked by a shareholder about the project, and teased that “it’s going to be Christmas Eve for a long time.”</p><p>As part of its silence, Apple’s hasn’t outlined its expenditures in the auto space. Overall, the company spent about $30 billion on research and development in 2023, a 14% increase over the prior year. Apple’s R&amp;D budget includes investments in new software and features for its existing products such as the iPhone. </p><p>Apple shares rose less than 1% on the news on Tuesday. Apple declined to comment.<br><em><strong><br>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 08:23:08.528',	NULL,	'US',	'Apple cancels plans to build an electric car',	'https://image.cnbcfm.com/api/v1/image/107367602-17067928972022-10-23t204940z_1048320918_up1eian1luq2v_rtrmadp_0_motor-f1-usa.jpeg?v=1709063943&w=929&h=523&vtcrop=y'),
(68,	'',	'CNBC Daily Open: Americans’ mood on the economy sinks',	'<p><em>This report is from today’s CNBC Daily Open, our international markets newsletter. CNBC Daily Open brings investors up to speed on everything they need to know, no matter where they are. Like what you see? You can subscribe&nbsp;</em><a href=\"https://www.cnbc.com/sign-up-for-cnbc-newsletters/\"><em>here</em></a><em>.</em></p><br /><p><strong>Hong Kong property stocks rally</strong><br>Asia markets <a href=\"https://www.cnbc.com/2024/02/28/asia-markets-.html\">were largely down</a> Wednesday, while <a href=\"https://www.cnbc.com/2024/02/28/hong-kong-property-stocks-jump-after-city-scraps-cooling-measures.html\">Hong Kong’s property stocks</a> rallied after the government’s<a href=\"https://www.budget.gov.hk/2024/eng/budget02.html\" target=\"_blank\"> budget</a> revealed measures to lift its ailing real estate sector. The <a href=\"https://www.cnbc.com/quotes/.HSI/\">Hang Seng index</a>&nbsp;fell, while the Hang Seng Property index was higher. Overnight, U.S. stocks <a href=\"https://www.cnbc.com/2024/02/26/stock-market-today-live-updates.html\">ended mixed</a> as investors prepared for key inflation data due out later this week. The <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-7\"><a href=\"/quotes/.SPX/\">S&amp;P 500</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and the <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-8\"><a href=\"/quotes/.IXIC/\">Nasdaq Composite</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> closed with small gains, up 0.17% and 0.37%, respectively. The <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-9\"><a href=\"/quotes/.DJI/\">30-stock Dow</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> fell for a second straight day, off by 0.25%.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p><strong>China beefs up national security <br></strong>China is boosting its <a href=\"https://www.cnbc.com/2024/02/28/china-doubles-down-on-national-security-expanding-its-state-secrets-law.html\">national security measures</a> by expanding its protections of state secrets. <a href=\"http://politics.people.com.cn/n1/2024/0227/c1001-40184585.html\" target=\"_blank\">The new rules</a>, to take effect May 1, describe how precautions taken for state secrets should also apply to unclassified information known as “work secrets.”&nbsp;</p><p><strong>Apple kills EV plans <br></strong>Apple has cancelled its plan <a href=\"https://www.cnbc.com/2024/02/27/apple-car-project-canceled-report.html\">to build electric cars</a>, according to Bloomberg. This signals an end to the company’s secretive effort to compete in the EV space against rival <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-13\"><a href=\"/quotes/TSLA/\">Tesla</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>. Reports of Apple’s ambition first&nbsp;<a href=\"https://www.wsj.com/articles/apples-titan-car-project-to-challenge-tesla-1423868072\" target=\"_blank\">surfaced in 2014</a>&nbsp;after it recruited automotive engineers and other talent from auto companies.&nbsp;</p><p><strong>Warner Bros. Discovery stops merger talks <br></strong><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-15\"><a href=\"/quotes/WBD/\">Warner Bros. Discovery</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>&nbsp;has <a href=\"https://www.cnbc.com/2024/02/27/warner-bros-discovery-halts-paramount-global-merger-talks.html\">halted merger talks</a> with <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-17\"><a href=\"/quotes/PARA/\">Paramount Global,</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> according to people familiar with the matter. SkyDance Media, the film and TV studio run by David Ellison, is still doing due diligence on a potential transaction, the sources said.</p><p><strong>[Pro] Alibaba’s compelling appeal</strong><br>Despite the recent slump in <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-18\"><a href=\"/quotes/BABA/\">Alibaba’s</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> shares, <a href=\"https://www.cnbc.com/2024/02/28/one-big-tech-stock-to-buy-according-to-ranmore-fund-managements-sean-peche.htmlhttps:/www.cnbc.com/2024/02/28/one-big-tech-stock-to-buy-according-to-ranmore-fund-managements-sean-peche.html\">the Chinese e-commerce giant</a> remains on the radar of fund managers. “Alibaba is our third biggest stock [position] now. Why? The valuation is absolutely compelling,” said Andrew Lapping, Ranmore’s chief investment officer.</p><br /><p>Americans’ mood about the economy has soured.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Consumer confidence fell to 106.7 in February, <a href=\"https://www.conference-board.org/topics/consumer-confidence\" target=\"_blank\">said the Conference Board</a>, down from a revised 110.9 in January. This comes after a three-month streak of rising sentiment.</p><p>The index measuring short-term expectations for income, business and the job market fell to 79.8 from 81.5 in January. A reading under 80 often signals an upcoming recession.</p><p>While Americans were less worried about food and gas prices, there were rising concerns over jobs and the upcoming presidential elections.</p><p>“The decline in consumer confidence in February interrupted a three-month rise, reflecting persistent uncertainty about the US economy,” said&nbsp;Dana Peterson, chief economist at the Conference Board.&nbsp;</p><p>“While overall inflation remained the main preoccupation of consumers, they are now a bit less concerned about food and gas prices, which have eased in recent months. But they are more concerned about the labor market situation and the US political environment.”</p><p>The fall in consumer confidence was broad based, affecting most income groups, as well as among people under 35 years old and those aged 55 and over, according to Peterson.</p><p>The findings reveal public perception on the economy will prove to be a challenge ahead of high-stakes elections this year despite a robust labor market and a surprisingly resilient economy.</p><p>If the downbeat sentiment persists it spells trouble for President Joe Biden. His administration has been trying to tout his economic accomplishments ahead of a likely rematch against Republican nominee <a href=\"https://www.cnbc.com/donald-trump/\">Donald Trump</a> in November.</p>',	'2024-02-28 08:23:08.538',	NULL,	'US',	'CNBC Daily Open: Americans’ mood on the economy sinks',	'https://image.cnbcfm.com/api/v1/image/107340925-17012896502023-11-29t202646z_1847160598_rc28n4a2nrlw_rtrmadp_0_usa-biden.jpeg?v=1701289694&w=929&h=523&vtcrop=y'),
(69,	'',	'The hottest housing markets for the super rich in 2024',	'<p>The ultrawealthy are looking for a better lifestyle and strong investment when it comes to buying their next home, according to a new study.</p><p>One-quarter of American ultra-high-net individuals, or those worth $30 million or more, plan to buy a residential property this year, according to the <a href=\"https://www.elliman.com/corporate-resources/wealth-reports\" target=\"_blank\">Douglas Elliman and Knight Frank</a> <a href=\"https://www.elliman.com/corporate-resources/wealth-reports\" target=\"_blank\">Wealth Report</a>. The average ultra-high-net-worth individual already owns four homes, according to the report. One-quarter of their residential portfolio is outside their home country.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>When it comes to priorities for their next big purchase, the ultrawealthy ranked “lifestyle” and “investment” at the top of the list, followed by taxes and safety.</p><div class=\"ArticleBody-blockquote\"><p><em>Sign up to receive future editions of&nbsp;</em><a href=\"https://www.cnbc.com/inside-wealth-newsletter/\"><em>CNBC’s Inside Wealth newsletter</em></a><em>&nbsp;with Robert Frank.</em></p></div><p>While luxury real estate has been buffeted by many of the same pressures as the rest of the market — low supply, slow sales, rising prices — the ultra-high-end has fared slightly better. Last year in the U.S., there were 34 sales over $50 million, down from 45 in 2022 but still way up from the pre-pandemic years.</p><p>With interest rates stabilizing and possibly falling this year, real estate experts say there are early signs that luxury supply may be growing, which could lead to more sales.</p><p>“If we do see a pivot to lower rates, or at least more confidence that inflation is going in the right direction, I think you will begin to see inventory building up again,” said Liam Bailey, partner and global head of research at Knight Frank.</p><p>The report forecasts that the best-performing U.S. luxury market this year for price growth will be Miami, with an expected increase of 4%, according to the report. New York ranked second in the U.S., with expected price growth of 2%, followed by Los Angeles with 1% growth.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Globally, the top market for luxury real estate is expected to be Auckland, New Zealand, with projected price growth of 10% in 2024. Mumbai ranks second, at 5.5%; followed by Dubai (5%); Madrid (5%); Sydney (5%); and Stockholm (4.5%).</p><br /><p>Last year, the world’s top 100 luxury real estate markets posted a solid 3% gain on average price. The best-performing luxury real estate market in the world was Manila, Philippines, with 26% growth, fueled in part by investors fleeing Hong Kong and China. Dubai came in second place, at 16% price growth, followed by the Bahamas at 15% and the Algarve region in Portugal at 12%.</p><p>Among the worst performers last year were New York, with prices down 2%, and San Francisco, basically flat at 0.5%. The biggest decline in the world among prime markets was Oxford, in the U.K., down 8%.</p><p>Bailey said ultrawealthy American buyers are increasingly venturing overseas. He said U.S. buyers are now the leading foreign purchasers of ultraprime London properties — those priced above $10 million. They are also increasingly active in Europe.</p><p>“They’ve become quite a big presence, so much more noticeable now in Italy, France and Portugal particularly than they were,” Bailey said. “I think the American buyers have become much happier to explore and kind of think about alternatives.”</p><p>Still, $1 million doesn’t buy what it used to in the U.S. and abroad. In Monaco, the world’s most expensive real estate market, $1 million gets you 172 square feet of prime real estate, according to the Wealth Report. In Aspen, you get 215 square feet, while in Hong Kong, you get 237 square feet, which makes New York look like a bargain with 367 square feet.</p><br /><p><em><strong>Don’t miss these stories from CNBC PRO:</strong></em></p><ul><li><a href=\"https://www.cnbc.com/2024/02/25/berkshire-hathaway-is-one-of-the-most-overbought-stocks-on-wall-street-here-are-the-others.html\"><em>Berkshire Hathaway is one of the most overbought stocks on Wall Street. Here are the others</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/23/want-a-nvda-alternative-6-chip-suppliers-look-set-to-benefit-from-ai-boom.html\"><em>Want an Nvidia alternative? These 6 chip suppliers look set to gain big from the AI boom</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/22/jefferies-says-buy-this-little-known-software-stock-with-ties-to-nvidia.html\"><em>Jefferies says buy this under-the-radar software stock with ties to Nvidia and nearly 20% upside</em></a></li><li><a href=\"https://www.cnbc.com/2024/02/21/opportune-time-to-invest-in-real-estate-pros-name-5-reits-to-buy-right-now.html\"><em>‘Opportune time to invest in real estate’: Pros name 5 REITs to buy right now</em></a></li></ul>',	'2024-02-28 08:23:08.543',	NULL,	'US',	'The hottest housing markets for the super rich in 2024',	'https://image.cnbcfm.com/api/v1/image/107379271-1709069385690-gettyimages-930155428-4035_14_monaco_1.jpeg?v=1709075852&w=929&h=523&vtcrop=y'),
(70,	'',	'陳茂波向富人開刀　逾500萬人工交16%稅　打工皇帝每年多付200萬',	'陳茂波今日提及多項加稅的措施，包括增加薪俸稅稅率的標準稅率，由現時一級制，改為兩級制，首500萬元的入息淨額繼續以15%計算，而超過500萬元的部分則以16%計算。\r\n他預計，約12,000名納稅人受影響，佔相關納稅人總數的0.6%，政府收入每年增加約9.1億元，即平均每人交多75,833元。陳茂波強調，即使實施上述標準稅率兩級制，香港的實質稅率仍低於其他先進經濟體。\r\n翻查資料，政策局長年薪為435萬元，三司副司長年薪為436萬元，律政司司長林定國年薪為450萬元，陳茂波的年薪為466萬元，政務司司長陳國基的年薪為482萬元，行政長官李家超的年薪約為542萬元。\r\n若以年薪作入息淨額計算（即未計及個人基本免稅額或其他扣稅安排），只有李家超需要多交稅，他在原來的稅制下要交約81.4萬元，在新制度下要交 81.7萬元，較原來交多約4260元。\r\n至於其他財金界高層，金管局2022年報顯示，總裁余偉文總薪酬達1,031.9萬元，在新制度下僅僅多交約5萬元。證監會行政總裁梁鳳儀去年酬金為871萬元，在新制度下亦只多交近4萬元。\r\n本港高官大部分可以倖免，但一眾富人就不得不「能者多付」！據長和（0001）2022年的年報，有「打工皇帝」之稱的霍建寧一年總酬金約2.04億元，若以年薪作入息淨額計算，霍建寧在原來的稅制要交約3,063萬元，現時在新的兩級制度下就要交3,262.2萬元，較原來多交近200萬元。\r\n而長和及長建（1038）主席李澤鉅2022年總酬金約1.06億元，在原來的稅制要交約1,589萬元，現時在新的兩級制度下就要交1,690萬元，較原來多交近101萬元。\r\n再來看新世界（0017）高層，主席鄭家純2023年酬金總額為6,030萬元，鄭志剛酬金為5,280萬元，兩位在新制度下分別多交約55萬元及50萬元。\r\n另外，九倉（0004）及九置（1997）主席吳天海2022年酬金總額為2,889萬元，在新制度下多交約24萬元。',	'2024-02-28 11:03:42.746',	NULL,	'HKEX',	'陳茂波向富人開刀　逾500萬人工交16%稅　打工皇帝每年多付200萬',	'https://cdn.hk01.com/di/media/images/2751619/org/1f1b6ac2c28c47c5c2721d4acad6d519.jpg/XdpBCXoJgJU0HYkhCkbj2Vm0ed2PXFxv3mOE3d5jhN0?v=w1920r16_9'),
(71,	'',	'財政預算案｜印花稅辣招全撤　彭博料刺激交易量增幅達50%',	'樓市全面撤辣，彭博行業研究房地產行業資深分析師黃智亮表示，措施有望為香港樓市注入新動力，可望為一手住宅物業交易量帶來高達50%增長，或重返十年平均水平，達到1.6萬宗。\r\n黃智亮指，新鴻基地產 （0016） 、長實集團 （1113） 及恒基地產 （0012） 等計劃3月推新住宅項目的龍頭地產發展商，或將受惠。',	'2024-02-28 11:03:42.754',	NULL,	'HKEX',	'財政預算案｜印花稅辣招全撤　彭博料刺激交易量增幅達50%',	'https://cdn.hk01.com/di/media/images/dw/20240228/839532094253174784561270.jpeg/dK2KvlXcAhVtwUXvWmC_AO8Li75aZHAVeKUhe3ilIXs?v=w1920r16_9'),
(72,	'',	'英偉達對華「特供」H20晶片需求大降　國產晶片成企業新選擇',	'內媒《科創板日報》報道，有產業鏈人士透露，英偉達中國「特供版」AI晶片H20，將在今年的英偉達GTC 2024大會（3月18日到3月21日）之後，全面接受預訂，最快一個月時間可以供貨，但性價比不太好，產能供應也跟不上，量供預計要到今年下半年。\r\n報道另援引北京一名經銷商說法表示，目前來看，H20的需求聲量並不大，主要是「性價比不高」，性能相當於H100的四分之一，中國國產算力晶片也是廠商的一個選擇。\r\n該經銷商表示，目前算力廠商的晶片底層技術，多數還是由英偉達支援，採用H20的優勢在於一是合規，二是遷移成本低，但是算力國產化長期來看又是一個確定的趨勢，因此對於客戶而言，會在二者之間做選擇。\r\n另一名深圳地區經銷商則指出，目前還不確定是否會進貨H20，需要根據後續的市場需求來決定。\r\nH20是英偉達針對中國市場推出的「特供」版本，目的是為了符合美國的出口管制新規。該晶片由H100「縮水」而來，於2023年10月首次曝光，同期出現的還有另外兩款晶片L20和L2。\r\nH20晶片原定去年11月發布，但此後一直被推遲。先前有市場消息顯示是因為伺服器製造商在集成該晶片時遇到問題導致延遲。\r\n中國是英偉達的第三大市場，銷售額佔其收入的五分之一。但受美國出口管制新規影響，英偉達來自大陸的資料中心收入卻顯著下降。\r\n根據英偉達最新的財報數據，儘管2023年總營收暴漲，第4季業績達到創紀錄的221億美元，年增265%。但在中國第4季的營收僅佔個位數比例。\r\n該公司預計，下一財季中國市場也會如此。以往來自中國等受限國家和地區資料中心業務收入貢獻約佔該公司整體營收的20%至25%。\r\n前述北京經銷商表示，從市場策略來講，英偉達推出H20，主要是為了穩住中國市場，在產品指標上，只要略高於中國算力產品，而不再可能會有對標海外其他產品的高標準，但這個晶片是否有需求，還需要看市場驗證。\r\n從需求方的角度來看，一名具有雲計算業務的內地廠商高層認為，公司對於在英偉達高階晶片和中國國產晶片都有儲備，對於是否會採購H20，當下不好做決策，要等到拿到貨實際測試之後才能判斷。',	'2024-02-28 11:03:42.763',	NULL,	'HKEX',	'英偉達對華「特供」H20晶片需求大降　國產晶片成企業新選擇',	'https://cdn.hk01.com/di/media/images/dw/20240224/838167506110648320028594.jpeg/VHJ2zH9f55Mc0uOWX6-KcbrhDtIPTpcGGjU1Hho1NR4?v=w1920r16_9'),
(73,	'',	'美國食品價格上漲　家樂氏CEO倡「晚餐改吃粟米片」慳錢遭轟離地',	'皮爾尼克22日現身消費者新聞與商業頻道（CNBC）節目，談及消費者面對食品價格上漲的困難。他表示，穀物類食品「相當實惠」，一碗加入牛奶和水果的粟米片價格不到1美元，是消費者面臨壓力時的絕佳選擇，因此公司正宣傳「在晚餐吃粟米片」。\r\n主持人問到該建議是否有可能出錯。皮爾尼克回答說，公司「不這樣認為」，現時宣傳效果非常好，「晚餐吃麥片」可能是現時趨勢，隨著消費者面臨財政壓力，預料會持續下去。\r\n有網民在社交平台X批評，「通脹迫使家庭作出選擇，譬如在晚餐吃粟米片省錢。而家樂氏行政總裁一邊吹噓這點，一邊展示公司利潤大幅攀升，這正是問題根源所在。」\r\n一名主婦表示，偶爾在晚餐吃玉米片，是因為快捷簡單，或者是為了「過癮」，但由一個因出售價格過高食品而致富的人，建議人們晚餐時吃粟米片省錢，是「脫離現實、荒謬和殘酷」的，其傲慢令人厭惡。\r\n美國食品和藥物管理局（FDA）最新數據顯示，美國消費者在2022 年有逾11%的可支配收入是用於食物，至2023年底，購買相同數量的食品費用將比2021年增加近20%。\r\n<strong>延伸閱讀：</strong><span class=\"cmp-link text-blue-500 hover:underline\"><a href=\"/%E5%8D%B3%E6%99%82%E5%9C%8B%E9%9A%9B/990706/%E7%BE%8E%E7%A0%94%E7%A9%B6%E6%8C%87%E5%A4%A7%E7%89%8C%E5%AD%90%E7%B4%A1%E7%B9%94%E5%93%81%E8%97%8F%E6%9C%89%E6%AF%92%E7%89%A9%E8%B3%AApfas-costco-lululemon%E4%B8%8A%E6%A6%9C#:~:text=%E8%88%87%E6%AD%A4%E5%90%8C%E6%99%82%EF%BC%8C%E7%92%B0%E5%A2%83%E5%81%A5%E5%BA%B7,%E5%B0%8D%E5%81%A5%E5%BA%B7%E6%A7%8B%E6%88%90%E7%9A%84%E9%A2%A8%E9%9A%AA%E3%80%82\" target=\"_blank\" rel=\"noreferrer\"><strong>美研究指大牌子紡織品藏有毒物質PFAS　Costco、Lululemon上榜</strong></a></span>',	'2024-02-28 11:03:42.769',	NULL,	'HKEX',	'美國食品價格上漲　家樂氏CEO倡「晚餐改吃粟米片」慳錢遭轟離地',	'https://cdn.hk01.com/di/media/images/dw/20240228/839582952655425536408769.jpeg/0PN5I9p8O7m9Mf4q6fQgNPuI6mkmmzK-cGEHYHBhB2A?v=w1920r16_9'),
(74,	'',	'美英針對伊朗及胡塞武裝推制裁　2香港公司列名單',	'美國財政部27日稱，遭制裁的是香港註冊公司Kohana Co. Ltd.及馬紹爾群島註冊公司Iridescent Co. Ltd.。美方指，Kohana持有的船隻為伊朗國防部向中國運送值逾1億美元的伊朗商品。\r\n在香港註冊的Cap Tees Shipping Co. Ltd.同時受到美、英制裁。該公司被指利用旗下船隻，為遭到制裁的胡塞武裝及伊朗金融服務商運送伊朗商品。美財政部指，該公司使用另一船隻名稱，掩飾涉事船隻身份。',	'2024-02-28 11:03:42.775',	NULL,	'HKEX',	'美英針對伊朗及胡塞武裝推制裁　2香港公司列名單',	'https://cdn.hk01.com/di/media/images/dw/20240228/839524113906143232237015.jpeg/tVmZABZ1LXmxnORn1B8-Nudp9LsMa9MwiAcO_YgHDv0?v=w1920r16_9'),
(75,	'',	'Big Oil’s favorite climate solution is ‘like trying to push water uphill,’ climate chief says',	'<p>LONDON — The head of the world’s climate science authority has compared the rollout of <a href=\"https://www.cnbc.com/2021/07/20/climate-crisis-and-carbon-capture-why-some-are-worried-about-its-role.html\">carbon capture and storage</a> (CCS) to “trying to push water uphill,” questioning a technology that the oil and gas industry has long touted as integral to net-zero emission plans.</p><p>Jim Skea, the head of the U.N.’s Intergovernmental Panel on Climate Change, warned on Tuesday that scaling up carbon capture still faces significant challenges.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>CCS refers to a suite of technologies designed to capture carbon dioxide, typically from high-emitting activities such as power generation or industrial facilities that use fossil fuels or biomass for fuel.</p><p>The captured carbon dioxide, which can also be captured directly from the atmosphere, is then compressed and transported via pipeline, ship, rail or truck to be used in a range of applications, or permanently stored underground.</p><p>Proponents believe CCS can play an important and diverse role in meeting global energy and climate goals, while some researchers, campaigners and environmental advocacy groups <a href=\"https://www.cnbc.com/2021/07/20/climate-crisis-and-carbon-capture-why-some-are-worried-about-its-role.html\">argue</a> that these technologies are not a solution.</p><p>“One of the challenges is, if you take things like solar energy, it is modular and small scale, and you can roll it through the system more quickly. Once you get past the threshold, it happens by itself,” Skea said.</p><p>“CCS is much more like trying to push water uphill to get it into technological systems, it is more challenging.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Skea’s comments came during the first day of International Energy Week, formerly known as International Petroleum Week — a three-day global energy conference in London that convenes senior industry figures.</p><br /><p>There is still some “engineering problem-solving” to be done, Skea said, underlining the point that carbon capture is likely to be just one part of decarbonization plans.</p><p>“The big challenges, for me, are around the business models and the policy framework within which it takes place. If we have the will to address these issues, then I see CCS as having a role to play. It is not the answer to everything, but it is certainly part of the picture,” Skea said.</p><p>Alongside the net-zero strategies of some of the world’s largest oil and gas companies, CCS features prominently in the climate plans of many world governments.</p><p>Late last year, nearly 200 countries at the COP28 climate conference in the United Arab Emirates <a href=\"https://www.cnbc.com/2023/12/13/countries-agree-to-deal-at-cop28-climate-summit.html\">agreed</a> to “transition away” from fossil fuels, in a text that the host nation hailed as the “UAE Consensus.”</p><p>Some have <a href=\"https://www.ox.ac.uk/news/2023-12-13-expert-comment-it-remarkable-how-much-we-agree-cop28-and-transition-fossil-fuels\" target=\"_blank\">expressed concern</a> that the deal placed carbon capture alongside renewables as technologies that can deliver a shift away from fossil fuels.</p><br /><p>Asked by CNBC about the challenges facing carbon capture as a climate solution, <a href=\"https://www.cnbc.com/quotes/SHEL-GB/\">Shell</a> Chief Economist Mallika Ishwaran said Tuesday that now is the time to “reinvigorate” CCS investment.</p><p>“I think it is, to be fair, something that has taken a while to get off the ground. We have been hearing about CCS for decades now, and we don’t see that much turning into something commercial,” Ishwaran told participants at the International Energy Week conference.</p><p>Shell’s Ishwaran said carbon capture as a technology has no intrinsic value in energy systems, but its worth is derived from its ability to remove something harmful from the atmosphere.</p><p>“I think this is the moment where you have to push on with all the technologies that are required to achieve net zero. And I would put CCS in that because there are going to be uses and cases where you need to have some amount of fossil fuels and you need to somehow find a way of abating those emissions,” she added.</p><br /><p>The International Energy Agency has previously called for the oil and gas industry to let go of the “<a href=\"https://www.iea.org/news/oil-and-gas-industry-faces-moment-of-truth-and-opportunity-to-adapt-as-clean-energy-transitions-advance\" target=\"_blank\">illusion</a>” that carbon capture is a solution to climate change, pushing instead for energy majors to ramp up investments in clean energy.</p><p>In a report released on Nov. 23, the IEA said the oil and gas industry faced a “moment of truth” where producers need to choose between contributing to a deepening climate crisis and shifting to clean energy. OPEC Secretary-General Haitham al-Ghais <a href=\"https://www.cnbc.com/2023/11/27/opec-says-oil-industry-unjustly-vilified-ahead-of-climate-talks-.html\">sought to push back</a> at the IEA’s comments, <a href=\"https://www.opec.org/opec_web/en/7262.htm\" target=\"_blank\">saying</a> the report “unjustly vilifies” the oil and gas industry.</p>',	'2024-02-28 11:03:45.260',	NULL,	'US',	'Big Oil’s favorite climate solution is ‘like trying to push water uphill,’ climate chief says',	'https://image.cnbcfm.com/api/v1/image/107379457-1709113292502-gettyimages-2036008129-AFP_34KD62T.jpeg?v=1709113418&w=929&h=523&vtcrop=y'),
(76,	'',	'China doubles down on national security, expanding its state secrets law',	'<p>BEIJING — China is beefing up national security measures by expanding its protections of state secrets to include a broad category of “work secrets.”</p><p>Chinese President Xi Jinping on Tuesday signed an order to formally adopt revisions to a law on <a href=\"https://english.news.cn/20240227/9e22a4dc279442cb831949fba77ed184/c.html\" target=\"_blank\">“Guarding State Secrets,” </a>according to state media, which reported that legislators passed the updated law at a meeting earlier that day.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p><a href=\"http://politics.people.com.cn/n1/2024/0227/c1001-40184585.html\" target=\"_blank\">The new rules</a>, set to take effect May 1, describe how precautions taken for state secrets should also apply to unclassified information known as work secrets. The law broadly defines work secrets as information that would result in an <a href=\"https://www.chinalawtranslate.com/en/secrets-law-2024/\" target=\"_blank\">“adverse impact”</a> if leaked, and said specific measures would be released separately.</p><p>That article on work secrets is “the most problematic,” said Jeremy Daum, a senior fellow at Yale Law School’s Paul Tsai China Center.</p><p>“There is a risk that individual departments will overzealously identify matters as ‘work secrets,’” Daum said. He also founded the website China Law Translate, which published an unofficial English <a href=\"https://www.chinalawtranslate.com/en/secrets-law-2024/\" target=\"_blank\">translation of the new rules</a>.</p><p>“This limits the public right to know and also exposes people to potential liability.”</p><br /><p>While China regularly discloses a certain amount of information about government plans and economic data, the country is often considered more opaque relative to many developed countries.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>For example, high-level officials in China have disappeared from public view without formal explanation. Policies, even those that support businesses, don’t always come with specific implementation dates.</p><p>Last year, <a href=\"https://www.cnbc.com/2023/07/11/chinas-new-foreign-relations-law-heres-what-it-means-for-business.html\">new Chinese laws on espionage and foreign policy included catch-all phrases such as “state secrets”</a> that were left open to interpretation by authorities. Separate rules on what kinds of data foreign businesses in China can send out of the country have <a href=\"https://www.cnbc.com/2024/01/26/china-and-us-working-to-stabilize-business-environment-beijing-says.html\">yet to provide formal clarity</a> on what qualifies as “important data” and thus subject to export restrictions.</p><br /><p>“For foreign businesses, it’s the lack of clarity that will remain an unquantified risk to doing business in China,” Daum said.</p><p>“The addition of work secrets, and mention of information that becomes secret only after being aggregated with other information, all creates concern that one might accidentally infringe secret information,” he said.</p><p>“In practice however, protection of state secrets has previously been stretched to encompass seemingly benign situations, and foreign businesses have still remained.”</p><br /><p>The updated state secrets law comes as Beijing and Washington increasingly cite national security risks when announcing new restrictions for business.</p><p>“The new law will add to a general sense among the foreign business community that the Chinese leadership’s preoccupation with national security has made the country’s operating environment more difficult,” said Gabriel Wildau, managing director at consulting firm Teneo.</p><p>“China’s economic growth outlook remains the key factor influencing foreign investment decisions, but the secrets law adds another disincentive at the margin,” he said.</p><br /><p>The rules designate state secrets as information that, if leaked, “might harm” China’s security and interests in politics, economics, national defense, foreign affairs, technology and other fields, according to China Law Translate.</p><p>The law also retained restrictions for overseas travel by people currently or recently working with state secrets.</p><p>“I don’t know that their coverage will be meaningfully expanded by the revisions, but the holistic view of national security, a theme running through this law and other recent security laws, has generally placed some barriers on travel,” Daum said.</p><p>“A document on counter-espionage precautions released a few years back, required a wide range of persons traveling in their professional capacity to have briefings on security prior to departure.”</p><br /><p>The final version of “Guarding State Secrets” has been under government discussion for months.</p><p>The revised law provides a “strong legal guarantee for better protecting national sovereignty, security and development interests,” Li Zhaozong, director of the Central Security Office and the National Administration for the Protection of State Secrets, <a href=\"http://society.people.com.cn/n1/2024/0228/c1008-40184666.html\" target=\"_blank\">wrote Wednesday in an article published by People’s Daily</a>, the Chinese Communist Party’s official newspaper. That’s according to a CNBC translation.</p><p>Li noted how it’s important to disclose information that should be made public, while ensuring confidentiality as needed. The article did not mention work secrets.</p><p>China’s National People’s Congress Standing Committee passed the final version of the updated state secrets law after considering a <a href=\"https://npcobserver.com/wp-content/uploads/2024/02/Law-on-Guarding-State-Secrets-2024-Revision_Comparison-Chart_Orig1stFinal.pdf\" target=\"_blank\">round of revisions in October</a>. The law was initially adopted in 1988.</p><p>Daum pointed out that many of the changes in the new rules are “updates for new technology and style changes.”</p><p>“The law offers clarity in a few areas, limiting liability of leadership in some instances, and providing compensation for persons whose rights have been limited due to secrecy requirements,” he added.</p><p>The National People’s Congress is set to kick off its annual meeting next week, during which the country’s top leadership will release its economic plans and outlook, as well as outline key policies.</p>',	'2024-02-28 11:03:45.265',	NULL,	'US',	'China doubles down on national security, expanding its state secrets law',	'https://image.cnbcfm.com/api/v1/image/107322262-16981550392023-10-24t134236z_46329598_rc2nu3aqwna3_rtrmadp_0_china-economy-bonds.jpeg?v=1698155136&w=929&h=523&vtcrop=y'),
(77,	'',	'From expanding screens to see-through displays: How tech giants are trying to jazz up their gadgets',	'<p>See-through screens, phones that wrap around your wrist and expandable displays — these are all concept tech that gadget makers showed off this week, in a bid to stand out from competitors in a cut-throat hardware market.</p><p>At the world’s largest mobile trade show, the Mobile World Congress in Barcelona, some of the biggest companies in the world showed off some unusual screen technology. While electronics firms have continually improved certain aspects of devices, such as battery life and cameras, the focus in recent years has shifted more toward innovations in displays, especially with the advent of foldable phones.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Screens have also become a focal point, given the increase in the amount of things on our devices.</p><p>Many of the MWC displays have also come from companies looking to create a buzz around their products and challenge the likes of Apple and Samsung.</p><p>“The sheer dominance of Apple and Samsung in connected devices means that other companies are having to go to great lengths to differentiate their products in an effort to turn consumers’ heads,” Ben Wood, chief analyst at CCS Insight, told CNBC.</p><p>“As a result we are seeing a proliferation of weird and wonderful new designs such as wrist worn phones, rollable screens, virtual 3D displays and more.”</p><p>Here’s some of the screen tech on display at MWC:</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>Tecno, a brand under the umbrella of Chinese firm Transsion that is now one of the biggest smartphone players in the world, showed off a handset with an expandable screen.</p><p>After pressing a button on the top of the device, the screen enlarges sideways.</p><p>Called the Tecno Phantom Ultimate, this is so far a concept device, and there has been no word on whether it will go on sale.</p><br /><p>Motorola showed off a phone at MWC that can be bent in various ways.</p><p>One use the company illustrated was how the phone could be contorted to fit around your wrist and match outfits.</p><p>The interface on the smartphone adapts depending on which way the phone is bent.</p><br /><p>China’s Lenovo showed a prototype of a laptop with a see-through display.</p><p>The firm, which is the world’s largest PC maker, showed how an object can be placed behind the screen and detected by the device’s cameras. Information about the object would be displayed on the screen.</p><br /><p>ZTE showed off a second-generation tablet that displays three-dimensional images. Typically, 3D images have required some sort of glasses to view, as is the case with 3D movies in theatres.</p><p>But this screen produces a 3D image without glasses.</p><p>When CNBC saw the device, the quality of the 3D image depended on the angle from which you viewed the screen.</p>',	'2024-02-28 11:03:45.270',	NULL,	'US',	'From expanding screens to see-through displays: How tech giants are trying to jazz up their gadgets',	'https://image.cnbcfm.com/api/v1/image/107378344-1708963429554-Motorola_Bendy_Phone_2.jpg?v=1708963672&w=929&h=523&vtcrop=y'),
(78,	'',	'Baidu revenue grows 6% in fourth quarter as AI and advertising boost business',	'<p>China’s Baidu said fourth-quarter revenue rose 6%, helped by gains from its artificial intelligence applications and a growing advertising business.</p><p>For the three months through December, the company reported revenue of 34.95 billion yuan ($4.92 billion), broadly in line with analysts’ average estimate of 34.97 billion yuan, according to LSEG data.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The company’s adjusted net income rose by 44% to 7.76 billion yuan, compared with 5.37 billion yuan for the same period a year earlier, beating analysts’ forecasts for 6.32 billion yuan.</p><p>As China’s largest internet search engine, Baidu makes the majority of its revenue from advertising. But as China’s economy slows and consumers spend less, Baidu has increasingly invested in AI. In March last year, it launched its ChatGPT-like ERNIE Bot in bid to capture from the potential of the technology.</p><p>The company said ERNIE AI services have already started to contribute to Baidu’s revenues.</p><p>“Throughout 2023, we made significant strides in advancing ERNIE and ERNIE Bot, reinventing our products and services, and achieving breakthroughs in monetization.”  Co-founder and CEO Robin Li said in a statement.</p><br /><p>The U.S.-listed shares of the company rose by 0.4% in trading before the bell.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Baidu’s online marketing revenue grew 6% to 19.2 billion yuan.</p><p>For the quarter, its adjusted profit was 21.86 yuan per American Depositary Share (ADS), compared with a profit of 15.25 yuan per share a year earlier. </p><p>This exceeded analysts’ average estimate of 17.87 yuan per ADS, according to LSEG.</p>',	'2024-02-28 11:30:16.525',	NULL,	'US',	'Baidu revenue grows 6% in fourth quarter as AI and advertising boost business',	'https://image.cnbcfm.com/api/v1/image/107295593-1693900544756-gettyimages-1251294603-PGONCHAR_7724.jpeg?v=1709119383&w=929&h=523&vtcrop=y'),
(79,	'',	'Hong Kong property stocks jump after city scraps cooling measures',	'<p>Stocks of Hong Kong developers rose after Financial Secretary Paul Chan scrapped property cooling measures in a bid to bolster the sector, which has been weighed down by high borrowing costs and weak economic sentiment.</p><p>In his budget speech on Wednesday, Chan announced that Hong Kong will withdraw all buy-side tightening measures for residential properties and waive stamp duties payable on the transfer of REIT units with immediate effect.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The Hang Seng Property index jumped 2.4% following the announcement, but has since slipped from session highs, while the broader&nbsp;<a href=\"https://www.cnbc.com/quotes/.HSI/\">Hang Seng index</a>&nbsp;fell 1.47%. <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-2\"><a href=\"/quotes/17-HK/\">New World Development</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> shares jumped as much as over 8% before currently trading at 4%, and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-3\"><a href=\"/quotes/14-HK/\">Hysan Development</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> added 0.3%. <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-4\"><a href=\"/quotes/16-HK/\">Sun Hung Kai Properties</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> and <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-5\"><a href=\"/quotes/1113-HK/\">CK Asset</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> rose 1.35% and 0.55% respectively, while <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-6\"><a href=\"/quotes/12-HK/\">Henderson Land Development</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> traded 3.83% higher.</p><p>Hong Kong’s housing prices, once the most expensive in the world, have plunged almost 20% since their peak in 2021 on the back of rising interest rates and dimmer market sentiment.</p><br /><p>The sale and purchase agreements for all building units in 2023 fell 2.7% from a year ago, according to the <a href=\"https://www.news.gov.hk/eng/2024/01/20240104/20240104_154349_957.html\" target=\"_blank\">city’s Land Registry</a>. Sales were also nearly 40% lower than 2021. The <a href=\"https://www.rvd.gov.hk/tc/publications/property_market_statistics.html\" target=\"_blank\">government’s home price index</a> also declined for the ninth straight month in January, falling 1.57%.</p><p>“With these reductions in stamp duty, I think we’ll see certainly a fairly quick pickup and transaction volumes,” Peter Churchouse,<strong> </strong>managing director of Portwood Capital, a leading real estate investment company. “Then towards the back end of the year, we might start to see a little bit of a pickup in property prices.”</p><p>Up until recently, the city imposed a 7.5% stamp duty on non-permanent residents purchasing property as well as additional properties purchased by permanent residents. The rates for both levies were <a href=\"https://www.cnbc.com/2023/10/25/hong-kong-cuts-stamp-duty-in-a-boost-to-real-estate-markets.html\">slashed from 15% in October</a>.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Churchouse added that this could “be a bit of a positive flip” for the wider Hong Kong stock market as it is highly correlated with the residential property market. Hong Kong’s stock markets have plunged around 40% from its highs a couple of years ago.</p><p>“We might see a little bit of light at the end of the stock market tunnel,” he said.</p><p>Chan also signaled more room to ease policies on property lending. Hong Kong’s Monetary Authority is set to make announcements later in the day.</p><p>Chan added he is expecting the economy to grow in a range of 2.5% to 3.5% this year.</p><p>Hong Kong’s government is also rolling out over 1 billion Hong Kong dollars ($127 million) to support its tourism industry.</p>',	'2024-02-28 11:30:16.530',	NULL,	'US',	'Hong Kong property stocks jump after city scraps cooling measures',	'https://image.cnbcfm.com/api/v1/image/107310412-1696305936047-gettyimages-1561706014-cfoto-hongkong230729_np1C6.jpeg?v=1696306326&w=929&h=523&vtcrop=y'),
(80,	'',	'BYD amps up brutal China EV price war with bigger discounts on new car versions',	'<p>Chinese electric vehicle giant BYD on Wednesday unveiled lower-priced new versions of its Han sedans and Tang SUVs, deepening a protracted and brutal price war in the world’s largest auto market with even larger discounts than those in 2023.</p><p>The newly launched Han sedans, available as plug-in hybrids and pure EVs, and the Tang hybrid SUV, will have a starting price that is 10.35% to 14.3% lower than previous versions, Reuters calculations showed.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The products came on the heels of BYD’s introduction of a new version of its Dolphin hatchback and newer plug-in hybrid sedan Qin Plus DM-i last week, both also at lower starting prices. </p><p>The pricing indicates that BYD is giving bigger discounts on most of these models than last year. The automaker lowered the starting price for the Qin Plus EV and hybrid by 15% and 20%, respectively, versus price cuts of 8% and 11% respectively for the two models in 2023, Reuters calculations showed. </p><p>The starting price for the Tang hybrid was unchanged last year from 2022, when BYD launched the Champion Edition of that model but the new version of Tang hybrid this year is 14% cheaper. </p><p>On the other hand, BYD has launched new brands such as Yangwang and Fangchengbao to move upmarket. It unveiled a sportscar U9 under the Yangwang brand on Sunday with a starting price of 1.68 million yuan ($233,353).  </p><p>China’s new energy vehicle sales fell 38.8% in January versus the previous month, the first such drop since August 2023, as demand faltered despite a renewed discounting push led by Tesla.</p>',	'2024-02-28 11:30:16.535',	NULL,	'US',	'BYD amps up brutal China EV price war with bigger discounts on new car versions',	'https://image.cnbcfm.com/api/v1/image/107379491-1709119607451-gettyimages-1484176088-vcg111433019475.jpeg?v=1709119627&w=929&h=523&vtcrop=y'),
(81,	'',	'Abandoned at sea, Houthi-damaged ship awaits towing to Saudi Arabia amid oil slick concerns',	'<p>A vessel impaired in a mid-February Houthi attack offshore Yemen remains abandoned at sea awaiting towing to safe harbor amid growing concerns of an oil spill.</p><p>The Iran-backed militant group claimed it dealt <a href=\"https://www.cnbc.com/2024/02/19/houthis-claim-catastrophic-attack-in-red-sea-as-crew-abandons-ship.html\">“catastrophic damage” during a Feb. 18 offensive</a> against the Belize-flagged general cargo vessel Rubymar, which the Houthis said was “at risk of potential sinking in the Gulf of Aden.” The tanker’s crew abandoned ship.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The attack caused “an 18-mile oil slick,” the U.S. Central Command said <a href=\"https://twitter.com/CENTCOM/status/1761225931656704052\" target=\"_blank\">in a social media update</a> on Feb. 24, adding that the tanker is anchored, but taking on water.</p><p>“The M/V Rubymar was transporting over 41,000 tons of fertilizer when it was attacked, which could spill into the Red Sea and worsen this environmental disaster,” Centcom said.</p><p>Roy Khoury, CEO of the Rubymar’s shipping broker Blue Fleet Group, told CNBC that the vessel is now awaiting the assistance of the U.S. navy to tow the ship to Saudi port Jeddah, as neither Aden nor the authorities of Djibouti, located opposite of Yemen, have accepted to receive the tanker on their grounds.</p><p>The Saudi foreign ministry, U.S. navy and U.S. defense department did not immediately respond to a CNBC request for comment on whether they will accept or facilitate delivery of the tanker.</p><p>Khoury added that, as the Rubymar’s crew has deserted the ship, his company has no information on the status of a possible oil leak.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>A spokesperson for the International Maritime Organization told CNBC that the organization is aware of the incident and closely monitoring the situation. As the IMO lacks operational facilities such as satellites, it also did not independently verify the oil slick.</p><p>Houthi forces have been assailing ships in the Red Sea with increasing frequency since the end of last year, disrupting marine traffic through a key route that accounts for around <a href=\"https://unctad.org/news/red-sea-black-sea-and-panama-canal-unctad-raises-alarm-global-trade-disruptions\" target=\"_blank\">12% of global maritime transit.</a> Several shipping firms and oil companies have consequently suspended journeys through the Red Sea or redirected voyages around Africa. U.S. and U.K. authorities have engaged Yemeni positions in response to the offensives, which the Houthis claim to undertake out of solidarity with Palestinian civilians harmed in the ongoing war between Israel and Palestinian militant group Hamas in the Gaza Strip.</p><p>The Rubymar’s casualty has erupted concerns over the environmental impairment of such attacks. Oil spills are widely feared for their broad and long-lasting environmental impact on marine habitats, including toxic exposure for vulnerable wildlife. &nbsp;</p><p>“Oil being a highly toxic substance means that any oil spill has adverse impacts on the surrounding environment and communities, the degree of which depends on several factors such as the quantity released and the sea current,” Julien Jreissati, MENA program director for Greenpeace, told CNBC. </p><br /><p>“In the case of Rubymar, beyond the oil leakage coming from the engine&nbsp;room, another risk originates from its potential fertilizer cargo.”</p><p>Yemen was caught on the brink of an environmental disaster for the better part of a decade, after a separate, <a href=\"https://www.un.org/en/StopRedSeaSpill\" target=\"_blank\">47-year-old decaying supertanker</a>, the FSO Safer, was stranded off the Red Sea coast after civil war ignited in the Middle Eastern country. The vessel was prevented from receiving maintenance since 2015, raising the risks of a potential oil spill that the U.N. estimates could have cost $20 billion in cleanup operations and spanned four times the size of the 1989′s Exxon Valdez leak — the second largest oil spill in U.S. history.</p><p>The U.N. said it was finally able to undertake and <a href=\"https://yemen.un.org/en/241336-united-nations-completes-removal-oil-decaying-tanker-red-sea\" target=\"_blank\">complete a ship-to-ship transfer</a> of the 1.1 million barrels from the Safer onto a separate tanker in August last year.</p><p>“Less than 2 percent of the original oil cargo remains mixed in with sediment that will be removed during the final cleaning of the&nbsp;Safer,” the U.N. said at the time.</p><p>Assessing the risks inflicted unto the Safer by the spate of nearby Houthi aggressions in the Red Sea, Greenpeace’s Jreissati said “it’s reasonable to assume that any escalation of violence in the area may pose a threat on this front.”</p>',	'2024-02-28 12:00:15.697',	NULL,	'US',	'Abandoned at sea, Houthi-damaged ship awaits towing to Saudi Arabia amid oil slick concerns',	'https://image.cnbcfm.com/api/v1/image/107379472-1709115994558-gettyimages-1183124848-dji_0118.jpeg?v=1709116039&w=929&h=523&vtcrop=y'),
(82,	'',	'Biden to issue executive order aimed at protecting Americans’ sensitive data from China, other ‘hostile countries’',	'<p>U.S. President Joe Biden will issue an executive order Wednesday intended to safeguard the personal data of American citizens from countries deemed hostile.</p><p>The executive order centers on the business of selling people’s personal information, in which companies and so-called data brokers collect and trade data. The Biden Administration is worried that data brokers and other commercial entities will sell this information to “countries of concern-which have a track record of collecting and misusing data on Americans.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Lawmakers and intelligence agencies have previously expressed <a href=\"https://www.cnbc.com/2024/01/09/china-and-cybercriminals-are-targeting-american-ai-companies.html\">concerns</a> that the Chinese Communist Party is amassing a wealth of U.S. data, posing national security concerns.</p><p>The order focusses on specific, sensitive information like genomic data, biometric data, personal health data, geolocation data, financial data and other kinds of personally identifiable information. </p><p>Hostile countries can use this data “to track Americans (including military service members), pry into their personal lives, and pass that data on to other data brokers and foreign intelligence services,” according to a White House fact sheet.</p><p>“The sale of Americans’ data raises significant privacy, counterintelligence, blackmail risks and other national security risks-especially for those in the military or national security community,” the White House said in a release on the new E.O. </p><p>“Countries of concern can also access Americans’ sensitive personal data to collect information on activists, academics, journalists, dissidents, political figures, and members of non-governmental organizations and marginalized communities to intimidate opponents of countries of concern, curb dissent, and limit Americans’ freedom of expression and other civil liberties,” the White House said.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>The executive order will direct the Department of Justice to issue several regulations intended to protect sensitive data. It will also instruct the Department of Homeland Security and the DOJ “to set high security standards to prevent access by countries of concern to Americans’ data through other commercial means, such as data available via investment, vendor, and employment relationships.”</p><p>Additionally, the order directs the Assessment of Foreign Participation in the United States Telecommunications Services Sector “to consider the threats to Americans’ sensitive personal data” when they conduct reviews of submarine cable licenses.</p><p>“These actions not only align with the U.S.′ longstanding support for the trusted free flow of data, but also are consistent with U.S.′ commitment to an open Internet with strong and effective protections for individuals’ privacy and measures to preserve governments’ abilities to enforce laws and advance policies in the public interest,” the White House explainer read.</p><p>Last week, the Biden administration announced an <a href=\"https://www.cnbc.com/2024/02/21/biden-executive-order-on-port-cybersecurity-targets-china-made-cranes.html\">executive order</a> intended to improve the cybersecurity of U.S. ports. For instance, government officials said that 80% of port equipment known as ship-to-shore cranes ports are made in China, and they are concerned that the gear could be compromised and used for surveillance.</p><p>Congress has also zeroed in on potential privacy risks posed by the data-broker industry. Last May, a bipartisan group of lawmakers&nbsp;<a href=\"https://www.cnbc.com/2023/05/10/lawmakers-press-data-brokers-to-reveal-how-they-buy-sell-information.html\">sent letters&nbsp;to over 20 companies</a> like Equifax and Oracle, asking for information about their data-collection-and-distribution methods.</p><p>“American privacy concerns in the data broker industry are not new, and existing laws do not sufficiently protect Americans’ data from misuse,” the letter said.</p><p><strong>Watch</strong>: <a href=\"https://www.cnbc.com/video/2024/02/27/trump-vs-biden-economy-what-messaging-are-voters-looking-for.html\">Trump vs. Biden economy: What messaging are voters looking for?</a></p>',	'2024-02-28 12:00:15.702',	NULL,	'US',	'Biden to issue executive order aimed at protecting Americans’ sensitive data from China, other ‘hostile countries’',	'https://image.cnbcfm.com/api/v1/image/107379046-1709054499883-gettyimages-2036072119-1111_10.jpeg?v=1709054614&w=929&h=523&vtcrop=y'),
(83,	'',	'美國商會總裁率團訪北京　李強晤代表團',	'報道指，李強稱歡迎美國企業繼續對華投資，又指謀求脫鈎、搞「小院高牆」不符合雙方根本利益，稱加強經貿合作對兩國來說是雙贏。\r\n彭博社2月26日報道，克拉克率領一組前美國政府官員前往北京，與中國政府高層和當地商界領袖，以及美國商界高管和外國外交使團代表會面。\r\n報道引述不願具名的知情人士稱，在前總統小布殊執政時期擔任美國貿易代表的施瓦布（Susan Schwab）隨同克拉克訪華。',	'2024-02-28 12:30:14.226',	NULL,	'HKEX',	'美國商會總裁率團訪北京　李強晤代表團',	'https://cdn.hk01.com/di/media/images/dw/20240125/827251816033947648941386.jpeg/8cyoKpqszhtlflZHuT8g8XkJUKYPqKGZ5NTQvuTU0L4?v=w1920r16_9'),
(84,	'',	'晉身各地1%富人要多少錢？報告指新加坡門檻逾4000萬　香港低四成',	'就全球而言，高居榜首的是摩納哥，達1288.3萬美元（約1億港元）。其後為盧森堡的1083.2萬美元（8,448萬港元），以及瑞士的850.9萬美元（6,637萬港元）。美國則排名第四，報581.3萬美元（4,534萬港元）。\r\n根據房地產諮詢公司萊坊（Knight Frank）星期三（2月28日）發布的《2024年財富報告》（The Wealth Report 2024），這是位列各地1％富人的門檻。\r\n就亞太地區而言，澳洲這1％的門檻是467.3萬美元（3,644萬港元），新西蘭為457.4萬美元（3,567萬港元），香港為309.4萬美元（2,413萬港元），日本是197.1萬美元（1,537萬港元），中國大陸是107.4萬美元（837萬港元）。\r\n報告說：「在我們今年報告評估的所有市場中，這首1％富人俱樂部的門檻，遠低於成為超高淨值人士（UHNWI）的3000萬美元門檻。另外，歐洲樞紐位居榜首，其中以摩納哥為首，加入1％俱樂部的門檻為1290萬美元。緊隨其後的是盧森堡（1080萬美元）和瑞士（850萬美元）。」\r\n報告也說：「也許令人驚訝的是，考慮到美國在總體財富創造方面的主導地位，美國以580萬美元排名第四。在整個亞太地區，新加坡以520萬美元的門檻遙遙領先。」\r\n它也指出：「我們的研究結果證實了國家之間財富分配的巨大差異，較小樞紐偏向較高的門檻。隨着西方國家尤其得努力解決政府赤字和增加稅收的需要，預計政策將更加關注財富的所在地、財富如何在各個經濟體中分配，以及政府如何既徵稅又鼓勵財富增長。這些結果並不容易確保能夠取得。」',	'2024-02-28 13:00:14.183',	NULL,	'HKEX',	'晉身各地1%富人要多少錢？報告指新加坡門檻逾4000萬　香港低四成',	'https://cdn.hk01.com/di/media/images/dw/109339a635f2e58cb4dc3596489ad4cd.jpg/8q6K7CTQvFxoCw6LCb7E8QmkLWlueZVaQv3YQ0L92EM?v=w1920r16_9'),
(85,	'',	'Leaders should consider using frozen Russian assets to bolster Ukraine’s military, EU’s von der Leyen says',	'<p>European leaders should discuss using the profits from frozen Russian assets to boost Ukraine’s military in its defence efforts against Moscow, European Commission President Ursula von der Leyen said Wednesday.</p><p>“It is time to start a conversation about using the windfall profits of frozen Russian assets to jointly purchase military equipment for Ukraine,” she said in a <a href=\"https://multimedia.europarl.europa.eu/en/video/joint-debate-european-security-and-defence-opening-statement-by-mathieu-michel-belgian-state-secretary-for-digitisation-and-ursula-von-der-leyen-president-of-the-european-commission_I253376\" target=\"_blank\">speech</a> before the European Parliament.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“There could be no stronger symbol and no greater use for that money than to make Ukraine and all of Europe a safer place to live,” von der Leyen noted. “Ultimately, this is about Europe taking responsibility for its own security.”</p><p>Around 300 billion euros ($324 billion) worth of Russian central bank assets have been frozen to date by the European Union and G7 nations in the wake of the Ukraine war. Crucially, frozen assets are, by definition, temporarily retained rather than fully seized with the ability for reallocation. Questions remain over the legality of such a confiscation and re-distribution and their due processes.</p><p>Von der Leyen’s comments come after U.S. Treasury Secretary Janet Yellen on Tuesday said it is important to find a way to unlock the value of frozen assets to bolster Ukraine, stressing there is a “strong international law, economic and moral case” to do so and that it was crucial for allies to work together on the matter.</p><p>Back in 1992, the U.N. Security Council authorized a similar step to seize frozen Iraqi assets and reroute them toward compensating the victims of Baghdad’s invasion of Kuwait.</p><p>Now in its third year, Russia’s full-fledged invasion has razed several settlements in Ukraine, including carrying out aerial attacks against Kyiv. The World Bank in March last year estimated that  $411 billion would be needed for the reconstruction and recovery of Ukraine, with costs likely to have deepened since.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><br /><p>The European Union has been considering using profits from Russian frozen assets to support Ukraine for some time now. This has included military support as well as <a href=\"https://www.cnbc.com/2023/06/13/how-europe-could-use-russian-assets-to-pay-for-ukraine-reconstruction.html\">helping Ukraine with its re-construction efforts</a>. However, officials have expressed concerns about both the legality of using frozen assets, as well as potential fallout for global currency markets.</p><p>“The cost of insecurity, the cost of a Russian victory, is far greater than any saving we could make now. And this is why it is time for Europe to step up,” von der Leyen said Wednesday.</p><p>Earlier this year, the European Union adopted a law to ensure that windfall profits from frozen Russian central bank assets were put aside, in what was widely seen as a first step towards a potential re-allocation of the funds.</p><p>Late last year, the Kremlin said that it would <a href=\"https://www.cnbc.com/2023/12/21/russia-ukraine-live-updates.html\">retaliate</a> if the European Union used profits from frozen assets to support Ukraine.</p><p>Von der Leyen on Wednesday also called for EU leaders to think about and expand on their defense policies. While the risk of war “should not be overblown,” countries must be prepared, she said. This includes rebuilding and modernizing armed forces in member countries, von der Leyen said.</p><p>“The threat of war may not be imminent, but it is not impossible,” she said.</p>',	'2024-02-28 13:00:36.075',	NULL,	'US',	'Leaders should consider using frozen Russian assets to bolster Ukraine’s military, EU’s von der Leyen says',	'https://image.cnbcfm.com/api/v1/image/107379496-1709120016102-gettyimages-2028783770-sindeyev-notitle240224_npp76.jpeg?v=1709120203&w=929&h=523&vtcrop=y'),
(86,	'',	'Bitcoin jumps above $60,000 for the first time since November 2021',	'<p><span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"SpecialReportArticle-QuoteInBody-1\"><a href=\"/quotes/BTC.CM=/\">Bitcoin</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span> continued its surge on Wednesday, shooting above $60,000 for the first time since November 2021.</p><p>The price of the flagship cryptocurrency was last higher by 6% at $60,391.10, according to Coin Metrics. Earlier, it rose as high as $60,734.42. It’s sitting just below its all-time high of $68,982.20.</p><br /><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>With the record in clear sight, the market is <a href=\"https://www.cnbc.com/2024/02/27/bitcoin-surpasses-56000-benchmark-in-latest-rally.html\">even more motivated</a> to see that level retested. Bitcoin has soared more than 18% this week alone, after a week-long pause of this year’s rally. It’s now up more than 40% for 2024.</p><p>Investors are expecting it to set a new record this year after the launch of ETFs made the asset class more accessible to institutional investors, and with the network’s upcoming halving event, which historically has set the stage for a major rally in the months that follow.</p><p>“We’ve always known that we need bitcoin to get to a place where it’s adopted and accepted on a mainstream level and now the doors have been opened up for that to happen,” said Joel Kruger, market strategist at LMAX Group. “The economics of bitcoin dictate that it should continue to drive higher.”</p><p>Ryan Rasmussen, an analyst at Bitwise Asset Management, pointed out that thanks to ETFs, the demand for bitcoin is far outpacing the supply already. That supply is about to be cut even further in April when the halving is set to take place. The halving, an event mandated in the Bitcoin code, reduces the bitcoin mining reward by half in order to limit the supply.</p><p>“We’ve only seen the tip of the iceberg,” Rasmussen said. “Institutional capital is still getting up to speed with bitcoin ETFs – platform approvals, advisor education, client education – I expect a lot more demand is still under the surface and yet to be seen.”</p>',	'2024-02-28 14:00:18.200',	NULL,	'US',	'Bitcoin jumps above $60,000 for the first time since November 2021',	'https://image.cnbcfm.com/api/v1/image/107357620-1705002801419-gettyimages-1925090359-_r7a4220_k7r9uolj.jpeg?v=1707909443&w=929&h=523&vtcrop=y'),
(87,	'',	'東京迪士尼14萬m²園區「夢幻泉鄉」開幕倒數　多個主題包括Frozen',	'共同網28日報道，「夢幻泉鄉」總面積約14萬平方米（m²），主要以《魔雪奇緣》（Frozen）、《小飛俠》（Peter Pan）、《魔髮奇緣》（Tangled）等電影為主題，其中更會有主角艾莎（Elsa）、安娜（Anna）所住的城堡，以及影片中以魔法造出的冰雪宮殿。\r\n報道指，園區總投資額約3,200億日圓（約166億港元），園內共有4個遊樂設施，包括小飛俠夢幻島歷險記、樂佩公主天燈盛會、安娜與艾莎的冰雪之旅、奇妙仙子妙妙小車，並設有新酒店及新餐廳。\r\n營運公司東方樂園董事長兼行政總裁高野由美子表示，「我們堅信隨着新園區加入，東京迪士尼渡假區將成為全球矚目的獨一無二之處。」\r\n<strong>延伸閱讀：</strong><span class=\"cmp-link text-blue-500 hover:underline\"><a href=\"/%E7%92%B0%E7%90%83%E8%B6%A3%E8%81%9E/986860/%E6%97%A5%E6%9C%AC%E5%8C%97%E6%B5%B7%E9%81%93%E5%87%BD%E9%A4%A8-%E9%AD%9A%E9%AA%A8%E6%B5%B7-%E9%8B%AA%E6%BB%BF400m%E6%B5%B7%E7%81%98-%E9%81%A0%E7%9C%8B%E5%A6%82-%E9%9B%AA%E6%B5%AA-%E6%AF%8F%E6%97%A5%E5%A2%9E%E5%8A%A0\" target=\"_blank\" rel=\"noreferrer\"><strong>日本北海道函館「魚骨海」鋪滿400m海灘　遠看如「雪浪」每日增加</strong></a></span>',	'2024-02-28 14:30:25.384',	NULL,	'HKEX',	'東京迪士尼14萬m²園區「夢幻泉鄉」開幕倒數　多個主題包括Frozen',	'https://cdn.hk01.com/di/media/images/dw/20240228/839613367759933440438759.png/h2PTjXInl4QqlWPpb8uZ6OAihG4QeAF6FyB6IxcgeiM?v=w1920r16_9'),
(88,	'',	'美股｜美上季GDP增長終值低於預期　道指早段跌近200點　油價上升',	'截至本港時間晚上11時00分，道指報38,790點，跌181點或0.47%；納指報15,935點，跌99點或0.62%；標普500指數報5,063點，跌14點或0.28%。\r\n美國去年第四季國內生產總值(GDP)終值增長3.2%，低於市場預期與初值的3.3%。期內個人消費支出（PCE）物價指數終值增長3%，前值為3.1%。\r\n油價上升，紐約原油期貨現時每桶報79.58美元，升0.71美元或0.90%；倫敦布蘭特期油報83.06美元，升0.40美元或0.48%。',	'2024-02-28 15:30:17.165',	NULL,	'HKEX',	'美股｜美上季GDP增長終值低於預期　道指早段跌近200點　油價上升',	'https://cdn.hk01.com/di/media/images/dw/20231113/800873213444755456859140.jpeg/FImJZtbjfV13-QKUJQP6K1OhFXw4UGS5dP6d5nT-neY?v=w1920r16_9'),
(89,	'',	'AirAsia unit heads for U.S. listing through SPAC deal as CEO says ‘Americans understand branding’',	'<p>AirAsia is set to list its brand management unit on the Nasdaq after finalizing a SPAC merger, as it bets on the appeal of franchise and licensing opportunities to a U.S. audience that does not yet widely know the budget airline.</p><p>Tony Fernandes, AirAsia founder and CEO of Malaysia-based Capital A Bhd. — which owns the short-haul airline and related units including the brand business — told CNBC this week that he would seek to raise awareness of the potential in Southeast Asia’s nearly 700 million-strong population and beyond.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“We picked America because Americans understand branding better than the markets in Southeast Asia,” Fernandes said, acknowledging that the AirAsia brand itself is not well known in the U.S.</p><p>“It’s my job to get investors excited about the growth potential of our brand … and also being in a very exciting part of the world, with geopolitics, ASEAN has received much more attention.”</p><p>Brand licensing opportunities could include hotels, mobile services and airlines in markets such as South Asia and Africa where AirAsia does not have subsidiaries, Fernandes said.</p><p>The deal values the new company, Capital A International, at $1.15 billion, according to a release Wednesday. The business will also look at acquisitions and licensing its 14 other brands.</p><p>In 2001, Fernandes bought the then-failing carrier AirAsia from the Malaysian government for 1 Malaysian ringgit (roughly 20 cents) and 40 million ringgit in debt. The low-cost airline has grown to a fleet of more than 240 aircraft currently.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Fernandes is engaged in a broader battle to lift Capital A out of the financially distressed status it received from Malaysian regulators during the pandemic and source capital injections to fuel further growth.</p><p>A major part of that is its <a href=\"https://www.cnbc.com/2024/01/09/malaysias-capital-a-paves-way-for-merger-of-airasias-operations-globally.html\">plan to sell off AirAsia’s core short-haul aviation business</a>, comprising several regional subsidiaries, from Capital A to its Malaysia-listed sister firm <a href=\"https://www.cnbc.com/quotes/AIRX-MY\">Air Asia X</a> — its mid- to long-haul business. That will create a unified Air Asia Group, Fernandes said, which is <a href=\"https://www.reuters.com/business/aerospace-defense/malaysias-capital-aims-raise-400-mln-equity-airasia-merger-2024-02-26/\" target=\"_blank\">targeting a $400 million equity raise</a>, according to Reuters.</p><p>Subject to regulatory approval, the deal finalized Wednesday with Aetherium Acquisition Corp.— a special purpose acquisition company, or SPAC — will result in Capital A International going public on the Nasdaq stock exchange. A SPAC is a publicly traded company formed solely to merge with or acquire another company, providing it with a swifter path to a stock market listing.</p><br /><p>SPACs saw a <a href=\"https://www.cnbc.com/2021/01/30/what-is-a-spac.html\">boom in popularity in 2020</a> and into 2021, amid frenzied market activity at the height of the Covid-19 pandemic. That flow <a href=\"https://www.cnbc.com/2022/08/03/spac-market-hits-a-wall-as-issuance-dries-up-and-valuation-bubble-bursts.html\">slowed sharply in 2022</a> as numerous companies failed to meet lofty expectations and as <a href=\"https://www.cnbc.com/2022/06/27/spacs-wipe-out-half-of-their-value-as-investors-lose-appetite-for-risky-growth-stocks.html\">market volatility</a> and interest rates began to rise.</p><p>“Why a SPAC? I see it really as a reverse listing in America,” Fernandes said. “SPACs have got a bad name because a lot of these were, I’m going to be frank, hair-brained business schemes, sending people to the moon. … We’re generating real cash flow, real profits,” he added.</p><p>On a smaller scale, AirAsia’s path will mirror that of Singapore-based, Southeast Asia-focused <span class=\"QuoteInBody-quoteNameContainer\" data-test=\"QuoteInBody\" id=\"RegularArticle-QuoteInBody-7\"><a href=\"/quotes/GRAB/\">Grab</a><span class=\"QuoteInBody-inlineButton\"><span class=\"AddToWatchlistButton-watchlistContainer\" id=\"-WatchlistDropdown\" data-analytics-id=\"-WatchlistDropdown\"><button class=\"AddToWatchlistButton-watchlistButton\" aria-label=\"Add To Watchlist\" data-testid=\"dropdown-btn\"><span class=\"AddToWatchlistButton-addWatchListFromTag\"></span></button></span></span></span>, a “super app” service, which <a href=\"https://www.cnbc.com/2021/12/02/softbank-backed-grab-begins-trading-after-completing-spac-merger.html\">began trading on the Nasdaq in December 2021</a> after closing a SPAC merger.</p><p>The SoftBank-backed company has faced a turbulent ride, with shares tumbling on their first day of trading and languishing since.</p><p>“Like it or lump it, Grab has set the way by showing that a Southeast Asian company can list in America,” Fernandes said. “It’s not going to be a walk in the park, we’ll have to work [for] it, but while we might not be as well known in America, the concept of what we’re doing is better understood in that part of the world.”</p>',	'2024-02-28 16:30:23.755',	NULL,	'US',	'AirAsia unit heads for U.S. listing through SPAC deal as CEO says ‘Americans understand branding’',	'https://image.cnbcfm.com/api/v1/image/107378533-1708979155250-gettyimages-1908689295-AFP_349R2GJ.jpeg?v=1708979169&w=929&h=523&vtcrop=y'),
(90,	'',	'Christian Horner: Red Bull team principal to remain in role after investigation into alleged inappropriate behaviour',	'<p>Christian Horner will continue in his role as Red Bull team principal after allegations of inappropriate behaviour made against him were dismissed following an investigation.</p><p>The 50-year-old was placed under investigation by the F1 team’s Austrian parent company Red Bull GmbH following an allegation of inappropriate behaviour being made against him by a female colleague.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Horner has denied the allegations throughout the process and was present at the reigning constructors’ champions 2024 car launch and pre-season testing in Bahrain last week.</p><div class=\"ArticleBody-blockquote\"><p><strong>More from Sky Sports:</strong><br><a href=\"https://www.skysports.com/f1/news/32461/13083016/christian-horner-lewis-hamilton-says-investigation-into-red-bull-boss-is-a-really-important-moment-for-f1\" target=\"_blank\">Christian Horner: Lewis Hamilton says investigation into Red Bull boss is ‘a really important moment’ for F1</a><br><a href=\"https://www.skysports.com/tennis/news/12110/13082781/andy-murray-knocked-out-of-dubai-championships-with-convincing-defeat-to-ugo-humbert\" target=\"_blank\">Andy Murray knocked out of Dubai Championships with convincing defeat to Ugo Humbert</a><br><a href=\"https://www.skysports.com/football/news/28508/13082848/england-manager-sarina-wiegman-admits-frustration-over-euros-draw-delay\" target=\"_blank\">England manager Sarina Wiegman admits frustration over Euros draw delay</a></p></div><p>The first grand prix of the new Formula 1 season takes place in Bahrain this week, with track action starting on Thursday ahead of Saturday’s race.</p><p>“The independent investigation into the allegations made against Mr Horner is complete, and Red Bull can confirm that the grievance has been dismissed,” a statement from Red Bull GmbH said.</p><p>“The complainant has a right of appeal. Red Bull is confident that the investigation has been fair, rigorous and impartial.</p><p>“The investigation report is confidential and contains the private information of the parties and third parties who assisted in the investigation, and therefore we will not be commenting further out of respect for all concerned. Red Bull will continue striving to meet the highest workplace standards.”</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>Horner attended an interview on February 9 with the external specialist barrister carrying out the investigation, but no resolution on the matter was reached at that stage.</p><p>Attending the team’s car launch six days later at their Milton Keynes base, Horner addressed the media for the first time since the allegations became public, and reiterated his denial.</p><p>Horner has been in charge of Red Bull Racing since it formed in 2005 and has led the squad to seven drivers’ titles and six constructors’ triumphs in 19 seasons.</p>',	'2024-02-28 16:30:23.761',	NULL,	'US',	'Christian Horner: Red Bull team principal to remain in role after investigation into alleged inappropriate behaviour',	'https://image.cnbcfm.com/api/v1/image/107379724-1709135826237-gettyimages-2030189624-bah24testr31_5394.jpeg?v=1709135862&w=929&h=523&vtcrop=y'),
(91,	'',	'China’s Premier Li urges stronger economic, trade ties with U.S.',	'<p>China and the United States should strengthen economic and trade ties and Washington should avoid decoupling from China, Chinese Premier Li Qiang said on Wednesday, during a meeting with a visiting U.S. delegation, Chinese state radio reported.</p><p>“Strengthening economic and trade cooperation is a win-win situation for both countries,” Li told the delegation led by Chamber of Commerce chief Suzanne Clark.</p><div style=\"height:100%\" class=\"lazyload-placeholder\"></div><p>“Seeking decoupling and building ‘small yards with high walls’ do not align with the fundamental interests of both sides,” he added.</p><p>Li said U.S. companies were welcome to continue investing in China and that barriers were not in the fundamental interests of both sides.</p><p>Clark is leading a delegation of former U.S. government officials to Beijing this week, the group has said.</p><p>The visit comes as the United States and China gradually resume engagements after the two economic superpowers’ most tense relations in years, at loggerheads over the future of democratically ruled Taiwan, territorial claims in the South China Sea and trade policies.</p><p>Ties are still recovering after the United States downed an alleged Chinese spy balloon a year ago.</p>',	'2024-02-28 16:30:23.771',	NULL,	'US',	'China’s Premier Li urges stronger economic, trade ties with U.S.',	'https://image.cnbcfm.com/api/v1/image/107379719-1709135457634-gettyimages-1539398352-AFP_33PC2RF.jpeg?v=1709135476&w=929&h=523&vtcrop=y');
